INSERT INTO `articles` (`id`, `s_title`, `s_description`, `s_keywords`, `title`, `description`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, NULL, 'Добавить ВУЗ', '<p>Studypage.net &ndash; это инновационный, живой сайт, который непрерывно взаимодействует с каждым потенциальным абитуриентом и студентом представляя самые свежие информации в сфере высшего образования в Республике Казахстан.</p>\r\n\r\n<p>Обычные каталоги учебных заведений &ndash; вчерашний день! Мы учли современные особенности поиска и восприятия информации аудиторией в Интернете, и заложили, коммуникативный тип подачи информации на сайте. Размещение на studypage.net &ndash; это правильное решение для всех современных ВУЗов, думающих о будущем.</p>\r\n\r\n<p>Наша команда непрерывно добавляет ВУЗы в базу сайта. Базовое размещение учебного заведения на сайте &ndash; бесплатно. Однако, в связи с тем, что мы создаем исключительно качественный контент учебных заведений и их образовательных программ, этот процесс весьма трудоемкий, и мы не можем гарантировать сроки размещения&nbsp; конкретного ВУЗа бесплатно. Чтобы мы могли гарантировать сроки, качественное и приоритетное размещение в соответствие со всеми пожеланиями, мы предложим Вам оплатить нашу работу по созданию контента. Стоимость размещения будет зависеть от объема работы, региона учебного заведения.</p>\r\n\r\n<p>Чем большую популярность будет набирать сайт &ndash; тем ценнее будет размещение на нем и тем больше пользы это принесет ВУЗу. Спешите добавить Ваш ВУЗ на сайт!</p>', '2019-01-07 05:26:39', '2019-11-20 06:47:02'),
(2, NULL, NULL, NULL, 'О сайте', '<p>Studypage.net &ndash; это кардинально новый подход по систематизированному предоставлению информа&shy;ции о рынке высшего образования Казахстана. Мы с одной стороны, стремимся помочь студентам и абитуриентам получить доступ к информации о высшем образовании, где все сведения либо доступны в ограниченном виде, либо не систематизированы. С другой стороны, мы помогаем ВУЗам находить студентов и абитуриентов по всей стране.</p>\r\n\r\n<p><strong>Отличие сайта Studypage.net</strong><strong>&nbsp;от других сайтов в сфере высшего образования:</strong></p>\r\n\r\n<ul>\r\n	<li>Сайт studypage.net&nbsp;имеет уникальную поисковую систему, которая не имеет аналога на пространстве СНГ и ближнего зарубежья. При помощи поисковой системы абитуриент и студент может настроить поиск по ВУЗу, направлению обучения (профессии), специальности, городу и т.д. и сравнить варианты получения образования с друг другом. Это позволит быстро найти нужные и оптимальные варианты для абитуриента и студента. И самое главное, все это можно теперь сделать в любое время, в любом месте и не выходя из дома. Такую уникальную возможность до сих пор не давал ни один сайт;</li>\r\n	<li>Калькулятор ЕНТ сегодня широко распространен в Интернете. Но мы подошли иначе к этой задаче, чтобы было удобно для анализа абитуриента. Мы создали программу, которая позволяет оценить шансы поступления на конкретную специальность обучения или на специальность выбранного ВУЗа, отсортированный по степени вероятности (высокий, средний, низкий) поступления. А именно в списке специальностей можно увидеть прогноз вероятности поступления в соответствии с баллами абитуриента.</li>\r\n</ul>\r\n\r\n<p>Нашим главным приоритетом является создание отличного продукта, который будет соответствовать потребностям людей. Именно поэтому Ваше мнение очень важно для нас. Просим Вас отправлять любые замечания, предложения или отзывы по адресу: info.studypage@gmail.com.&nbsp;Это очень важно, поскольку, получение обратной связи от Вас, позволяет нам получать вдохновение и еще больше улучшать представляемый нами сервис.</p>', '2019-01-07 05:31:04', '2019-11-19 03:02:16'),
(3, NULL, NULL, NULL, 'Рекламодателям', '<p>Качественное создание контента учебного заведения и его постоянная актуализация весьма затратный процесс. Мы, конечно, планируем охватить все учебные заведения Казахстана, но понятно, что планы бесплатного размещения мы составляем по собственным приоритетам. Если Вы хотите, чтобы ваше учебное заведение гарантировано быстро было размещено на сайте, необходимо&nbsp;оплатить услугу - Приоритетное размещение ВУЗа.</p>\r\n\r\n<p><strong>Приоритетное размещение ВУЗа:</strong></p>\r\n\r\n<ul>\r\n	<li>Анализ контента вуза, создание и оформление страницы вуза: описание, фотографии, видео и др;</li>\r\n	<li>Создание профилей и программ бакалавриата, магистратуры и докторантуры: подбор имиджей, создание описаний и&nbsp;тест оценки шансов поступления;</li>\r\n	<li>Создание каталога специальностей учебного заведения;</li>\r\n	<li>Рекламная система: вы можете создавать лендинги ваших мероприятий (дней открытых дверей, олимпиад и т.п.), специальные ссылки, которые позволят вам оперативно отслеживать эффективность различных рекламных каналов;</li>\r\n	<li>Управление публикацией событий Календаря учебного заведения.</li>\r\n</ul>\r\n\r\n<p>В результате такого построения бизнес-процессов у учебного заведения формируется база потенциальных абитуриентов с информацией об их интересах, что позволяет строить дифференцированную работу с каждым сегментом.&nbsp;&nbsp;</p>\r\n\r\n<p>Стоимость услуги варьируется в зависимости от региона учебного заведения, количества образовательных программ&nbsp;и другие. Детали можете узнать у наших специалистов.</p>\r\n\r\n<p>Площадка studypage.net&nbsp;также может быть интересна и другим рекламодателям.&nbsp;Мы поможем разместить баннеры, разработать специальные проекты на сайте и осуществить проекты e-mail маркетинга.&nbsp;</p>', '2019-01-07 05:31:26', '2019-11-18 23:47:10'),
(4, '1', '2', '3', 'Пользовательское соглашение', '<p><strong>1. Термины и определения, используемые в настоявшем Соглашении</strong></p>\r\n\r\n<p>1.1.&nbsp;<strong>Сайт </strong>- это совокупность информационных ресурсов и материалов, размещенных в соответствии с законодательством Республики Казахстан в информационно-телекоммуникационной сети Интернет, по сетевому адресу (доменному имени) www.studypage.net/article/4 Администрацией сайта, а также на всех его поддоменах.</p>\r\n\r\n<p>1.2.&nbsp;<strong>Пользователь</strong> - физическое лицо и/или юридическое лицо, выразившее Согласие на обработку персональных данных в рамках действующего законодательства Республики Казахстан, согласив&shy;шееся с условиями настоящего Соглашения, использующие Сервисы Cайта исключи&shy;тельно для личных нужд, не связанных с осуществлением предпринимательской деятельности.</p>\r\n\r\n<p>Пользователь и/или Клиент сайта при регистрации самостоятельно выбирает свой статус и определяет себя в соответствии с одной из имеющихся на Сайте категорий:</p>\r\n\r\n<ul>\r\n	<li>&laquo;ВУЗ&raquo;</li>\r\n	<li>&laquo;Специалист&raquo;</li>\r\n	<li>&laquo;Бакалавриат&raquo;</li>\r\n	<li>&laquo;Магистратура&raquo;</li>\r\n	<li>&laquo;Студент ВУЗа&raquo;</li>\r\n	<li>&laquo;Студент колледжа&raquo;</li>\r\n	<li>&laquo;Докторантура PhD&raquo;</li>\r\n	<li>&laquo;Родитель будущего абитуриента&raquo;</li>\r\n	<li>&laquo;Школьник не выпускного класса&raquo;</li>\r\n	<li>&laquo;Школьник выпускного класса или абитуриент&raquo;</li>\r\n	<li>&laquo;Уже работаю, хочу получить высшее образование&raquo;</li>\r\n</ul>\r\n\r\n<p>1.3.<strong> Клиент сайта</strong>&nbsp;- Высшие учебные заведения, средне-специальные учебные заведения, имеющие установленные нормами законодательства Республики Казахстан аккредитацию и лицензии в сфере высшего и средне-специального образования, и иные организации, предоставляющие информацию об образовательных услугах.</p>\r\n\r\n<p>1.4.<strong> Регистрация</strong>&nbsp;- совокупность действий Пользователя и Клиента сайта в соответствии с указанными на Сайте инструкциями, включая предоставление персональных данных и иной информации, совершаемых Пользователем и/или Клиентом сайта с использованием специальной формы пользовательского интерфейса в целях формирования Личного кабинета и получения доступа к отдельным сервисам Сайта.</p>\r\n\r\n<p>1.5.&nbsp;<strong>Личный кабинет</strong>&nbsp;- учетная запись, доступная Пользователю и Клиенту сайта после регистрации на Сайте.&nbsp;</p>\r\n\r\n<p><strong>2. Общие положения</strong></p>\r\n\r\n<p>2.1. ТОО &laquo;STUDYPAGE.NET&raquo; (далее - Администрация сайта) предоставляет пользователю сети Интернет и Клиентам сайта доступ к просмотру, анализу и использованию Сайта, его материалов, сервисов и функциональных возможностей на условиях, изложенных в настоящем Пользовательском соглашении (далее - Соглашение, ПС). Соглашение вступает в силе с момента выражения Пользователем и/или Клиентом сайта согласия с его условиями в порядке, предусмотренном пункте 2.3. Соглашения.</p>\r\n\r\n<p>2.2. Использование сервисов Сайта регулируется настоящим Соглашением, Политикой конфиденциальности, а также условиями отдельных сервисов. Соглашение может быть изменено Администрацией сайта без какого-либо специального уведомления, новая редакция Соглашения вступает в силу с момента ее размещения в сети Интернет по указанному в настоящем абзаце адресу, если иное не предусмотрено новой редакцией Соглашения. Действующая редакция ПС всегда находится на странице по адресу: www.studypage.net/article/4</p>\r\n\r\n<p>2.3. Начиная использовать какой-либо сервис/его отдельные функции, либо пройдя процедуру регистрации, Пользователь и/или Клиент сайта считается принявшим условия Соглашения в полном объеме, без всяких оговоров и исключений. В случае несогласия Пользователем и/или Клиент сайта с какими-либо из положений Соглашения, Пользователь и/или Клиент сайта не праве использовать сервисы Сайта. В случае если Администрацией сайта были внесены какие-либо изменения в Соглашение в порядке, предусмотренном пунктом 2.2. Соглашения, с которыми Пользователь и/или Клиент сайта не согласен, он обязан прекратить использование сервисов Сайта.</p>\r\n\r\n<p>2.4. Положения настоящего Соглашения распространяется также на отношения, связанные с правами и интересами третьих лиц, не являющими Пользователями сайта и Клиентами сайта, не посматривающих Сайт, но чьи права и интересы могут быть затронуты в результате Пользователей и/или Клиентов сайта.</p>\r\n\r\n<p><strong>3. Регистрация Пользователя. Учетная запись Пользователя</strong></p>\r\n\r\n<p>3.1. Для того, чтобы воспользоваться некоторыми сервисами Сайта или некоторыми отдельными функциями сервисов, Пользователю и/или Клиенту сайта необходимо пройти процедуру регистрации, в результате которой для Пользователя и/или Клиента сайта будет создана уникальная учетная запись.</p>\r\n\r\n<p>3.2. Для регистрации Пользователь и/или Клиент сайта обязуется предоставить достоверную и полную информацию о себе по вопросам, предлагаемым в форме регистрации, и поддерживать эту информацию в актуальном состоянии. Если Пользователь и/или Клиента сайта предоставляет неверную информацию или у Администрации сайта есть основания полагать, что предоставленная Пользователем и/или Клиентом сайта информация неполна или недостоверна, Администрация сайта имеет право по своему усмотрению заблокировать либо удалить учетную запись Пользователя и/или Клиента сайта и отказать Пользователю и/или Клиенту сайта в использовании своих сервисов (либо их отдельных функций). При регистрации Пользователь и/или Клиент сайта может загрузить изображение для учетной записи (аватар). Изображение учетной записи может сопровождать опубликованные Пользователем и/и Клиентом сайта материалы в рамках использования сервисов Сайта. Изображение учетной записи должно соответствовать требованиям раздела 5 настоящего Соглашения. В случае использования в качестве изображения учетной записи изображения Пользователя и/или Клиента сайта, Пользователь и/или Клиент сайта осознает и соглашается с тем, что Администрация сайта вправе проводить опубликование и дальнейшее использование изображения Пользователя и/или Клиента сайта для использования в сервисах Сайта, в рекламных продуктах, корпоративных блогах и аккаунтах Сайта на сторонних ресурсах.&nbsp;&nbsp;</p>\r\n\r\n<p>3.3. Администрация сайта оставляет за собой право в любой момент потребовать от Пользователя и/или Клиента сайта подтверждения данных, указанных при регистрации, и запросить в связи с этим подтверждающие документы (в частности - документы, удостоверяющие личность), не предоставление которых, по усмотрению Администрации сайта, может быть приравнено к предоставлению недостоверной информации и повлечь последствия, предусмотренные пункте 3.2 Соглашения. В случае если данные Пользователя и/или Клиента сайта, указанные в предоставленных им документах, не соответствуют данным, указанным при регистрации, а также в случае, когда данные, указанные при регистрации, не позволяют идентифицировать пользователя, Администрация сайта вправе отказать Пользователю и/или Клиенту сайта в доступе к учетной записи и использовании сервисов Сайта.&nbsp;</p>\r\n\r\n<p>3.4. Персональная информация Пользователя и/или Клиента сайта, содержащаяся в учетной записи Пользователя и/или Клиента сайта, хранится и обрабатывается Администрацией сайта.</p>\r\n\r\n<p>3.5. Средства для доступа к учетной записи Пользователя и/или Клиента сайта.</p>\r\n\r\n<p>3.5.1. При регистрации Пользователь и/или Клиент сайта самостоятельно выбирает себе логин (уникальное символьное имя учетной записи Пользователя и/или Клиента сайта) и пароль для доступа к учетной записи. Администрация сайта вправе запретить использование определенных логинов, а также устанавливать требования к логину и паролю (длина, допустимые символы и т.д.).</p>\r\n\r\n<p>3.5.2. После регистрации учетной записи Пользователь и/или Клиент сайта имеет возможность начать использовать альтернативное средство аутентификации для доступа к учетной записи, заменив им установленный пароль. Доступ к такому средству предоставляется посредствам настройки двухфакторной аутентификации в интерфейсе управления учетной записью Пользователя и/или Клиента сайта.</p>\r\n\r\n<p>3.5.3 После осуществления Пользователем и/или Клиентом сайта входа в учетную запись, введенные Пользователем и/или Клиентом сайта на своем устройстве данные учетной записи могут быть автоматически сохранены в браузере устройства до завершения Пользователем и/или Клиентом сайта работы под своей учетной записью и не требовать дополнительного ввода средств доступа к учетной записи при каждом использовании сервисов Сайта.</p>\r\n\r\n<p>3.6. Пользователь и/или Клиент сайта самостоятельно несет ответственность за безопасность (устойчивость к угадыванию) выбранных им средств для доступа к учетной записи, а также самостоятельно обеспечивает их конфиденциальность. Пользователь и/или Клиент сайта самостоятельно несет ответствен&shy;ность за все действия (а также их последствия) в рамках или с использованием сервисов Сайта под учетной записью Пользователя и/или Клиента сайта, включая случаи добровольной передачи Пользователем и/или Клиентом сайта данных для доступа к учетной записи Пользователя и/или Клиента сайта третьим лицам на любых условиях (в том числе по договорам или соглашениям). При этом все действия в рамках или с использованием сервисов Сайта под учетной записью Пользователя и/или Клиента сайта считаются произведенными самим Пользователем и/или Клиентом сайта.&nbsp;&nbsp;</p>\r\n\r\n<p>3.7. Пользователь и/или Клиент сайта обязан немедленно уведомить Администрацию сайта о любом случае несанкциони&shy;рован&shy;ного (не разрешенного Пользователем и/или Клиентом сайта) доступа к сервисам Сайта с использованием учетной записи Пользователя, Клиента сайта и/или о любом нарушении (подозрениях о нарушении) конфиденциальности своих средств доступа к учетной записи. В целях безопасности, Пользователь и/или Клиент сайта обязан самостоятельно осуществлять безопасное завершение работы под своей учетной записью (кнопка &laquo;Выход&raquo;) по окончании каждой сессии работы с сервисами Сайта. Администрация сайта не отвечает за возможную потерю или порчу данных, а также другие последствия любого характера, которые могут произойти из-за нарушения Пользователем и/или Клиентом сайта положений этой части Соглашения.</p>\r\n\r\n<p>3.8. Использование Пользователем и/или Клиентом сайта своей учетной записи.</p>\r\n\r\n<p>3.8.1. Пользователь и/или Клиент сайта не вправе воспроизводить, повторять и копировать, продавать и перепродавать, а также использовать для каких-либо коммерческих целей какие-либо части сервисов Сайта (включая контент, доступный Пользователю и/или Клиенту сайта посредством сервисов), или доступ к ним, кроме тех случаев, когда Пользователь и/или Клиент сайта получил такое разрешение от Администрации сайта, либо когда это прямо предусмотрено пользовательским соглашением какого-либо сервиса.</p>\r\n\r\n<p>3.8.2. Некоторые категории учетных записей Пользователей и/или Клиентов сайта могут ограничивать или запрещать использование некоторых сервисов Сайта или их отдельных функций в случае если это предусмотрено при регистрации, либо в условиях использования того или иного сервиса.</p>\r\n\r\n<p>3.9. Прекращение регистрации. Администрация сайта вправе заблокировать или удалить учетную запись Пользователя и/или Клиента сайта, а также запретить доступ с использованием какой-либо учетной записи к определенным сервисам Сайта, и удалить любой контент без объяснения причин, в том числе в случае нарушения Пользователем и/или Клиентом сайта условий Соглашения или условий иных документов, предусмотренных пунктом 2.2. Соглашения.</p>\r\n\r\n<p>3.10. Удаление учетной записи Пользователя и/или Клиента сайта.</p>\r\n\r\n<p>3.10.1. Пользователь и/или Клиент сайта вправе в любой момент удалить свою учетную запись на всех сервисах Сайта или при наличии соответствующей функции прекратить ее действие в отношении некоторых из них.</p>\r\n\r\n<p>3.10.2. Удаление учетной записи Сайта осуществляется в следующем порядке:</p>\r\n\r\n<p>3.10.2.1. учетная запись блокируется на срок один месяц, в течение которого доступ Пользователя и/или Клиента сайта к своей учетной записи становится невозможен, при этом контент размещенный с помощью такой учетной записи может быть удален;</p>\r\n\r\n<p>3.10.2.2. если в течение указанного выше срока учетная запись Пользователя и/или Клиента сайта будет восстановлена, доступ к учетной записи для Пользователя и/или Клиента сайта восстановится, однако контент, размещенной с ее помощью, может не подлежать восстановлению;</p>\r\n\r\n<p>3.10.2.3. если в течение указанного выше срока учетная запись Пользователя и/или Клиента сайта не будет восстановлена, весь контент, размещенный с ее использованием, будет удален, а логин будет доступен для использования другим пользователям. С этого момента восстановление учетной записи, какой-либо информации, относящейся к ней, а равно доступов к сервисам Сайта с использованием этой учетной записи - невозможны.</p>\r\n\r\n<p>3.10.3. Приведенный в подпунктах 3.10.2.1., 3.10.2.2., 3.10.2.3. Соглашения (за исключе&shy;нием доступности логина для использования другими пользователями) порядок применим также к запрету доступа с использованием какой-либо учетной записи к определенным сервисам.</p>\r\n\r\n<p><strong>4. Общие положения об использовании и хранении</strong></p>\r\n\r\n<p>4.1. Администрация сайта вправе устанавливать ограничения в использовании сервисов для всех Пользователей и Клиентов сайта, либо для отдельных их категорий (в зависимости от места пребывания, языка, на котором предоставляется сервис и т.д.).</p>\r\n\r\n<p>4.2. Администрация сайта вправе посылать своим Пользователям и/или Клиентам сайта информационные сообщения. Используя сервисы Сайта, Пользователь и/или Клиент сайта также дает свое согласие на получение сообщений рекламного характера. Пользователь и/или Клиент сайта вправе отказаться от получения сообщений рекламного характера путем использования соответствующего функционала того сервиса, в рамках которого или в связи, с которым Пользователем и/или Клиентом сайта были получены сообщения рекламного характера.</p>\r\n\r\n<p>4.3. В целях повышения качества сервисов Сайта вправе осуществлять сбор мнений и отзывов Пользователей и/или Клиентов сайта по различным вопросам путем направления информационного сообщения при очередном посещении Пользователем и/или Клиентом сайта. Собранные мнения и отзывы могут быть использованы для формирования статистических данных, которые могут быть использованы в сервисах Сайта. Отзывы, оставленные Пользователем и/или Клиентом сайта с использованием его учетной записи, также могут быть опубликованы Администрацией сайта в сервисах Сайта либо в сервисах, аффилированных с Администрацией сайта лиц, как с указанием имени (логина) пользователя и/или Клиента сайта, так и без указания. При написании отзывов Пользователь и/или Клиент сайта обязуется руководствоваться требованиями настоящего Соглашения, в том числе требованиями, установленными пунктом 5 настоящего Соглашения.</p>\r\n\r\n<p><strong>5. Контент </strong><strong>Пользователя и/или Клиента сайта</strong></p>\r\n\r\n<p>5.1. Клиент сайта самостоятельно несет ответственность за соответствие содержания размещаемого Клиентом сайта контента требованиям действующего законодательства, включая ответственность перед третьими лицами в случаях, когда размещение Клиентом сайта того или иного контента или содержание контента нарушает права и законные интересы третьих лиц, в том числе личные неимущественные права авторов, иные интеллектуальные права третьих лиц, и/или посягает на принадлежащие им нематериальные блага.</p>\r\n\r\n<p>5.2. Клиент сайта признает и соглашается с тем, что Администрация сайта не обязана просматривать контент любого вида, размещаемый и/или распространяемый Клиентом сайта посредством сервисов Сайта, а также то, что Администрация сайта имеет право (но не обязанность) по своему усмотрению отказать Клиенту сайта в размещении и/или распространении им контента или удалить любой контент, который доступен посредством сервисов Сайта. Клиент сайта осознает и согласен с тем, что он должен самостоятельно оценивать все риски, связанные с использованием контента, включая оценку надежности, полноты или полезности этого контента.</p>\r\n\r\n<p>5.3. Клиент сайта осознает и соглашается с тем, что технология работы сервисов может потребовать копирование (воспроизведение) контента Клиента сайта, а также переработки его для соответствия техническим требованиям того или иного сервиса Сайта.</p>\r\n\r\n<p><strong>6. Условия использования сервисов </strong><strong>Сайта</strong></p>\r\n\r\n<p>6.1. Пользователь и/или Клиент сайта самостоятельно несет ответственность перед третьими лицами за свои действия, связанные с использованием Сервиса, в том числе, если такие действия приведут к нарушению прав и законных интересов третьих лиц, а также за соблюдение законодательства при использовании Сервиса.</p>\r\n\r\n<p>6.2. При использовании сервисов Сайта Пользователь и/или Клиент сайта не вправе:</p>\r\n\r\n<p>6.2.1. загружать, посылать, передавать или любым другим способом размещать и/или распространять контент, который является незаконным, вредоносным, клеветническим, оскорбляет нравственность, демонстрирует (или является пропагандой) насилия и жестокости, нарушает права интеллектуальной собственности, пропагандирует ненависть и/или дискриминацию людей по расовому, этническому, половому, религиозному, социальному признакам, содержит оскорбления в адрес каких-либо лиц или организаций, содержит элементы (или является пропагандой) порнографии, детской эротики, представляет собой рекламу (или является пропагандой) услуг сексуального характера (в том числе под видом иных услуг), разъясняет порядок изготовления, применения или иного использования наркотических веществ или их аналогов, взрывчатых веществ или иного оружия;</p>\r\n\r\n<p>6.2.2. нарушать права третьих лиц, в том числе несовершеннолетних лиц и/или причинять им вред в любой форме;</p>\r\n\r\n<p>6.2.3. выдавать себя за другого человека или представителя организации и/или сообщества без достаточных на то прав, в том числе за сотрудников Администрации сайта, за модераторов форумов, за владельца сайта, а также применять любые другие формы и способы незаконного представительства других лиц в сети, а также вводить пользователей или Администрации сайта в заблуждение относительно свойств и характеристик каких-либо субъектов или объектов;</p>\r\n\r\n<p>6.2.4. загружать, посылать, передавать или любым другим способом размещать и/или распространять контент, при отсутствии прав на такие действия согласно законодательству или каким-либо договорным отношениям;</p>\r\n\r\n<p>6.2.5. загружать, посылать, передавать или любым другим способом размещать и/или распространять не разрешенную специальным образом рекламную информацию, спам (в том числе и поисковый), списки чужих адресов электронной почты, схемы &laquo;пирамид&raquo;, многоуровневого (сетевого) маркетинга (MLM), системы интернет-заработка и e-mail-бизнесов, &laquo;письма счастья&raquo;, а также использовать сервисы Сайта для участия в этих мероприятиях, или использовать сервисы Сайта, исключительно для перенаправления пользователей на страницы других доменов;</p>\r\n\r\n<p>6.2.6. загружать, посылать, передавать или любым другим способом размещать и/или распространять какие-либо материалы, содержащие вирусы или другие компьютерные коды, файлы или программы, предназначенные для нарушения, уничтожения либо ограничения функциональности любого компьютерного или телекоммуникационного оборудования или программ, для осуществления несанкционированного доступа, а также серийные номера к коммерческим программным продуктам и программы для их генерации, логины, пароли и прочие средства для получения несанкционированного доступа к платным ресурсам в Интернете, а также размещения ссылок на вышеуказанную информацию;</p>\r\n\r\n<p>6.2.7. несанкционированно собирать и хранить персональные данные других лиц;</p>\r\n\r\n<p>6.2.8. нарушать нормальную работу веб-сайтов и сервисов Сайта;</p>\r\n\r\n<p>6.2.9. содействовать действиям, направленным на нарушение ограничений и запретов, налагаемых Соглашением;</p>\r\n\r\n<p>6.2.10. другим образом нарушать нормы законодательства, в том числе нормы международного права.</p>\r\n\r\n<p><strong>7. Исключительные права на содержание сервисов и контент</strong></p>\r\n\r\n<p>7.1. Все объекты, доступные при помощи сервисов Сайта, в том числе элементы дизайна, текст, графические изображения, иллюстрации, видео, программы для ЭВМ, базы данных, музыка, звуки и другие объекты (далее - содержание сервисов), а также любой контент, размещенный на сервисах Сайта, являются объектами исключительных прав Администрации сайта, Пользователей, Клиентов сайта и других правообладателей.</p>\r\n\r\n<p>7.2. Использование контента, а также каких-либо иных элементов сервисов возможно только в рамках функционала, предлагаемого тем или иным сервисом. Никакие элементы содержания сервисов Сайта, а также любой контент, размещенный на сервисах Сайта, не могут быть использованы иным образом без предварительного разрешения правообладателя. Под использованием подразумеваются, в том числе: воспроизведение, копирование, переработка, распространение на любой основе, отображение во фрейме и т.д. Исключение составляют случаи, прямо предусмотренные законодательством Республики Казахстан или условиями использования того или иного сервиса Сайта. Использование Пользователем и/или Клиента сайта элементов содержания сервисов, а также любого контента для личного некоммерческого использования, допускается при условии сохранения всех знаков охраны авторского права, смежных прав, товарных знаков, других уведомлений об авторстве, сохранения имени (или псевдонима) автора/ наименования правообладателя в неизменном виде, сохранении соответствующего объекта в неизменном виде. Исключение составляют случаи, прямо предусмотренные законодательством Республики Казахстан или пользовательскими соглашениями того или иного сервиса Сайта.</p>\r\n\r\n<p><strong>8. Сайты и контент третьих лиц</strong></p>\r\n\r\n<p>8.1. Сервисы Сайта могут содержать ссылки на другие сайты в сети Интернет (сайты третьих лиц). Указанные третьи лица и их контент не проверяются Администрацией сайта на соответствие тем или иным требованиям (достоверности, полноты, законности и т.п.). Администрация сайта не несет ответственность за любую информацию, материалы, размещенные на сайтах третьих лиц, к которым Пользователь и/или Клиент сайта получает доступ с использованием сервисов, в том числе, за любые мнения или утверждения, выраженные на сайтах третьих лиц, рекламу и т.п., а также за доступность таких сайтов или контента и последствия их использования Пользователем и/или Клиентом сайта.&nbsp;</p>\r\n\r\n<p>8.2. Ссылка (в любой форме) на любой сайт, продукт, услугу, любую информацию коммерческого или некоммерческого характера, размещенная на Сайте, не является одобрением или рекомендацией данных продуктов (услуг, деятельности) со стороны Администрации сайта, за исключением случаев, когда на это прямо указывается на ресурсах Сайта.</p>\r\n\r\n<p><strong>9. Отсутствие гарантий, ограничение ответственности</strong></p>\r\n\r\n<p>9.1. Пользователь и/или Клиента сайта использует сервисы Сайта на свой собственный риск. Сервисы предоставляются &laquo;как есть&raquo;. Администрация сайта не принимает на себя никакой ответственности, в том числе за соответствие сервисов целям Пользователя и/или Клиента сайта. Все результаты носят исключительно информационный или рекоменда&shy;ционный характер.</p>\r\n\r\n<p>9.2. Администрация сайта не гарантирует, что: сервисы соответствуют/будут соответствовать требованиям Пользователя и/или Клиента сайта; сервисы будут предоставляться непрерывно, быстро, надежно и без ошибок; результаты, которые могут быть получены с использованием сервисов, будут точными и надежными и могут использоваться для каких-либо целей или в каком-либо качестве (например, для установления и/или подтверждения каких-либо фактов); качество какого-либо продукта, услуги, информации и пр., полученных с использованием сервисов, будет соответствовать ожиданиям Пользователя и/или Клиента сайта.</p>\r\n\r\n<p>9.3. Любые информацию и/или материалы (в том числе загружаемое ПО, письма, какие-либо инструкции и руководства к действию и т.д.), доступ к которым Пользователь и/или Клиент сайта получает с использованием сервисов Сайта, Пользователь и/или Клиентам сайта может использовать на свой собственный страх и риск и самостоятельно несет ответственность за возможные последствия использования указанных информации и/или материалов, в том числе за ущерб, который это может причинить компьютеру Пользователя, Клиента сайта или третьим лицам, за потерю данных или любой другой вред.</p>\r\n\r\n<p>9.4. Администрация сайта не несет ответственности за любые виды убытков, произошедшие вследствие использования Пользователем и/или Клиентом сайта сервисов Сайта или отдельных частей/функций сервисов.</p>\r\n\r\n<p>9.5. При любых обстоятельствах ответственность Администрации сайта в соответствии со статьей 9 Гражданского кодекса Республики Казахстан ограничена 10 000 (десятью тысячами) казахстанских тенге и возлагается на него при наличии в его действиях вины.</p>\r\n\r\n<p><strong>10. Иные положения</strong></p>\r\n\r\n<p>10.1. Настоящее Соглашение регулируется и толкуется в соответствии с законодательством Республики Казахстан. Вопросы, не урегулированные настоящим Соглашением, подлежат разрешению в соответствии с законодательством Республики Казахстан. Все возможные споры, вытекающие из отношений, регулируемых настоящим Соглашением, разрешаются в порядке, установленном действующим законодательством Республики Казахстан, по нормам казахстанского права. Везде по тексту настоящего Соглашения, если явно неуказано иное, под термином &laquo;законодательство&raquo; понимается как законодательство Республики Казахстан, так и законодательство места пребывания Пользователя и/или Клиента сайта.</p>\r\n\r\n<p>10.2. Ввиду безвозмездности услуг, оказываемых в рамках настоящего Соглашения, нормы о защите прав потребителей, предусмотренные законодательством Республики Казахстан, не могут быть применимыми к отношениям между Администрацией сайта, Пользователем и/или Клиентом сайта.</p>\r\n\r\n<p>10.3. Ничто в Соглашении не может пониматься как установление между Пользователем, Клиентом и Администрацией сайта агентских отношений, отношений товарищества, отношений по совместной деятельности, отношений личного найма, либо каких-то иных отношений, прямо не предусмотренных Соглашением.</p>\r\n\r\n<p>10.4. Если по тем или иным причинам одно или несколько положений настоящего Соглашения будут признаны недействительными или не имеющими юридической силы, это не оказывает влияния на действительность или применимость остальных положений Соглашения.</p>\r\n\r\n<p>10.5. Бездействие со стороны Администрации сайта в случае нарушения Пользователем и/или Клиентом сайта либо иными пользователями положений Соглашений не лишает Администрацию сайта права предпринять соответствующие действия в защиту своих интересов позднее, а также не означает отказа Администрация сайта от своих прав в случае совершения в последующем подобных либо сходных нарушений.&nbsp;</p>\r\n\r\n<p>10.6. Настоящее Соглашение составлено на русском языке и в некоторых случаях может быть предоставлено Пользователю и/или Клиенту сайта для ознакомления на другом языке. В случае расхождения русскоязычной версии Соглашения и версии Соглашения на ином языке, применяются положения русскоязычной версии настоящего Соглашения.</p>', '2019-01-07 05:31:50', '2020-01-28 03:53:39'),
(5, NULL, NULL, NULL, 'ВУЗам', '<p>Сайт studypage.net&nbsp;&ndash; это маркетплейс, посвященный высшему образованию. Наша команда на рынке образования работает уже долгие годы. Мы специализируемся на создании образовательных маркетплейсов в сфере высшего образования. Сайт studypage.net&nbsp;ориентирован на молодежь, которая находится в процессе выбора ВУЗа, программ бакалавриата, магистратуры и докторантуры.</p>\r\n\r\n<p>Мы считаем, что бизнес-процессы данной тематики настолько уникальны, что для максимально полного удовлетворения потребностей участников рынка требуется специальный подход, который невозможно совместить с выбором детского сада, школы, курсов, семинаров, тренингов, популярных лекций и развлекательных мероприятий.&nbsp;</p>\r\n\r\n<p>Сайт устроен таким образом, что он сопровождает пользователя, помогая ему в принятии решения о выборе ВУЗа, и программы обучения, отвечает на вопросы пользователя там, где они у него появляются. Таким образом, весь сайт &ndash; это воронка, по которой проходит потенциальный абитуриент в процессе определения своего фокуса: выбора конкретного ВУЗа, и образовательного продукта.</p>\r\n\r\n<p>Мы проанализировали множество сайтов ВУЗов, прежде чем приступили к созданию studypage.net. Нам стало очевидно, что большинство ВУЗов имеют ограниченные возможности по презентации своих программ образования на сайтах по самым разным причинам. Поэтому мы решили, что должны создать такой формат подачи информации о ВУЗе, и его программах, который позволит абитуриентам легко их сравнивать и выбирать. Мы видим своей миссией помочь ВУЗам и донести до абитуриентов все их преимущества, оформить контент учебных заведений привлекательно и понятно для потенциального потребителя. Описание ВУЗов, размещение фотографий, видео, образовательных программ создается нашим отделом контента на базе официальной информации ВУЗа, и Министерства образования и науки Республики Казахстан. Мы планируем, что ВУЗы смогут в дальнейшем самостоятельно размещать новости, статьи, дни открытых дверей, олимпиады и другие события для того, чтобы потенциальный абитуриент мог получить представление о культуре конкретного ВУЗа, его подходе к организации образовательного процесса и студенческой жизни.</p>\r\n\r\n<p>В будущем мы планируем охватить все ВУЗы Казахстана, все программы высшего образования. Базовый вариант размещения на нашем сайте доступен любому ВУЗу бесплатно. Однако мы не можем гарантировать сроки размещения информации, поскольку создание качественного контента в предлагаемом нами формате это очень трудоемкий процесс. За гарантированное размещение информации ВУЗа в определенные сроки мы будем брать определенную плату. Ежегодная актуализация информации также потребует от нас определенных усилий, поэтому стоимость размещения будет зависеть объема работы и региона учебного заведения.</p>\r\n\r\n<p>Приступая к созданию сайта, мы провели большую исследовательскую работу в одном из ВУЗов Казахстана по анализу бизнес-процессов приемной кампании, определили критические точки и процессы, нуждающиеся в автоматизации и контроле. После создания первого прототипа, мы получили экспертное заключение руководителей маркетинга нескольких ведущих ВУЗов и скорректировали бизнес-процессы с учетом их пожеланий. Мы постарались создать идеальную модель интернет-представительства ВУЗа для ведения приемной кампании.</p>', '2019-01-07 05:32:07', '2019-11-18 23:43:32'),
(34, '1', '2', '3', 'Обратная связь', '<p>Администрация сайта прочтет сообщение и постарается ответить на него в кратчайшие сроки. ВНИМАНИЕ! Studypage.net&nbsp;вправе не отвечать, если: содержание сообщения нарушает законодательство; содержание сообщения противоречит основам морали и нравственности, несет оскорбительный характер; содержание сообщения не относится к деятельности Studypage.net; анонимное обращение.</p>', '2019-11-20 06:47:47', '2020-01-28 03:36:57');
