INSERT INTO `cities` (`id`, `url`, `s_title`, `s_description`, `s_keywords`, `name_ru`, `announce`, `name_kz`, `description`, `image`, `active`, `created_at`, `updated_at`) VALUES
(1, 'nur-sultan', NULL, NULL, NULL, 'Нур-Султан', 'ДОБРО ПОЖАЛОВАТЬ В НУР-СУЛТАН', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\">Население: 1,078,384</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">Студенты: 54,419</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">ВУЗы: 12</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Астана (бывший Целиноград, ещё ранее Акмолинск) основана в 1824 году, как военное укрепление, основанное русско-казахскими войсками на берегу реки Ишим в местности Караоткел. Страшное захолустье, на мелких кустарных предприятиях по переработке животноводческого сырья работают 150 человек, в городе иногда проходят ярмарки, где торгуют продуктами сельскохозяйственного производства.</p>\r\n\r\n<p>Своё новое развитие Астана получила в 60-е года прошлого столетия с освоением в Северном Казахстане целинных и залежных земель. Город завоевал широкую известность проводимыми здесь ярмарками. Торговцы со всех регионов Казахстана, России и Центральной Азии съезжались сюда.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/16.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />В 1998 году с обретением независимости Республикой Казахстан и переездом столицы, город Астана стала самой молодой столицей мира, которая хорошеет день ото дня, на глазах меняя свои облик. Преобразовалось старая часть города, приобрела свой прекрасный вид новая набережная реки Есиль, продолжается застройка нового исторического административного центра, главной площади у Президентского дворца &quot;Ак-Орда&quot;.&nbsp;Астана стала самой молодой столицей в мире - это город является крупнейшим деловым, дипломатическим, торговым и культурным центром. Все правительственные организации, дипломатические представительства 44 стран и 113 совместных и иностранных предприятий расположено здесь.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/17.jpeg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Так уж повелось, что каждый город ассоциируется с какой-то достопримечательностью: Лондон &ndash; с Биг-Беном, Париж &ndash; с Эйфелевой башней, а вот символом Астаны стал Байтерек &ndash; достопримечательность, появление которой ознаменовало новую эпоху в жизни Казахстана, связанную с переносом в Астану столицы государства. Байтерек похож на золотой шар, который покоится на самом верху ажурной стальной конструкции высотой 97 м. А вместе с 300-тонным шаром, диаметр которого составляет 22 м, высота монумента достигает 105 метров. При этом вес башни &ndash; более 100-тонн.&nbsp;Байтерек &ndash; это не что иное, как дерево жизни, растущее на берегу Мировой реки, которая течет на стыке миров. Корни этого дерева находятся под землей, само дерево &ndash; в земном мире, а ветви подпирают небеса. Именно к этому дереву жизни каждый год летит священная птица Самрук, чтобы в его высокой кроне отложить яйцо &ndash; Солнце. А живущий под деревом дракон каждый год проглатывает это яйцо &ndash; так представляли себе в древности казахи смену времен года, дня и ночи и извечную борьбу добра и зла.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/18.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одной из самых современных достопримечательностей Астаны, молодой столицы Казахстана, является соборная мечеть Хазрет Султан. Эта крупнейшая мечеть Центральной Азии строилась 3 года и была торжественно открыта в июле 2012 года. Колоссальное здание напоминает восточный дворец, а в его строительстве принимало участие более 1500 строителей и мастеров, совместными усилиями создавших красивейший памятник архитектуры Астаны. Название &laquo;Хазрет Султан&raquo; переводится как &laquo;Святейший Султан&raquo;.&nbsp;Мечеть была названа в честь одного из суфийских шейхов - Ходжи Ахмеда Яссави (XII век), который был поэтом, философом и мусульманским святым, известным на территории всей Центральной Азии. Мавзолей святого расположен в казахском городе Туркестан. Хазрет Султан, как одна из крупнейших мечетей Азии, занимает площадь 11 га, и способна вместить до 10 тысяч человек.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/19.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Хан-Шатыр &ndash; это еще одна яркая достопримечательность в современной архитектуре Астаны, и в то же время огромный торгово-развлекательный центр города. Открытый в 2010 году, Хан-Шатыр представляет собой шпиль, на котором, благодаря натянутым стальным тросам, держится специальное прозрачное полотно. Специальное химическое покрытие полотна защищает пространство шатра от перепадов температур и способствует сохранению особого микроклимата. Благодаря этим и другим технологиям Хан-Шатыр вошел в десятку эко-зданий мира.&nbsp;Архитектором этого уникального сооружения стал Норман Фостер, который является автором нескольких архитектурных чудес Астаны. Под куполом шатра разместились самые разные торгово-развлекательные заведения: фирменные магазины и бутики, супермаркет, офисы компаний, кафе и рестораны, игровые площадки и семейные парки, кинотеатры и аквапарк. Причем искусственный пляж аквапарка представляет собой уникальную систему: здесь поддерживается тропический климат с температурой 35 градусов по Цельсию, а песок привезен с Мальдивских островов. Кроме всего этого, по всему шатру можно прокатиться на настоящих американских горках, которые охватывают большую часть Хан-Шатыра.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/20.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Пирамиды &ndash; это не только Египет, но теперь и Казахстан. Совсем недавно, в 2006 году, в Астане был открыт Дворец Мира и Согласия, который имеет форму правильной четырехгранной пирамиды. Некоторые уже применяют к этой пирамиде эпитет &laquo;Восьмое чудо света&raquo;. В отличие от египетских пирамид, где были лишь отдельные погребальные камеры, пирамида Дворца Мира и Согласия состоит из концертно-оперного зала, конференц-залов, выставочных галерей, оранжереи, и многое другое.</p>', '1547618215.jpg', 1, '2018-11-12 12:37:39', '2020-02-01 14:06:58'),
(2, 'aktau', NULL, NULL, NULL, 'Актау', 'ДОБРО ПОЖАЛОВАТЬ В АКТАУ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\">Население: 182,033</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">Студенты: 6,215</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">ВУЗы: 2</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>На юге Прикаспийской низменности находятся Мангистауские плато Мангышлак и плато Устюрт. Недра этой земли богаты полезными ископаемым и особенно нефтью. Столицей Мангышлака является город Актау (бывший Шевченко). Город по своей красоте не уступает городам черноморского побережья Кавказа. Многоэтажные дома, сооружения, выполненные из камня ракушечника, делают город особенно нарядным. Несмотря на дефицит воды Актау хорошо озеленен, в городе много скверов парков, цветников.</p>\r\n\r\n<p>Любимым местом отдыха горожан, гостей и туристов города является городской пляж. Уникальным местом в районе является галерея наскальных изображений обитания кочевников времён ХХ-II веков до нашей эры, а также некрополь с изображёнными орнаментами на них.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/1.jpg\" style=\"border-style:solid; border-width:0px; float:left; height:194px; margin:5px 0px; width:290px\" /></p>\r\n\r\n<p>Коллекции музея по археологии, этнографии, культуре, природе и истории края насчитывают более 50 тысяч экспонатов, самые интересные из которых выставлены в экспозиционных залах. Всего залов насчитывается девять, среди них: устюртский государственный заповедник, монумент &laquo;каравелла&raquo;, галерея современного искусства &laquo;ковчег&raquo;, горная долина акмыштау, гора шеркала, озеро саура, некрополь сисем-ата, музей-заповедник &laquo;памятники материальной культуры мангистау и устюрта&raquo;, ботанический сад, долина шаров, маяк. Устюртский государственный заповедник знакомит своих посетителей со многими растениями, которые занесены в Красную книгу. Среди них катран беззубый, молочай твердобокальчатый и мягкоплодник критмолистный. Также здесь представлено 500 видов сосудистых растений, среди которых полынь, лебеда и астрагал. Что касается животного мира, то в заповеднике имеются редкие виды птиц: змееяд, сапсан, чернобрюхий рябок, балобан и другие.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/2.JPG\" style=\"float:left; height:190px; margin-bottom:5px; margin-top:5px; width:294px\" />Гора Шеркала - Эта священная гора самими казахами называется по-разному и пиала, и юрта, и сфинкс (горы). Разместилась она в 170 км от Актау, аккурат меж двух хребтов Каратауских гор. Когда-то очень давно тут проходил знаменитый Великий Шелковый путь, а на самой горе было неприступное крепостное сооружение, защищавшее полуостров от вражеских нападок. Взобраться на Шеркалу достаточно сложно, а для большинства просто невозможно, но если это и удастся, то спускаться будет еще сложнее. По преданиям в огромном количестве пещер горы и по сей день, обитают духовные сущности, поэтому заглядывать в них не рекомендуется, чтобы не потревожить их. С горой связано и множество других легенд, а ее саму не раз изображали самые разные художники.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/3.jpg\" style=\"float:left; height:190px; margin-bottom:5px; margin-top:5px; width:294px\" />Озеро Саура - На многие километры иссушенная пустыня, а тут &mdash; стволы вековых ив, которые с течением времени искривились и перевились, будто корни. Густые заросли ракиты, которую в народе называют &laquo;казахстанской сиренью&raquo;, сопровождают путника вдоль всего ущелья. Преодолев извилистую тропку, путник вознаграждается удивительным зрелищем &mdash; одним из чудес скупой мангистауской природы, озером Саура. Водоем с трех сторон окружают отвесные каменные стены сферической формы: будто половинка огромной чаши высотой около 50 метров.&nbsp;Манит своей загадочностью ущелье Саура. Здесь водятся болотные черепахи-старушки: они довольствуются небольшим озером и не собираются дружить с пустынными черепахами. Все люди ищут себе пару. Старожилы Мангистау знают, что вторая половинка есть и у озера Саура &mdash; его озеро-двойник располагается в 500 метрах от ущелья.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/4.JPG\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Близ Актау находятся уникальные по своей архитектуре подземные мечети Шопан-Ата и Бекет-Ата. Шолпан-Ата (Х-ХIII века) вырублена в массиве приовражной скалы. По преданию, старец Шолпан-Ата являлся учеником знаменитого Ходжи Ахмета Ясави. В некоторых письменных источниках утверждается также, что сам Шолпан-Ата и его дочь захоронены в одном из залов этой мечети. В 50 километрах от Актау, на полуострове Мангышлак, находится впадина Карагие.&nbsp;Она является самой глубокой сухой впадиной в Казахстане и одной из наиболее глубоких в Азии (132 метра ниже уровня моря). На дне впадины находится озеро Батыр, уровень воды и площадь которого весьма изменчивы. Когда озеро пересыхает, дно впадины становится покрыто солончаками. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/5.jpg\" style=\"float:left; height:190px; margin-bottom:5px; margin-top:5px; width:294px\" />Недалеко от горы Унгазы тысячи лет назад были построены две старейшие мечети, одна из которых, Шакпак-Ата, была построена в доисламкий период и принадлежала, по всей вероятности, суфистам, так как ислам запрещает изображение людей, а на её стенах вместе с цветами лотоса изображена рука человека. Неоспоримым является тот факт, что Шакпак-ата, был последователем учения Ходжи Ахмеда Яссауи, и относился к числу 360 святых, почитаемых в Мангистау. Интересными местами посещения для туристов являются подземные мечети Х-ХII века, некрополь IХ-ХIX веков, на территории которого множество каменных памятников, Территория древнего города Кызыл-Кала (Х-ХII в.).</p>', '1542096865.jpg', 1, '2018-11-12 14:14:25', '2020-02-01 14:06:05'),
(3, 'aktobe', NULL, NULL, NULL, 'Актобе', 'ДОБРО ПОЖАЛОВАТЬ В АКТОБЕ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\">Население: 614,492</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">Студенты: 24,459</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">ВУЗы: 4</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Актобе &ndash; это город, расположенный в Западном Казахстане, который, также, является административным центром Актюбинской области. Это самый крупный город региона. Актобе занимают 5 строчку среди городов Казахстана по численности населения. Город основан как укрепление на левом берегу реки Илек отрядом войск Российской Империи в далеком 1969 году. Современный Актобе - красивый зелёный город, готовый принять гостей и туристов и показать им свои достопримечательности.</p>\r\n\r\n<p>В Актобе много парков, музеев, театров и большое количество других достопримечательностей, привлекающих гостей города, и радующих своей красотой местных жителей.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/6.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Водно-зеленый бульвар Единства и согласия был построен к 140-летнему юбилею города. Он расположен в центре Актобе возле 11-го и 12-го микрорайонов на площади более 64 тысяч кв. м. между областной мечетью &laquo;Нур Гасыр&raquo; и Свято-Никольским православным храмом. Такое расположение является символом духовного объединения мировых религий и толерантности в обществе. &nbsp;На территории бульвара расположены амфитеатр на 170 мест, цветомузыкальный фонтан &laquo;Чаша изобилия&raquo;, мемориальный комплекс-ротонда, ансамбль &laquo;Шанырак&raquo;.&nbsp;Фонтан &laquo;Чаша изобилия&raquo; символизирует не истощаемые богатства казахской земли и щедрости народа, а монумент &laquo;Шанырак&raquo; &ndash; единство народа Казахстана. В мемориальном комплексе-ротонде отображены достижения современного независимого государства. Благоустройство бульвара продолжается по сей день. Вскоре здесь появятся возможности для активного отдыха: велосипедные дорожки, скейтпарк и спортивные площадки.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/7.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одновременно величественная и скромная, с богатым убранством, но без излишеств &ndash; мечеть &laquo;Нур Гасыр&raquo;. Данная мечеть полностью построена на деньги прихожан и предпринимателей. Около 200 тысяч человек за четыре года пожертвовали почти 2 млрд. тенге. Торжественное открытие мечети состоялось в 2008 году и было ознаменовано приездом важных гостей, среди которых Президент РК Нурсултан Назарбаев, на тот момент Президент РФ Дмитрий Медведев, а также бывший Верховный муфтий нашей страны Абсаттар Дербисали.&nbsp;Мечеть &laquo;Нур Гасыр&raquo; построена по проекту Айвара Саттарова &ndash; автора мечети Кул-Шариф в Казани. Именно его работа была признана лучшей среди целого ряда проектов, присланных из разных стран мира. И, действительно, мечеть прекрасно вписалась в архитектурный ансамбль города, став его украшением.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/8.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мемориальный комплекс открыт в 2005 году к 80-летнему юбилею со дня рождения Героя Советского Союза Алии Молдагуловой. Знаменитая казахская девушка-снайпер, уничтожившая 78 солдат и офицеров противника во время Великой Отечественной войны, прославилась не только своими способностями, но и искренней любовью к родине и стремлением защищать ее. В 1942 году в возрасте 17 лет она была отчислена из техникума по своему личному заявлению &laquo;в связи с уходом на фронт&raquo;.&nbsp;Алия Молдагулова была смертельно ранена в бою в 1944 году. Установленный монумент &ndash; это не только дань памяти Алие, но и символ любви к Родине. Он призван взывать к гордости за свою страну и ее героев. &nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/9.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одно из интереснейших мест в Актобе, которое заинтересует, как детей, так и взрослых, это Актюбинский областной планетарий. Он функционирует уже 50 лет и, не смотря на это, поток посетителей не иссякает. Планетарий &ndash; это место невероятных открытий, новых знаний и потрясающих впечатлений! Актюбинский планетарий был открыт в 1967 году после получения горожанами необычного подарка от трудящихся ГДР, из города Йены, где производили лучшую в мире оптику. Этим подарком было оборудование для планетария.&nbsp;Специалистами из Московского планетария было построено подходящее здание и установлена аппаратура. &nbsp;В планетарии имеется звездный зал с куполом высотой 10 метров. Именно там установлен оригинальный аппарат &laquo;Планетарий&raquo;, изготовленный фирмой &laquo;Карл Цейс&raquo;, воспроизводящий на куполе северное небесное полушарие.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/10.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Ухоженная, зеленая и раскрашенная летом в разноцветье лепестков цветов пешеходная зона &ndash; это бульвар Абая. В прежние времена он именовался Октябрьским бульваром и был центром масштабных городских праздников. На бульваре напротив областного акимата находится музыкальный фонтан. Его струи не только ярко подсвечиваются, но и реагируют на ритм музыки. Высота струи воды может достигать 18 метров. С появлением в Актобе благоустроенного парка Первого Президента и Водно-зеленого бульвара, бульвар Абая утратил свои лидирующие позиции, однако, до сих пор привлекает отдыхающих красочными клумбами и ухоженным видом.</p>', '1542096879.jpg', 1, '2018-11-12 14:14:39', '2020-02-01 14:05:06'),
(4, 'almaty', NULL, NULL, NULL, 'Алматы', 'ДОБРО ПОЖАЛОВАТЬ В АЛМАТЫ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\">Население: 2,038,934</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">Студенты: 143,860</td>\r\n			<td style=\"text-align:center; vertical-align:middle\">ВУЗы: 39</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Алматы - самый большой город Казахстана, расположенный на юго-востоке Республики Казахстан, в предгорьях Заилийского Алатау; население города составляет около 2 миллиона жителей. Хотя Алматы уже не является столицей республики, город остается финансовым, экономическим и культурным центром Центральной Азии.</p>\r\n\r\n<p>Здесь сосредоточено большое количество деловых центров, театров, музеев, художественных галерей, выставочных залов и бесчисленное количество современных развлекательных комплексов (кинотеатры, ночные клубы, парки, рестораны, кафе и многое другое).</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/11.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Город Алматы всегда считался городом-садом, окруженным великолепными Тянь-Шанскими елями. Много веков подряд снежные вершины могущественного Зайлийского Алатау, взмывающие к небу, создают впечатление величественной охраны. Благоухание садов, изумрудные верхушки известных Алатауских елей и тополей, стремительные горные течения, обилие суетящихся рынков, возрождающая свежесть городских фонтанов, блеск дворцов и площадей производят незабываемое впечатление на гостей южной столицы &ndash; Алматы.&nbsp;Площадь Республики - главная площадь города - место проведения праздничных шествий, торжеств, спортивных праздников, парадов, народных гуляний. Монумент независимости - памятник, посвященный истории Республики, комплекс отражает хронику Казахстана со времен Сакской Царицы Томирис и до настоящего времени. В центре комплекса расположен символ независимости - &quot;Золотой воин&quot;.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/12.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Жители и гости южной столицы могут посетить 5 стадионов, ипподром, высокогорный каток Медео расположенный на высоте 1700 метров над уровнем моря. Здесь было установлено более ста мировых рекордов. Медео является одним из любимейших мест отдыха в выходные дни. Ледовый стадион вмещает 32,000 зрителей. Недалеко расположено поле для тренировки спортсменов и оборудованный зимний плавательный бассейн.&nbsp;Несколько лет подряд ледовый каток превращался в огромную концертную площадку, где проводился популярный международный фестиваль музыки &quot;Голос Азии&quot; (&quot;Азия Дауысы&quot;), в котором принимают участие не только казахстанские исполнители, но и звезды эстрады со всего мира.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/13.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Живописные горы являются визитной карточкой Алматы. Вы сможете насладиться их видом поднявшись по канатной дороге на высшую точку города Кок-Тобе (&laquo;голубая гора&raquo;), находящуюся на высоте 1,130 метров над уровнем моря. С этой вершины открывается удивительная панорама на горы и город. Здесь особенно красиво ночью, когда город освещается разноцветными огнями. Канатная дорога возвышается над старейшей частью города, изобилующей садами, которую местные жители называют Компот.&nbsp;Причиной этому служат названия улиц в этом районе: Вишневая, Грушовая, Виноградная и т.п. У подножья горы Кок-Тобе возвышается 350 метровая телебашня. Если отсчитывать от уровня моря, то это башня одна из самых высоких в мире, более того она построена в сейсмически опасной зоне.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/14.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Две большие реки - Большая и Малая Алматинка стекают с гор и обеспечивают город свежей водой, наполняют водохранилища и фонтаны прохладой и свежестью. Бассейн рек расположен в живописной горной местности. В ущелье Малой Алматинки расположено несколько оздоровительных комплексов, санаториев и частных коттеджей. Ущелье Медео (1,691 м над уровнем моря) находится в 16 км от Алматы недалеко от горы Мохнатка (2,278 м). Эта гора известна тем, что 30 лет назад здесь прошел разрушительный сильнейший сель, и часть горы была разрушена.&nbsp;Существовала реальная опасность жизни людей, однако сейчас нет никаких опасений поскольку возведена селезащитная плотина, которая также является частым местом посещения туристов и жителей города.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/15.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Чимбулак &ndash; еще одну жемчужину Алматы, которая расположена на высоте 2,230 метров. Здесь действует 1500 метровая подвесная дорога, которая поднимет Вас на высоту 3163 метра к пику Талгар. С высоты 3000 м начинается горнолыжный спуск. Каждый год на Чимбулаке появляются новые маршруты. Горнолыжные трассы Чимбулака аттестованы Международной Федерацией Горнолыжного Спорта (FIS). Трассы скоростного спуска и слалома-гигинта по праву входят в десятку сложнейших трасс мира.</p>', '1542096889.jpg', 1, '2018-11-12 14:14:49', '2020-02-01 14:04:23'),
(5, 'arkalyk', NULL, NULL, NULL, 'Аркалык', 'ДОБРО ПОЖАЛОВАТЬ В АРКАЛЫК', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 41,354</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 1,730</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Город Аркалык находится в Костанайской области в Казахстане на расстоянии 480 километров от Костаная и в 670 километрах от Астаны. Связь с областным центром осуществляется по железной дороге. В 6 километрах от города расположен аэропорт, но используется не часто. В основном на его территории осуществляются посадки вертолётов.</p>\r\n\r\n<p>Первоначально город был основан как небольшой посёлок для строителей и геологов в 1956 году. В здешних местах в послевоенное время были обнаружены крупные месторождения бокситов, которые служили сырьём для производства алюминия. Весной 1956 года советским правительством было принято решение об открытии Торгайских бокситовых рудников на базе Амангельдинского месторождения бокситов.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/120.jpg\" style=\"float:left; height:194px; width:290px\" />В начале 60-х годов 20-го столетия в Аркалык стали съезжаться рабочие и специалисты со всех уголков Советского Союза. Здесь была объявлена всесоюзная комсомольская стройка. В 1965 году новое поселение получило статус города, а через шесть лет Аркалык стал центром Тургайской области. Своего экономического развития город достиг в 80-е годы 20-столетия. Были открыты и стабильно выпускали свою продукции элеватор, птицефабрика, мясокомбинат, молокозавод, керамическая и швейная фабрики, производство радиодеталей и авиамоторный завод, велась разработка бокситового месторождения. В связи с упразднением Тургайской области в 1988 году Аркалык потерял статус областного центра.&nbsp;Для экономического подъёма и развития города здесь имеет большой потенциал. В окрестностях города находятся месторождения свинца, нефритоидов, белого и чёрного мрамора, лечебных и столовых минеральных вод. Среди достопримечательностей Аркалык выделяются памятники: Иманову, Валиханову, степному батыру Кейки Батыр, Ленину и Шакшаку Жанибеку.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/121.jpg\" style=\"float:left; height:194px; width:290px\" />Памятник сахана Махата отнесен к истории и архитектуры 1923 года. &nbsp;Особенностью сахана Махата является наличие в нем 2-камерного (мужского и женского) подземного склепа. Такие &nbsp; погребения уходят своими корнями к зороастрийским традициям. Это был богатый и очень ученый человек, со своими детьми он построил мавзолей, который прекрасно сохранился до наших дней. Войти в мавзолей можно только по одному, так как вход очень узкий. В стенах мавзолея потомки Махата укладывали тела умерших родственников. Хоронили здесь по древним казахским обычаям, когда человек умирал, его тело не закапывали, а укладывали в подземную комнату.&nbsp;Белым занавесом комнату делили на две части: в одной помещали тела мужчин, в другой &ndash; женщин. Там же и общая открытая могила в виде вырытой ямы. Когда умирал очередной родственник, тело того, кто находился в подвальной комнате опускали в эту могилу, а на его место укладывали следующего покойника. В мавзолее покоятся сейчас останки более 20 родственников Махата.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/122.jpg\" style=\"float:left; height:194px; width:290px\" />Абдигаппар Жанбосынұлы (1870-1919) &ndash; уроженец Тургая, племени кипчаков, потомок знаменитого бия Нияза. В 1916 году в ходе национально-освободительного движения Абдигаппар Жанбосынұлы был влиятельным и авторитетным человеком. Оказывал содействие и помощь в военных сражениях предводителю повстанческого движения Амангельды Иманову. Имея огромный авторитет среди населения решением курултая был провозглашен ханом тургайских кипчаков.&nbsp;Он восстановил ханство власти, но при этом категорически отрицал титул хана, вследствие этого и был объявлен командиром повстанческого движения в ноябре 1919 года он был убит армейцами Красной Армией. Захоронение Абдигаппар-хана находится на старом кладбище недалеко от села Жанакала города Аркалыка. В 2010 году в честь 130-летия восстания 1916 года в Торгае, его непосредственными потомками построен мавзолей из белого камня.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/123.jpg\" style=\"float:left; height:194px; width:290px\" />Первые геоглифы на территории Тургайского прогиба были обнаружены в марте 2007 года исследователем-краеведом Дмитрием Деем, в результате изучения космических снимков, доступных в программе Google Earth. &laquo;Уштогайский квадрат&raquo; и &laquo;Тургайский трикветр&raquo; (Тургайская трехлучевая свастика) легли в основу, стали началом увлекательных исследований и неожиданных открытий, состоявшихся на просторах бескрайних Тургайских степей.&nbsp;По мере погружения в исследовательскую деятельность, накопления информации, знаний и практического опыта, все более становилось очевидным, что загадочные сооружения имеют очень древнюю, глубоко осмысленную и сложную основу. В 2008 году, с целью исследования, сохранения, пропаганды и популяризации геоглифов Тургайского прогиба, автором открытия был запущен научно-исследовательский проект &laquo;Turgay Discovery&raquo;. Геоглифы Тургайского прогиба являются уникальными сооружениями. Аналоги на сопредельных и других территориях Евразии отсутствуют, что затрудняет сопоставление с известными археологическими культурами.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/124.jpg\" style=\"float:left; height:194px; width:290px\" />Культовый памятник Екидын. Предположительная датировка этого исторического объекта - ранний железный век. По мнению некоторых ученых, изначально эти памятники имели сакральное, обрядовое назначение. Этот исторический памятник имеет общее название Екидын (&laquo;Екидин&raquo;, &laquo;Екідің&raquo;) (две веры, две религии или два памятника, посвященных религии). Памятник состоит из двух объектов, находящихся на разных холмах, на относительно большом расстоянии друг от друга. Екидин - І расположен на левом берегу реки Кара Тургай. Екидын - ІІ располагается на возвышенном месте и является ориентиром, так как виден издалека. Существуют местные легенды, согласно которым, в ХVІІ &ndash; ХVІІІ веках в долине между холмами, на которых стоят объекты, произошло кровопролитное сражение. Именно здесь располагались ставки военачальников враждующих родов.&nbsp;Долина и холмы, на которых расположены памятники, считаются у местного населения сакральным местом, полным загадок и тайн.</p>', '1542096900.jpg', 1, '2018-11-12 14:15:00', '2020-02-01 14:03:31'),
(6, 'atyrau', NULL, NULL, NULL, 'Атырау', 'ДОБРО ПОЖАЛОВАТЬ В АТЫРАУ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 202,026</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 13,186</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Атырау &ndash; это административный центр Атырауской области. Широкой публике город больше известен как &laquo;нефтяная столица&raquo; Республики Казахстан. Именно здесь впервые на территории современного Казахстана еще в 17 веке начали разрабатывать первые залежи нефти. Тогда по имени основателя, город получил название Гурьев (до 1991 года). Атырау -&nbsp;город, который стоит прямо на границе Европы с Азией.&nbsp;</p>\r\n\r\n<p>Эта символическая граница долгие годы проходила по мосту через реку Урал. И хотя сегодня географы оспаривают такое разделение, до сих пор горожане гордятся своим привилегированным положением жителей двух континентов. А гости города, конечно, спешат сфотографироваться у памятного знака.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/21.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />На территории города расположен крупнейший в стране нефтеперерабатывающий завод, так и называется Атырауский. Его мощность составляет более 5 млн. тонн нефти в год, что составляет 1/3 от общего объема добываемого в стране &laquo;черного золота&raquo;. В 80 км от города находится гигантское месторождение Кашаган, которое является крупнейшим в мире нефтяным месторождением на море. Геологические запасы Кашагана оцениваются в 6,4 млрд. тонн нефти. С Кашаганом Казахстан планирует войти в ТОП-5 мировых нефтедобытчиков.&nbsp;В Атырау много парков, музеев, театров и большое количество других достопримечательностей, привлекающих гостей города, и радующих своей красотой местных жителей.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/22.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Среди самых посещаемых памятников города можно назвать памятники известным композиторам Дине Нурпеисовой и Курмангазы Сагырбайулы, исполнителям своих сочинений на казахском музыкальном инструменте &ndash; домбре. Курмангазы своими произведениями пытался передать всю несправедливость, притеснения и тяжелую судьбу обычного народа. Продолжателем творчества Курмангазы, стала его ученица Дина Нурпеисова. Ее игра на домбре была неповторима. Дина смогла связать классические и современные жанры в исполнении.&nbsp;Памятник Султану Бейбарсу в центре города, может поведать интересную историю о похищенном в Египте в 13 веке султане и проданном в рабство, а после выкупа, отправленного на военную службу. Жизнь его тесно проходила с казахскими кочевниками, что символизирует юрта и пирамида в композиции памятника.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/23.jpeg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:286px\" />Древнее городище Сарайшык является бесценным достоянием казахского народа и древнейшим археологическим памятником. Основание Сарайшыка ученые относят к двенадцатому веку -&nbsp;временам нашествия Чингисхана и хана Батыя. Городок был заложен на месте более древнего поселения Саксина, датирующегося десятым веком. Сарайшык в свое время был цветущим городом с развитой торговлей и прикладным искусством. Он был одним из важных центров Алтын Орды.&nbsp;Сегодня на месте древнего городища возведен мемориально-исторический комплекс, в состав которого входят музей с археологическими находками, мечеть и ханские пантеоны.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/24.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Пешеходный мост 10 лет Независимости - это самый длинный пешеходный мост, построенный в 2001 году, этот мост, имеющий длину 551 метр, занесен в книгу рекордов Гиннеса как самый длинный пешеходный мост в мире. Можно перейти по этому мосту с одного континента на другой, из Азии в Европу и наоборот. На концах моста установлены специальные указатели &quot;Asia&quot; и &quot;Europe&quot;. С середины моста над Уралом открывается великолепный вид на проспект Евразия и его окрестности.&nbsp;Строительство этого монолитного железобетонного сооружения осуществлялось по новейшим технологиям, с применением современных материалов. В конструкции моста предусмотрено равномерное распределение нагрузки по всему мосту, на каждый его квадратный метр допускается нагрузка в 400 килограмм. Так что конструкция моста позволяет выдерживать до 100 тысяч человек.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/25.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Меловые обнажения Аккерегешин и Актолагай привлекают внимание не только геологов и палеонтологов, но и людей, которые ищут встречи с необычными проявлениями природы, загадочными пещерами, причудливыми белоснежными скалами и просто любят походные приключения. Прогуливаясь в этих тихих, далеких от привычного цивилизованного мира местах, вы запросто можете найти фрагменты окаменелых древних животных, а если повезет -&nbsp;даже черный зуб акулы или позвоночник динозавра.</p>', '1542096912.jpg', 1, '2018-11-12 14:15:12', '2020-02-01 14:02:27'),
(7, 'zhezkazgan', NULL, NULL, NULL, 'Жезказган', 'ДОБРО ПОЖАЛОВАТЬ В ЖЕЗКАЗГАН', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 84,977</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 6,250</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Медная столица Казахстана город Жезказгана расположен практически в географическом центре страны и на условном стыке полупустынной и пустынной зон. К северу от Жезказгана плещется Кенгирское водохранилище, которое является частью водной системы реки Кара-Кенгир. Здесь преобладает засушливый резко континентальный климат с большим количеством песчаных бурь. Вокруг Жезказгана залегают богатейшие медные месторождения, к которым примешиваются руды цветных (свинец, цинк, олово, литий, кобальт, молибден и другие) и благородных (золото, серебро) металлов.</p>\r\n\r\n<p>В окрестностях Жезказгана находятся несколько средневековых мавзолеев, где особенно примечателен мавзолей Джучи-хана (13 век). Горный массив Улытау не только славится уникальными &laquo;марсианскими&raquo; ландшафтами, но и считается священной для казахов землей &ndash; там зародилось Казахское ханство.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/131.jpg\" style=\"float:left; height:194px; width:290px\" />Алаша-хан &ndash; это личность более легендарная, нежели историческая. Никто точно не знает, существовал ли на самом деле этот человек, имя которого буквально означает &laquo;пестрый&raquo;, а сам он считается первопредком казахского народа. Упоминания об Алаша-хане встречаются не только в казахских легендах, но и в преданиях других тюркских народов, и ученые склоняются к мнению, что, скорее всего, он является культовым символом времен единства кочевников Евразийских степей, ну а сам мавзолей, скорее всего, возведен в честь какого-то из степных правителей в период с XI по XII век.&nbsp;Возведенный из разноцветного кирпича на правом берегу реки Каракенгир, мавзолей представляет собой сложное архитектурное сооружение с купольным перекрытием и мощными пилонами у переднего фасада.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/132.jpg\" style=\"float:left; height:194px; width:290px\" />Хан Джучи (Жошы), старший сын Чингис хана и первопредок большинства казахских ханов, особенно любил степи Сары-Арки и именно вблизи от гор Улытау он основал свою главную ставку. Ставка хана долгое время была крупным административным и культурным центром Сары-Арки. Неподалеку от того места, где сейчас находятся развалины ставки, возвышается и мавзолей самого Джучи &ndash; сооруженное из красного кирпича квадратное в плане здание с голубым куполом и порталом со стрельчатой аркой.&nbsp;Считается, что мавзолей был построен в XIV или XV веке одним из потомков Джучи, хотя имеются и мнения по более раннему периоду, так как на надгробии выбита дата 1227 год (год гибели хана). Согласно народной легенде, старший сын Чингис хана, погиб где-то в окрестностях Улытау во время охоты, будучи растерзанным раненым им хромоногим куланом, который сорвал хана с коня и отгрыз ему правую руку.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/134.jpg\" style=\"float:left; height:194px; width:290px\" />Памятник первостроителям города в городе Жезказган, расположенный на пересечении бульвара Сакена Сейфуллина и площади Первостроителей, был установлен в 1978 году. Авторами монумента являются художник К. Пак, скульптор Н. Андреев и архитектор К. Турлыбаев. Жезказган получил официальный статус города в 1954 году. Сейчас это административный, промышленный и культурный центр, который раскинулся на берегу Кенгирского водохранилища.&nbsp;Благодаря труду строителей город, история которого начиналась с небольшого поселка, широко раздвинул свои границы, построены новые микрорайоны, проспекты, разбиты парки и скверы, объекты социально-культурного назначения-школы, театр, библиотеки, музеи.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/133.jpg\" style=\"float:left; height:194px; width:290px\" />Кенгирское водохранилище - одно из водохранилищ Казахстана, его длина - 33 км, ширина - 1,6 км. Кенгирское водохранилище расположено на территории Улытауского района Карагандинской области, на его южном побережье раскинулся город Жезказган. Водохранилище образовано в 1952 году. Площадь - 37 км&sup2;, объём - 0,319 км&sup3;. Оно осуществляет многолетнее регулирование стока. Используется для энергетики и ирригации. Строительство водохранилища началось в 1940 году, через год было приостановлено из-за войны, в 1946 году возобновилось. Водохранилище было построено в 1952 году и наполнено спустя два года.&nbsp;Проектная ёмкость водохранилища была 120 млн м&sup3;, после начала строительства была увеличена до 173 млн м&sup3;. Проектный уровень - 373 метра.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/130.jpg\" style=\"float:left; height:194px; width:290px\" />&laquo;Жетыконыр&raquo; - это, собственно говоря, слово нарицательное, ведь именно так казахи издревле называли неподвижные песчаные холмы, покрытые засухоустойчивой растительностью. Однако, пески Жетыконыр, расположенные к юго-востоку от города Жезказгана, с течением времени обнажились и теперь создают поистине сюрреалистичное зрелище. В наши дни здесь можно наблюдать картины, совершенно не свойственные центральной части Казахстана: на фоне песчаных дюн бродят верблюды, а по песку бегают, оставляя за собой следы-полоски из точек, ящерицы-круглоголовки. Немногочисленные жители метеостанции Аккенсе рады видеть гостей и неизменно поражают своим душевным гостеприимством.</p>', '1542096925.jpg', 1, '2018-11-12 14:15:25', '2020-02-01 14:01:35'),
(8, 'zhetysay', NULL, NULL, NULL, 'Жетысай', 'ДОБРО ПОЖАЛОВАТЬ В ЖЕТЫСАЙ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 29,688</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 2,614</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Город Жетысай расположен в Южно-Казахстанский области Казахстана и является центром Мактааральского района. На расстоянии 232 километров от него расположен областной центр Шымкент. Прежнее название города - Джетысай, которое в 1993 году было изменено на настоящее.</p>\r\n\r\n<p>Жетысай был основан в 1951 году. По истечении времени, развиваясь и раздвигая свои территориальные границы, он был преобразован в город, статус которого получил в 1969 году.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/141.jpg\" style=\"float:left; height:194px; width:294px\" />Основными предприятиями, на которых базируется экономика города, являются производственные объединения. Их продукцией являются высоковольтное и электрощитовое оборудование. Частные компании города предоставляют строительные и ремонтно-восстановительные услуги, специализируются на фито- и ландшафтном дизайне, занимаются перевозкой пассажиров и транспортировкой грузов, реализовывают медицинские изделия.&nbsp;Работают медицинские, образовательные и культурные учреждения, вокзалы, автозаправочные станции. Ведёт свою деятельность драматический театр, который был открыт в городе в 1969&nbsp;году. Он представляет собой самый крупный районный театр в республике.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/140.jpg\" style=\"float:left; height:194px; width:290px\" />Жетысайский драматический театр имени Курманбека Жандарбекова был образован 18 января 1969 года. Первый спектакль поставлен по пьесе &quot;Жалбыр&quot; Беимбета Майлина. Открытие в конце 60-х годов прошлого столетия музыкально-драматического театра в маленьком районном городке стало настоящим событием для жителей Южно-Казахстанской (сейчас Туркестанской) области. Театр построили по оригинальному проекту. Первая актерская труппа в основном состояла из активистов драмкружков.&nbsp;Несколько лет тому назад Жетысайский театр лишился статуса музыкального и стал только драматическим. Содержание оркестра обходилось недешево, и областной департамент культуры посчитал это непозволительной роскошью для провинциального городка с населением в несколько десятков тысяч жителей.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/142.jpg\" style=\"float:left; height:194px; width:290px\" />Университет &quot;Сырдария&quot; расположен в городе Жетысай, Жетысайского района, Туркестанской области. Район имеет свои особенности, такие как: географическое расположение, наибольшая плотность населения, высокие показатели рождаемости, сохранение языка, обычаев и традиций казахского народа. Территория района составляет 1,8 тыс.кв.км и со всех сторон граничит с республикой Узбекистан. Расстояние между городом Жетысай и областным центром более 231 км. &quot;Университет &quot;Сырдария&quot; был открыт в 1998 году на базе Жетысайского учебного центра МКТУ имени Х.А. Яссави. Если на момент открытия университет располагал только одним учебным корпусом, то на сегодняшний день имеются 5 учебных корпусов, Инновационный научно-исследовательский центр, 4 библиотеки, Дворец студентов на 500 мест.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/157.jpg\" style=\"float:left; height:194px; width:290px\" />В городе&nbsp;хорошо налажено транспортное сообщение. По внутренним и междугородним маршрутам курсируют автобусы 4 предприятий. Более 500 частных водителей работают на линиях в любое время суток и обеспечивают комфортабельным транспортом жителей района и его гостей. Постоянно ведутся работы по улучшению качества работы телефонной связи. Для этого выполняется поэтапная замена устаревших аналоговых станций на цифровые. Разветвленные автомобильные трассы включают дороги местного, областного и республиканского значения. Для поддержания их нормального состояния и обеспечения безопасного движения ведутся своевременные ремонтные работы.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/158.jpg\" style=\"float:left; height:194px; width:290px\" />В пределах района находится множество археологических памятников, относящиеся к разным эпохам, в частности к неолиту, ранней бронзе и более позднему периоду - средневековью. Почти в каждом селе возвышаются мемориалы и стелы в память о погибших на полях сражений уроженцев района в годы Великой Отечественной войны. С целью их сохранения все обелиски взяты под охрану государства.</p>', '1559303156.jpeg', 1, '2018-11-12 14:15:37', '2020-02-01 14:00:38');
INSERT INTO `cities` (`id`, `url`, `s_title`, `s_description`, `s_keywords`, `name_ru`, `announce`, `name_kz`, `description`, `image`, `active`, `created_at`, `updated_at`) VALUES
(9, 'karaganda', NULL, NULL, NULL, 'Караганда', 'ДОБРО ПОЖАЛОВАТЬ В КАРАГАНДУ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 489,355</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 30,834</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 6</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Караганда - это город, который является областным центром Карагандинской области РК. Караганда, прежде всего, шахтерский город. Благодаря богатству природных ресурсов и удачному местоположению, этот город давно уже стал крупным индустриальным, экономическим и культурным центром Казахстана, а также важным транспортным узлом. Как в далекой древности, здесь проходят значимые для страны транспортные артерии: железнодорожные и автомобильные магистрали.&nbsp;</p>\r\n\r\n<p>Город находится в центральной части Казахстана и занимает площадь 550 км&sup2;. Является 4-м городом по населению после Алматы, Шымкента и Астаны. История столицы Центрального Казахстана, Караганды, пусть и не такая давняя, как, например, у Лондона, но довольно насыщенная. Кроме того, город просто изобилует различными культурными и историческими достопримечательностями.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/26.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Карагандинский угольный бассейн - один из крупнейших в мире угольных бассейнов. По запасам угля занимал третье место в СССР после Кузбасса и Донбасса с площадью около 3,6 тыс. км2. Добыча ведется главным образом подземным способом. Основные центры добычи - города Караганда, Сарань, Абай, Шахтинск. Потребителями коксующихся углей являются металлургические заводы Казахстана и России, энергетических -&nbsp;железнодорожный транспорт, электростанции и промышленные предприятия.&nbsp;Поэтому шахта является неотъемлемым символом города. Наверное, в каждой карагандинской семье есть люди, которые когда-либо были связаны с шахтами и угледобычей.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/27.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Карагандинский Экологический Музей - единственный музей подобного рода на территории СНГ. &nbsp;Здесь можно узнать о разнообразии природных ресурсов Казахстана, их добыче и дальнейшей переработке, об истории и современной опасности Семипалатинского ядерного полигона, о космодроме Байконкур и крушениях ракет. В ЭкоМузее собрано множество экспонатов со всего региона: части ракет и самолетов, производственная и военная техника советских и постсоветских времен. Здесь можно увидеть уникальный экспонат - топливный бак ракетоносителя &laquo;Протон&raquo;, упавшего на территории Казахстана в 1999 году.&nbsp;В ЭкоМузее также находится Туристский Информационный Центр, в котором можно получить подробную информацию о достопримечательностях города и области, маршрутах и местах размещения.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/28.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Карлаг был одним из сотен лагерей, носивших собирательное название ГУЛАГ (Главное управление лагерей), которые были организованы в период массовых политических репрессий. В поселке Долинка (50 км к юго-западу от сегодняшней Караганды) располагался административный центр Карлага. Большое двухэтажное здание бывшего управления Карлага, в котором сейчас размещается музей памяти жертв политических репрессий, - величественная постройка с колоннами, выполненная в духе советского неоклассицизма, дом офицеров, бывший культурным центром для местных военных;&nbsp;дом техники, где проходили выставки достижений народного хозяйства; родильный дом и здание молельного дома, а также многочисленные развалины саманных построек, возведенных когда-то самими заключенными, составляют основной перечень довольно мрачных достопримечательностей.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/29.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Дворец Культуры Горняков -&nbsp;одна из главных достопримечательностей Караганды, место проведения всех важных праздников. На сцене Дворца культуры обосновались Казахский драматический театр и Театр музыкальной комедии. Центральную часть дворца занимает театральный комплекс, зрительный зал которого рассчитан на 1000 мест. Антаблемент портика увенчан шестью скульптурами: шахтера, строителя, пастуха с ягненком, колхозницы со снопом, акына с домброй и воина.&nbsp;Дворец богато украшен искусственным мрамором и лестницами с бронзовыми перилами, росписями стен и куполов, хрустальными люстрами, красивой мебелью, коврами, картинами и бронзовыми скульптурными группами.&nbsp;&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/30.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Памятник влюбленным - Такой подарок сделал университет имени Букетова к 80-летию шахтерской столицы. Художественная идея монумента вынашивалась авторами несколько лет.&nbsp;По задумке авторов, карагандинки, желающие поскорее выйти замуж, должны будут с особым чувством звонить в колокольчик. На парней примета не распространяется. Общее сердце, словно объединяющее влюбленных, обозначает, по задумке авторов, жаркое и крепкое чувство, а три позолоченных колокольчика символизируют биение сердец и жизни.&nbsp;&laquo;Влюбленные&raquo; украсили одну из центральных аллей города &ndash; сквер на бульваре Мира и имеют все шансы стать местом встреч карагандинцев.</p>', '1542096948.jpg', 1, '2018-11-12 14:15:48', '2020-02-01 13:59:27'),
(10, 'kaskelen', NULL, NULL, NULL, 'Каскелен', 'ДОБРО ПОЖАЛОВАТЬ В КАСКЕЛЕН', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 64,416</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 5,665</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>В предгорьях Заилийского Алатау в Казахстане лежит город Каскелен, который является центром Карасайского района в Алматинской области. Он находится на расстоянии 23 километров от Алматы. Город расположен в зоне резко континентального климата с малоснежной зимой и жарким летом. Согласно историческим документам ещё в 1857 году на территории современного города приступили к возведению почтового пикета, в помещениях которого в последствии размещалось 40 служивых казаков.</p>\r\n\r\n<p>Через два года рядом с сооружением обосновали жильё около 150 семей алтайских казаков. Так в 1860 году здесь была основана станица Каскеленская. В 1861 году на её территорию прибыло ещё 12 семей крестьян.&nbsp;В 1865 году в станице был открыт приход. Небольшая церковь украсила новую станицу. Её строительство финансировала Меланья Колпаковская - супруга военного губернатора. Настоятелем во вновь возведённый Свято-Михайловский приход был назначен Павел Дубов - военный священник.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/155.jpg\" style=\"float:left; height:194px; width:290px\" />Современный город Каскелен, бывший ранее поочерёдно станицей Каскеленской, затем Любавинской, является центром окрестного овощного и молочного хозяйств. Среди предприятий города успешно работают и выпускают качественную продукцию овощеконсервный и молочные заводы, фармацевтическая фабрика.&nbsp;Кроме того, частные компания и фирмы работают в сфере оказания услуг по освоению земель, рекультивации и мелиорации почвенного грунта. Сельскохозяйственные предприятия города занимаются животноводством и птицеводством.&nbsp;Среди образовательных учреждений Каскелена функционируют детские сады, средние школы, медицинский колледж. В городе работает автомобильный рынок, который по свои площадям является наиболее крупным в Средней&nbsp;Азии.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/150.jpg\" style=\"float:left; height:194px; width:290px\" />Каскеленское ущелье располагается в 25 километрах от западной черты города Алматы и входит в состав Иле-Алатауского Национального парка. Это простая природная достопримечательность захватывает дух красотой своих пейзажей - раскидистыми хвойными лесами, по мере спуска с гор превращающимися в лиственные и плодовые деревья. Здесь можно встретить молодые, еще не гигантские ели, а в урожайный сезон насладиться плодами барбариса, урюка, диких яблонь и абрикосов.&nbsp;Маралов в Казахстане разводят всего в двух местах: в Катон-Карагайском районе и здесь - в Каскеленском ущелье. Особенностью этих животных являются панты - рога молодого оленя. Именно в пантах марала накапливаются биологически активные вещества, которые обладают мощным стимулирующим и тонизирующим действием.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/151.jpg\" style=\"float:left; height:194px; width:290px\" />Главная достопримечательность Каскеленского ущелья &ndash; это камень Уй-Тас, что с казахского переводится как &laquo;камень-дом&raquo;, потому что по форме он похож на традиционную юрту. Этот валун имеет форму идеальной окружности и весит почти 500 тонн. Нигде в округе вы не сможете встретить похожего уникального объекта. Никто не знает, как камень оказался на склоне горы и имеет ли человек отношение к его происхождению. Есть версия о том, что валун принес древний ледник, а часть людей считает, что раньше у камня совершались религиозные ритуалы. В ущелье вы сможете развлечь себя посещением, форелевого хозяйства, обследовать питомник редких и комнатных растений или узнать много нового о казахской культуре в музее &laquo;Почитания Матери&raquo;.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/152.JPG\" style=\"float:left; height:194px; width:290px\" />Река Каскелен берет начало с северных склонов Заилийского Алатау на высоте 3580 метров над уровнем моря и впадает в Капчагайское водохранилище. Длина реки Каскелен 177 километров (по другим данным &ndash; 135 километров). Площадь бассейна 372 квадратных километров. Верхняя часть бассейна реки Каскелен отличается значительной шириной, доходящей до 19 километров. Наибольшие высоты хребта достигают 4 километров над уровнем моря или немногим больше. Одна из вершин, лежащая на границе с бассейном реки Аксай, имеет высоту 4206 метров над уровнем моря.&nbsp;Однако средняя высота осевой части хребта не превышает 3900 метров над уровнем моря. В соответствии с этим положительная разность оледенения составляет в среднем не более 150 метров.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/156.jpg\" style=\"float:left; height:194px; width:290px\" />Каскелен является малой родиной публициста Валерия Могильницкого - известного советского казахского журналиста. Город относится к малым городам&nbsp;Казахстана, в котором основной отраслью являются предприятия, перерабатывающие сельскохозяйственную продукцию. В Каскелене ведёт свою деятельность историко-краеведческий музей, который ещё называют музеем первого президента страны.&nbsp;Климат района резко континентальный.</p>', '1542096962.jpg', 1, '2018-11-12 14:16:02', '2020-02-01 13:58:25'),
(11, 'kokshetau', NULL, NULL, NULL, 'Кокшетау', 'ДОБРО ПОЖАЛОВАТЬ В КОКШЕТАУ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 141,396</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 10,166</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Город Кокшетау находится на Кокшетауской возвышенности, которую геологи называют Кокшетауской глыбой и она имеет поэтическое название - &quot;Казахская Швейцария&quot;. Город был основан в 1824 году как посёлок казачьей станицы, а в 1868 году он стал уездным городом, который далее развивался как центр земледельческого и животноводческого хозяйства, как курортный город. Курорт &quot;Боровое&quot; со своими неподражаемыми красотами находится в 70 километрах от города.</p>\r\n\r\n<p>Это опрятный, красивый город. Если подняться на вершину сопки, которая находится на юго-западе города, то взору откроется удивительный вид: на западе водная гладь озера и полоса пляжа, на северо-востоке простирается равнина, на юге поднимаются сопки.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/31.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Главной достопримечательностью Кокшетау является Государственный Национальный Природный Парк &laquo;Бурабай&raquo;. А украшением его являются 14 превосходных озер среди живописных гор, покрытых густыми хвойными лесами. Самым значимым среди них по размерам, по красоте и по любви туристов считается озеро Боровое. Боровое &mdash; курорт общегосударственного значения, который находится в ведении Управления делами Президента Республики Казахстан. Озеро расположено в 70 км от города. На берегах озера построены многочисленные гостиницы, санатории и дома отдыха.&nbsp;Мягкий горный климат, чистый воздух и наличие целебных грязей делают отдых здесь не только приятным, но и лечебным.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/32.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музей истории города Кокшетау - Здание музея является памятником истории и находится под охраной государства. В конце 19 начале 20 века здесь жила семья будущего государственного деятеля советской эпохи В.В. Куйбышева. В годы Великой Отечественной войны в этом доме располагался тыловой госпиталь для раненых солдат Советской армии. После войны в нем открыли музей В.В. Куйбышева, который в 2000 году был реорганизован в Музей истории города.&nbsp;В экспозиции музея нашли отражение в хронологической последовательности основные вехи истории Кокшетау, начиная с момента его основания в 1824 году и по настоящее время. Фонды музея хранят более 11 тысяч экспонатов.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/33.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Озеро Имантау в Казахстане находится неподалеку от одноименного поселка, в 90 километрах от Кокшетау и в 400 километрах от Астаны в Северо-Казахстанской области Айыртауском районе. Пресное озеро Имантау отличается удивительной природой: к нему примыкает гора Имантау, вокруг произрастают хвойные деревья, встречаются камни и скалы необычной формы, тысячелетиями оттачиваемые дождями и ветрами. Северо-западный участок водоема отделен мысом, юго-западный берег скалистый и высокий. В озере есть остров, который находится в южной его части.&nbsp;Природа у водоема очень красивая. Здесь произрастают березовые, хвойные, осиновые леса, лекарственные травы, у берега можно встретить камыш и тростник. Каменистая почва соседствует с зелеными полянами и валунами.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/34.JPG\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Озеро Копа находится возле города Кокшетау в Акмолинской области. Его глубина достигает от двух до трех метров, а общая площадь составляет 14 квадратных километров. В озеро впадает река Кылшакты, река Чаглинка, на дне озера также бьют ключи, питающее его. Водоем проточного типа, летом не пересыхает. Берега озера с восточной и северной стороны пологие, низкие, поросшие травой. С юга и запада берега озера отделены от равнинной части валами. На юге и западе береговая часть водной глади поросла тростником, остальная часть озера чистая.&nbsp;Вода в озере щелочная, она характеризуется как агрессивная к бетонам. В связи с близостью города, озеро все сильнее загрязняется и мелеет, так как его воды используются для хозяйственных нужд. Пляжи на берегу водоема являются единственным местом пляжного отдыха жителей города.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/35.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Усадьба Айганым - Начало образования усадьбы относится к двадцатым годам 19 века, когда урочище Сырымбет стало местом постоянной зимовки (осень 1822 года) бабушки Чокана Валиханова, Айганым Валиевой, вдовы хана среднего жуза Вали Аблайханова. Архитектурный облик усадьбы формировался на протяжении 19 века. В нее входит жилой дом с хозяйственными постройками и домом для прислуги, рядом с которыми построены мечеть и медресе.&nbsp;Здесь проходили айтысы певцов и музыкантов, выступали знаменитые композиторы Биржан-сал, Ахан-сере, кобызист Курумбай Кангожин, певец Коке Альджанов и др. Сейчас усадьба Сырымбет вошла в сакральную карту Северо-Казахстанской области.</p>', '1547620614.jpg', 1, '2018-11-12 14:16:15', '2020-02-01 13:57:02'),
(12, 'kostanay', NULL, NULL, NULL, 'Костанай', 'ДОБРО ПОЖАЛОВАТЬ В КОСТАНАЙ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 225,464</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 17,872</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 4</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Город Костанай основан русскими и украинскими переселенцами на левом берегу реки Тобол в 1879 году как торговой пункт, где на ежегодных ярмарках крестьяне и кочевой люд обменивались товарами: хлебом, продуктами животноводства. Поселения обрастали мелкими заводами с паровыми мельницами, вокруг вырастали кожевенные заводы. В 1913 году веткой Костанай-Троицк город был связан с железной дорогой, что ещё более усилило его роль торгового города.</p>\r\n\r\n<p>В Костанае протекала деятельность великого казахского просветителя и педагога Ибрая Алтынсарина (1841-1889 гг.), создавшего сеть школ для казахов. Ибрай Алтынсарин известен как автор учебников для казахских школ. Он перевел на казахский язык басни И. Крылова, рассказы Л. Толстого. Ибрай Алтынбаев считается одним из основоположников национальной казахской литературы.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/36.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музей игрушек в городе Костанай является первым и единственным в своем роде музеем на территории Казахстана. Музей располагается на улице Гоголя в Казахско-французском культурном и торговом центре на четвертом этаже. Костанайский музей игрушек представляет собой целое королевство, в котором собраны игрушки разных времен и из разных стран мира. На сегодняшний день в музее хранится 5 тысяч разнообразных экспонатов - от древних игрушек и до самых современных радиоуправляемых моделей.&nbsp;Особое внимание посетителей привлекает египетская женская фигурка II тысячелетия до нашей эры, загадочная венецианская карнавальная кукла, фарфоровая Собака, а также деревянный расписной Щелкунчик, величавый фарфоровый Петр I, боярин и боярыня. Каждая игрушка, которую можно увидеть в музее - уникальна. Пока взрослые занимаются покупками, детишки могут развлечься и поиграть в интерактивные игры.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/37.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музей военной техники под открытым небом &ndash; единственный в своем роде музей на территории Казахстана. Военная техника размещается в северо-западной части городского Парка Победы. Общая площадь музея под открытым небом 0,8 га. В числе 14 музейных экспонатов представлены действующие макеты военной техники советских времен, Великой Отечественной войны и Гражданской войны: танки Т-72, Т-64, Т-62, Т-34, БТР, артиллерийская установка &laquo;Катюша&raquo;, гаубицы и другая военная техника.&nbsp;Все экспонаты музея представлены в натуральную величину. Боевые машины сегодня уже списаны. Возле техники годов Великой Отечественной войны можно увидеть и несколько послевоенных образцов, которые до сегодняшних дней стоят на вооружении в некоторых странах - Т-72, БРДМ-2, БТР-70.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/38.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Костанайский кукольный театр размещается в красивом здании недалеко от железнодорожного вокзала и располагает уютным зрительным залом, рассчитанным на 150 зрителей. Театр был открыт в декабре 1986 г. спектаклем &laquo;Машенька и медведь&raquo; А. Садовского. Из детских спектаклей в театре ставятся &laquo;Еще раз о Красной Шапочке&raquo; С. Ефремова, &laquo;По-Щучьему велению&raquo; А. Гараховской, &laquo;Теремок&raquo; С. Маршака, &laquo;Три поросенка&raquo; С. Михалкова, &laquo;Приключения медвежонка Рим-тим-ти&raquo; Я. Вильковского, &laquo;Сказка про Балду&raquo;&nbsp;А. Пушкина, &laquo;Белая дочь степей&raquo; Г. Кулунчакова и другие давно полюбившиеся ребятам спектакли. На сегодняшний день в репертуаре афише Костанайского кукольного театра имеется 18 спектаклей. Актеры театра выступают с разными видами кукол &ndash; с ростовыми, тростевыми, перчаточными, планшетными, что делает спектакли более разноплановыми, необычными и интересными для больших и маленьких зрителей.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/39.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Наурзумский государственный природный заповедник - один из старейших заповедников Казахстана, был организован в 1931г. Современная площадь его составляет 191,4 тыс. га. В административном отношении заповедник располагается в Наурзумском и Аулиекольском районах Костанайской области. В 2002 г. Правительство Республики Казахстан представило Наурзумский заповедник на включение в Список Всемирного культурного и природного наследия ЮНЕСКО в номинации &laquo;Степи и озера Северного Казахстана&raquo;.&nbsp;Территория, включенная в состав заповедника, обладает уникальным для степной зоны ландшафтным и биологическим разнообразием. Это обусловлено историей формирования ландшафтов и сложным устройством поверхности. Более 30 тыс. лет назад здесь находились половодно-ледниковые воды.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/40.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Костанай отличается активным строительством современных спортивно - развлекательных объектов, которые позволяют молодежи посвятить свободное время занятиям спортом. Одним из них является построенный в 2002 году Ледовый дворец. Это прекрасно технически оснащенный комплекс предназначен не только для ледовых видов спорта. Здесь проводятся различные соревнования по хоккею, фигурному катанию, бегу на коньках. В комплексе можно весело и с пользой провести время,&nbsp;развлечь детей и отдохнуть.</p>', '1542096986.jpg', 1, '2018-11-12 14:16:26', '2020-02-01 13:55:58'),
(13, 'kyzylorda', NULL, NULL, NULL, 'Кызылорда', 'ДОБРО ПОЖАЛОВАТЬ В КЫЗЫЛОРДУ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 349,700</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 10,660</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Кызылорда выросла из основанной в начале 19 века крепости Ак-Мечеть. Крепость была построена на караванных путях из России в Среднюю Азию правителем Кокандского ханства - Омар-ханом. В 1853 году Ак-Мечеть была завоёвана русскими войсками и переименована в форт Перовский. В 1925 году город стал столицей Казахской АССР и был переименован в Кызылорду. Сейчас Кызылорда - современный красивый город.&nbsp;</p>\r\n\r\n<p>Улицы радиусами расходятся от центра к берегам реки, которая делает здесь большую петлю, которая является спасением для горожан в летние, знойные месяцы. В республике сейчас проводится программа по наполнению водой Аральского моря, что, несомненно, возродит регион к новой жизни. Это интересная информация для гостей и туристов.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/41.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Казахстанский государственный заповедник Барсакелмес был основан как заказник в 1929 году. А 10 декабря 1939 году получил статус государственного заповедника. С высыханием моря соленость воды превысила норму. Отсутствие пресной воды затрудняет существование животного мира. В период с 1982 по 1991 годы около 260 здешних куланов были переведены в другие заповедники республики. А оставшиеся 50 особей дали приплод в 137 голов. В настоящее время годовой прирост куланов составляет 20-25 голов.&nbsp;В Барсакельмесе имеются редко встречающиеся виды флоры и фауны. Это парнокопытные животные, млекопитающие, хищные звери, грызуны, земноводные, птицы, насекомые, а также более 256 видов растений. Исчезновение редких видов рыб в связи с иссыханием моря компенсируется возникновением новых видов животных и растений.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/42.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мемориальный комплекс был воздвигнут в честь Коркыт Ата, живщего в VIII-IX веках. &nbsp;Коркыт полностью посвятил свою жизнь поискам бессмертия человеческой души. Он носил с собой добро, радость своей игрой на кобызе, мудрость и философию своей поэзии. Бессмертные легенды о его магической силе, которая могла воздействовать на человеческое сознание, на большую душу, преодолеть любое препятствия, ценнейшие философские мысли в &laquo;Книге Коркыт Ата&raquo; - и есть свидетельство о его бессмертии. Он изобрел кобыз, ставший основой струнно-смычковой музыки.&nbsp;Философ, поэт, музыкант, целитель, государственный деятель Коркыт проповедовал идеи гуманизма, идеи гармоничного сосуществования человека и природы.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/43.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Областной историко-краеведческий музей находится в здании, которое является одним из архитектурных памятников Кызылорды, построенном в 1953 году. Сам же музей был основан в 1939 году и до момента получения собственного помещения располагался в церкви Петровской Казанской Богородицы. В фондах музея хранится почти 40 000 экспонатов, демонстрирующих сведения об обустройстве Кызылординского края, истории, промышленности и культуре. Гордостью музея являются доспехи батыров, пушечные стволы,&nbsp;которые применялись при взятии крепости Ак-Мечеть, коллекция монет, бывших в обращении в торговых точках великого Шелкового пути. На сегодняшний день в музей работают залы: Край в период советской власти, Присырдарьинская столица, Кызылординская область в годы Второй Мировой войны, Независимый Казахстан, Этнография, Культура и искусство.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/44.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мечеть Айтбая. Мечеть является старейшим в городе памятником архитектуры. Она расположена в историческом центре Кызылорды; открылась в 1878 году благодаря финансовым вложениям в ее строительство купца Айтбая Балтабаева. В советское время мечеть как религиозное заведения не функционировало, в 70-х годах здесь располагался филиал областного краеведческого музея. В 1982 году здание мечети было внесено в список памятников истории и культуры республиканского значения Казахстана и взято под надзор государства.&nbsp;В конце 20 века здание мечети было капитально отреставрировано, на деньги верующих построен минарет. Однако реставрация на пользу мечети как исторического памятника не пошла, так как от былого древнего мемориала после подобных работ остался лишь фасад, фактически его историческая ценность утратилась.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/45.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Редко встречается такое, чтобы здание железнодорожного вокзала было отнесено к разряду городских исторических памятников. Именно такой уникальный случай имеет место в Кызылорде, где здание железнодорожного вокзала является одним из самых старых и почетных сооружений города. Его строительство датируется 1905 годом, когда, после завершения строительства, была сдана в эксплуатацию железная дорога Оренбург - Ташкент. Здание кызылординского вокзала представляет собой капитальное сооружение, построенное из жженого кирпича, выполненное в стиле русского архитектурного искусства, которое до настоящего времени продолжает функционировать и служить городу, являясь его украшением.</p>', '1542096999.jpg', 1, '2018-11-12 14:16:39', '2020-02-01 13:52:41'),
(14, 'Uralsk', NULL, NULL, NULL, 'Уральск', 'ДОБРО ПОЖАЛОВАТЬ В УРАЛЬСК', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 234,467</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 30,663</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 4</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Уральск - старейший город Западного Казахстана. Он возник в 1613 году как постоянное поселение на реке Яик (Урал). Яицкое поселение выросло на торговом пути из Средней Азии в Россию. Из казахских степей кочевники сгоняли сюда скот, доставляли для продажи мясо, войлок, кожу, сюда же приходили караваны с шёлком, фруктами, пряностями. Всё это обменивалось на промышленные товары из России.&nbsp;</p>\r\n\r\n<p>Современный Уральск - красивый город с развитой инфраструктурой, с сетью комфортабельных гостиниц, ресторанов. Уральск окружён зелёным поясом из дуба, тополя, клёна, река Урал с её красивой поймой и удивительной рыбалкой в этих местах делают город привлекательным для гостей и туристов.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/81.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Побывать в Уральске и не зайти в музей бунтаря и героя этого края Емельяна Пугачева -&nbsp;означает пропустить возможность почувствовать историю, прикоснувшись к вещам того времени. Музей предводителя крестьянского восстания Пугачева расположен в доме, отстроенном специально по проекту типовых куреней, которыми был усыпан Уральск ХVIII века. Это большой деревянный сруб с тесовой крышей. В этом доме никогда не жил Емельян Пугачев, но расположено строение рядом с территорией, где стояло жилище уральского казака.&nbsp;В музее выставлены подлинные вещи, некогда принадлежавшие самому Пугачеву и его ближайшим сподвижникам - оружие, знамена, пушки, ценные подарки, бытовые принадлежности.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/82.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Кизил Мечеть, расположенная в казахстанском городе Уральск, была построена в 1871 году, и ее первоначальный архитектурный облик сохранился до наших дней. В советские времена мечеть была закрыта, с нее сняли минарет, долгие годы ее не ремонтировали, а в помещениях располагались в разное время Дом инвалидов, ремесленное училище, общежитие. В 1980 году здание Кизил Мечети было признано памятником архитектуры, а к 1990-м годам ее передали на баланс действующей областной мечети и практически полностью разобрали. Красной из-за цвета.&nbsp;В 2006 году Кизил Мечеть, восстановленная трудами местных жителей всех национальностей и вероисповеданий, была перестроена по старым чертежам и открыта. Кизил Мечеть в наши дни представляет собой двухэтажное здание из красного кирпича с полуциркульными окнами и зеленой черепичной крышей, в котором ведутся служения.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/83.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Михайло-Архангельский собор в Уральске - одно из старейших зданий города, это первая церковь, появившаяся у вольного уральского казачества. Собор был возведен в честь Архангела Михаила - небесного покровителя яицкого казачьего войска в 1741 году и до середины XIX века оставался главным храмом. Этот собор примечателен тем, что здесь бывали такие известные личности как А.С. Пушкин, И.А. Крылов, А.В. Суворов, В.А Жуковский, В.Г. Короленко, В.А. Даль, а в 1773 году вокруг собора была выстроена крепость, в которой комендант Симонов с гарнизоном и частью казаков оборонялся от Е.И. Пугачева.&nbsp;В конце 1990-х годов была проведена реконструкция памятника архитектуры, восстановлены древние фрески. В храме сегодня хранится икона Божией Матери &quot;Смоленская - Одигитрия&quot; и рака с частицами мощей высокочтимых святых Апостола Андрея Первозванного, святого Великомученика Георгия Победоносца, святителя Луки Войно - Ясенецкого и др.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/84.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Ротонда с часами - это интересное ажурное кованое сооружение, которое изготавливалось на протяжении трех месяцев лучшими мастерами кузнечного дела в городе. Ротонда была установлена на площади Абая перед акиматом 29 сентября 2012 года, специально ко Дню города Уральска. Башню ротонды на высоте в 5,5 метров украшают часы с четырьмя циферблатами и швейцарским механизмом. Общий вес кованой конструкции превышает четыре тонны. Ротонда представляет собой своеобразную беседку, выполненную из кованых элементов с красивейшим ажурным орнаментом.&nbsp;Конструкция действительно украшает и дополняет архитектуру площади Абая. Это своеобразный &laquo;Биг-Бен&raquo; города Уральска. Несмотря на еще короткую историю, ротонду с часами успели оценить жители и гости города. Она заняла достойное место в списке достопримечательностей Уральска. Здесь назначают свидания и по ней сверяют часы жители города, а туристы полюбили фотографироваться вблизи ротонды.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/85.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одна из красивых и оригинальных достопримечательностей города -&nbsp;светомузыкальный фонтан &laquo;Торнадо&raquo;. Он разбит в парке имени Сергея Кирова. Это первый и пока единственный светомузыкальный фонтан в республике. Утром и днем он работает в обычном режиме и ничем не отличается от простого фонтана, каких немало в Казахстане. Однако, с наступлением темноты Вам откроется восхитительное зрелище. Поющий или танцующий фонтан работает с различными музыкальными произведениями, а струи воды подсвечены всевозможными цветами. Каждый, кто приходит отдохнуть в парк и полюбоваться фонтаном, может поучаствовать в создании уникального шоу и даже потанцевать с самим фонтаном.</p>', '1542097011.jpeg', 1, '2018-11-12 14:16:51', '2020-02-01 13:51:25'),
(15, 'ust-kamenogorsk', NULL, NULL, NULL, 'Усть-Каменогорск', 'ДОБРО ПОЖАЛОВАТЬ В УСТЬ-КАМЕНОГОРСК', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 340,631</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 16,862</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Усть-Каменогорск (казахское название -&nbsp;Өскемен) является административным и промышленным центром Восточно-Казахстанской области. До 1932 года город входил в состав Томской губернии Омской области, Алтайской губернии Семипалатинской губернии, Алтайского горного округа и Семипалатинского округа. В 1939 году стал административным центром. Его первоначальное название -&nbsp;крепость Усть-Каменная. Город расположен на месте впадения в реку Иртыш реки Ульбы.</p>\r\n\r\n<p>Усть-Каменогорск -&nbsp;город многонациональный. В дружбе и согласии здесь проживают триста двадцать пять тысяч человек разных народностей: казахи, русские, украинцы, узбеки, немцы, корейцы, татары, чеченцы и другие.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/76.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Озеро Зайсан - одно из наиболее крупных и необычных пресноводных озер Казахстана. Оно раскинулось между горными хребтами в тридцати километрах от Киин-Кериша. Озеро Зайсан иногда называют &quot;Озером колокольного перезвона&quot; благодаря необычным звукам, которые можно услышать на берегах этого удивительного озера с наступлением темноты. Озеро Зайсан может похвастаться большим количеством видов рыб, обитающих в его водах. Налим, щука, окунь, карась- далеко не редкий улов туриста, приехавшего порыбачить на озеро Зайсан.&nbsp;На его берегах располагается Акшуат, так называемая деревушка рыбаков, гостеприимные жители которой с удовольствием примут Вас в своих краях и, если захотите, организуют своеобразную экскурсию, дабы посвятить вас в самобытную атмосферу семей рыбаков.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/77.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Гора Белуха - наивысшая точка Горного Алтая, с которой начинается Катунский хребет. Располагается она у истока реки Катунь. Эта гора имеет вид из двух вершин, которые по форме напоминают неправильные пирамиды, и по высоте, Восточная - 4509 метров а Западная - 4435 метров. Гора Белуха - интересный природный памятник, величественный и первозданный. Район горы Белуха имеет изменчивый, который меняется в по высоте. Меняется и температура, от подножия до верхней точки горы Белуха. Зимой - продолжительные снежные осадки, а летом - проливные дожди.&nbsp;Загадочное месторасположение горы, от трех океанов мира на одном расстоянии, впечатляет туристов. Утомленных городским ритмом исцеляет, а заядлым оптимистам доказывает, что жизнь прекрасна.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/78.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Курорт &quot;Алтайские Альпы&quot; - один из самых популярных горнолыжных комплексов Казахстана. Курорт расположен в двадцати километрах от Усть-Каменогорска, на живописном склоне Алтайских гор. &quot;Алтайские Альпы&quot; - отличный и современный горнолыжный курорт, оборудованный всем необходимым для качественного активного отдыха. Здесь есть множество трасс различных категорий сложности, две канатные дороги, пункты аренды спортивного снаряжения и многое другое. Некоторые из склонов освещены, так что можно кататься даже ночью.&nbsp;Новички могут воспользоваться услугами профессиональных инструкторов и тренеров. Помимо этого на курорте действует уютное кафе, зал для бильярда, массажные кабинеты, баня, бассейн и прочие развлекательные заведения, где можно отдохнуть и расслабиться после целого дня катания на лыжах.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/79.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Этнодеревня &ndash; это уникальное место в городе Усть-Каменогорск. Заповедник представляет собой живой памятник народам Казахстана. Она была возведена в левобережном комплексе в 2010 г. энтузиастами-краеведами всего за 28 дней. Общая площадь заповедника составляет 10 га. Главной целью этнодеревни является показать обычаи, традиции, обряды и быт народов, проживающих на территории Восточно-Казахстанской области. В каждом доме воссоздана атмосфера, которая бытовала здесь на тот момент времени, когда в них проживали люди.&nbsp;Этнодеревня имеет улицу, состоящую из 20 объектов, датирующихся концом XIX &ndash; середины XX ст. Все домики были воссозданы по архивным материалам и научной литературе. В этнодеревне все соответствует историческим реалиям: подворья, здания, материалы, одежда, предметы быта. В основном это все реальные экспонаты, некоторым из которых уже более 100 лет.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/80.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одной из достопримечательностей города Усть-Каменогорска является Мемориальный комплекс Победы, расположенный на слиянии двух рек - Ульбы и Иртыша. Открытие мемориального комплекса состоялось в 1995 г. при участии руководства города Усть-Каменогорск и местных жителей. Этот день стал знаменательным для горожан. Поскольку в их родном уютном городке появился целый комплекс, посвященный воинам восточного Казахстана, которые отважно сражались и геройски погибли в тяжелые годы Великой Отечественной войны (1941-1945 гг.).&nbsp;Мемориальный комплекс Победы является красивейшим памятником в уютном сердце города и популярным местом отдыха для всех жителей.</p>', '1542097023.jpg', 1, '2018-11-12 14:17:03', '2020-02-01 13:50:36'),
(16, 'pavlodar', NULL, NULL, NULL, 'Павлодар', 'ДОБРО ПОЖАЛОВАТЬ В ПАВЛОДАР', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 332,062</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 11,992</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Павлодар - город расположенный на реке Иртыш. Также является административным центром Павлодарской области РК. Это старинный город появившийся в начале 18 века как один из форпостов Иртышской военной линии. Павлодар - современный промышленный и культурный город. Старинные дома в сибирском &laquo;купеческом&raquo; стиле органично соседствуют с современными зданиями.&nbsp;</p>\r\n\r\n<p>Современный Павлодар протянулся в течении 16 км, по берегу Иртыша, который образует западную границу города и определяет его характер. Зеленая набережная Иртыша привлекает жителей и гостей города. Если отсюда смотреть на запад, то насколько хватает глаз только степь, бесконечное небо и Иртыш с крутыми дикими склонами.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/46.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Султанмахмут Торайгыров казахский поэт-демократ, уроженец Баянаульского района. Прожив короткую жизнь, он оставил свой яркий след в казахской литературе. Памятник поэту изготовлен из бронзы, постамент из красного и черного гранита. Стена художественного музея, являющаяся фоном мемориала, заполнена двумя сюжетными рельефами, автором которых является молодой талантливый скульптор Мурат Мансуров. Он использовал темы из произведений С. Торайгырова. Высота каждого рельефа 3 метра, ширина 6 метров. Памятник представляет собой бронзовую фигуру поэта, стоящего у сосны.&nbsp;Мемориал С. Торайгырову стал украшением города и памятником республиканского значения.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/47.JPG\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Из современных памятников архитектуры Благовещенский кафедральный собор удивляет размахом. Собор построен в 1999 году. Павлодарские архитекторы за основу взяли один из соборов Московского Кремля. Колокола отлиты в Москве, на заводе им. Лихачева, всего их девять. Самый большой колокол весит-1024 кг. Церковная утварь изготовлена в городе Софрино (Московская обл.), частично на мебельной фабрике города Павлодара. Большой архитектурной редкостью является монолитный купол.&nbsp;Позолоченный крест над куполом установлен на высоте 51 метр. Ажурные своды и арки храма, высоко взметнувшиеся главы с золотыми крестами, изящные башни, колокольня &ndash; делают храм уникальным архитектурным ансамблем.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/480.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Дом купца Зайцева - исторический памятник, каждая деталь которого выглядит изумительно. Его декор удивляет своими искусно вырезанными легкими кружевными узорами на дверях, стенах и ставнях, а также металлическими парапетами, установленными на крыше дома. Резные элементы были выполнены славгородскими и павлодарскими мастерами по дереву Чечеткиным, Косаревым и другими по эскизам талантливого архитектора Батова. Особое внимание привлекает веранда округлой формы, которая выступает из центра дома и служит оригинальным украшением, придавая всему строению пафоса.&nbsp;По рассказам местных старожилов, веранда дома была возведена по специальному заказу для дочери купца Пяткова, которая очень тяжело болела. В доме можно увидеть сохранившийся до сегодняшних дней уникальный в своём роде изразцовый камин, занявший почетное место в зале.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/490.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музей литературы и искусства имени Бухар Жырау располагается в историческом центре города, в уникальном здании, являющемся памятником деревянной архитектуры. Это здание было возведено еще в 1897 г. и сегодня признано самым красивым памятником деревянного зодчества, не только Павлодара, но и всей Республики Казахстан. Интересна и история постройки этого памятника архитектуры. Согласно историческим данным известно, что именно здесь купец Фаттах Рамазанов начал строительство мечети.&nbsp;Однако во время постройки строителями были допущены грубые нарушения, в результате для культового сооружения пришлось выбрать другое место. Прежнюю стройку Фаттах Рамазанов останавливать не стал и в самом центре города появилось такое великолепное резное сооружение.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/50.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Главную мечеть города видно с разных концов города. Небесного цвета купол в виде шанырака венчает золотой полумесяц, устремленные ввысь голубые минареты и величественная лестница - отличают новую мечеть. Архитектурное сооружение мечети имени Машхура Жусупа поражает воображение красотой и величием. Главную мечеть города видно с разных концов города. Здание мечети имеет форму восьмиконечной звезды, высота минаретов составляет 63 м, а высота купола с полумесяцем - 54 м. Архитектурный ансамбль мечети занимает территорию 6 га. Мечеть расположена в центре Павлодара и архитектурно, если смотреть от основания лестницы, похожа на распахнутое сердце, открытое для мира и добра.</p>', '1547622614.jpg', 1, '2018-11-12 14:17:20', '2020-02-01 13:49:11');
INSERT INTO `cities` (`id`, `url`, `s_title`, `s_description`, `s_keywords`, `name_ru`, `announce`, `name_kz`, `description`, `image`, `active`, `created_at`, `updated_at`) VALUES
(17, 'petropavlovsk', NULL, NULL, NULL, 'Петропавловск', 'ДОБРО ПОЖАЛОВАТЬ В ПЕТРОПАВЛОВСК', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 218,031</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 7,530</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Петропавловск вырос на реке Ишим на месте фортификационных построек &mdash; крепости св. Петра. Инициировала ее строительство императрица Елизавета, которая была обеспокоена открытостью южных границ империи. Со временем вокруг крепости возникло поселение, которое к началу XIX века стало крупнейшим купеческим торговым городом в Омской губернии. Здесь сходилось множество торговых путей из России в Азию.&nbsp;</p>\r\n\r\n<p>Если отправляетесь в Казахстан, то Петропавловск &mdash; один из городов, которые обязательно следует посетить. Здесь красивая природа, интересные центры отдыха и развлечения, памятники, которые многое поведают о культуре и ценностях людей, которые жили и живут на этой территории.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/86.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Достопримечательностью Петропавловска является обсерватория. В оснащение главной астрофизической обсерватории входит телескоп системы Ричи-Кретьена с диаметром зеркала 0,77 метра. Купол планетария, придающий неповторимый облик всему комплексу учебных корпусов Северо-Казахстанского государственного университета им. М. Козыбаева, оборудован проекционной аппаратурой фирмы Leariving Technologies, США.&nbsp;Это второй по величине телескоп в республике, позволяющий решить современные научные задачи. В состав центра входит планетарий, расположенный в одном здании с обсерваторией. Проектор планетария позволяет получить качественное цветное изображение более 3000 звёзд каждого полушария небесной сферы. Причём возможна демонстрация звёздного неба в любой точке Земли и в любое время года и суток.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/87.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музейный комплекс &laquo;Резиденция Абылай-хана&raquo;, расположенный в центральной части Петропавловска, является одной из культурных достопримечательностей города. Музей посвящен выдающемуся государственному деятелю в истории казахской государственности - Абылай-хану (настоящее имя Абильмансур). По просьбе хана и с разрешения царского правительства, для его пребывания в окрестностях крепости Святого Петра, в 1765 г. в горах Янгистау, вверх по реке Ишим, был возведен деревянный дом, в котором располагалась ханская резиденция. Именно здесь проводились все важные переговоры и решались государственные вопросы между Российской империей и Казахским ханством.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/88.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одним из прекраснейших образцов современной скульптуры города Петропавловска является памятник, посвященный казахскому поэту, философу, композитору, просветителю и общественному деятелю Абаю Кунанбаеву и русскому поэту, драматургу и прозаику А.С. Пушкину. Памятник в центре Петропавловска был установлен в декабре 2006 г. в честь завершения Года Пушкина в Казахстане и Года Абая в России. Абай Кунанбаев и Александр Пушкин жили и творили в разные периоды времени, однако у них есть очень много общего.&nbsp;Это были два народных поэта, гуманиста, мечтавших о просвещении. Абай и Пушкин были родственные духом люди. Казахский поэт настолько уважал и любил творчество Пушкина, что перевел на свой родной язык множество его произведений. Из уст в уста передавались такие произведения, как: &laquo;Слово Онегина&raquo;, &laquo;Письмо Татьяны&raquo; и &laquo;Из монолога Ленского&raquo;. Памятник Абаю и Пушкину в Петропавловске является ярким символом вековой дружбы казахского и русского народов.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/89.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Областной музей изобразительных искусств в городе Петропавловске был открыт в 1989 г. Музей располагается в здании, которое в 1982 г. получило статус памятника истории и культуры Республики Казахстан. Музей был открыт на базе отдела изобразительного искусства местного историко-краеведческого музея. На сегодняшний день на площади 394 кв.м. взорам посетителей представлено более 5 тыс. экспонатов. Основную часть музейной коллекции занимает раздел графики, представленный творчеством таких известных художников как: В. Фаворский, Г. Поплавски, Р. Хачатрян, Кукрыниксы и других.&nbsp;Фонды декоративно-прикладного искусства состоят из коллекций казахских, русских, украинских художников прикладного искусства: предметы этнографии и керамики, уральские самовары, подносы, значки.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/90.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Северо-Казахстанский областной историко-краеведческий музей был открыт в 1924 году&nbsp;в здании-памятнике архитектуры конца ХІХ века. Экспозиция построена с учетом общеисторической иерархии, начиная с древнейших времен до современности. Значительное место занимает экспозиция, отражающая развитие Казахстана в годы независимости. Она включает в себя три зала: &quot;Казахстан в годы независимости&quot;, &quot;Северо-Казахстанская область в годы независимости&quot;, &quot;Казахстанско-Российские отношения&quot;. Посетители музея смогут познакомиться с материалами археологических исследований Северного Казахстана, с уникальными экспонатами по древнейшей истории края.</p>', '1542097060.jpg', 1, '2018-11-12 14:17:40', '2020-02-01 13:47:46'),
(18, 'rudnyy', NULL, NULL, NULL, 'Рудный', 'ДОБРО ПОЖАЛОВАТЬ В РУДНЫЙ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 114,725</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 1,567</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Город Рудный &ndash; детище Советского Союза. В 1955 году согласно постановлению Слета Министров СССР в Казахстане на базе Соколовского и Сарбайского месторождений магнетитовых руд началось строительство горно-обогатительного комбината. Для возведения самого мощного в СССР предприятия со всех концов страны по комсомольским путевкам приехали энтузиасты. Первоначально Рудному присвоили статус поселка. А в 1957 году он стал городом областного подчинения.</p>\r\n\r\n<p>Теперь это большой промышленный и культурный центр. Население города в 2018 году составляло 114&nbsp;тысяч человек. Больше половины из них &ndash; русские, четверть &ndash; казахи, а остальные &ndash; народы разных национальностей: украинцы, немцы, татары, белорусы и др. Представительный орган &ndash; маслихат, который избирается населением и выражает его интересы.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/101.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Местоположение города Рудный характеризуется резко континентальным климатом, то есть с жарким летом и морозными зимами. Вследствие значительного удаления от океанов, здесь также преобладает сухой воздух. Природа Рудного своеобразна. Глаз радует разнообразие горных пейзажей. Весной множество цветущих деревьев восхищает своим видом. Рудный находится в 50 км от областного центра Костаная, с которым соединяет железная и автомобильная дороги.&nbsp;Транспортная сеть отлично развита. Город имеет сообщение более чем с 10 городами, среди которых &ndash; крупные центры России.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/102.jpg\" style=\"float:left; height:194px; width:290px\" />Город находится на правом берегу реки Тобол, которая берет свое начало в Оренбургской области и несет воды в Иртыш. Выше Рудного на водном потоке построено Каратомарское водохранилище, которое обеспечивает водой город и сельскохозяйственные фермы. Водохранилище также было создано в советский период, в 1966 году. Оно имеет большую протяженность и относительно небольшую глубину, наполняется преимущественно в весенние месяцы. Здесь развито рыболовство. За год в Каратомарском водохранилище вылавливают около 50 тонн рыбы.&nbsp;Вся Костанайская область и г. Рудный расположены в степной и лесостепной зоне. Здесь много озер. Во время сезонных миграций на степные водоемы для гнездовья прилетает большое количество водоплавающих птиц.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/103-1.jpg\" style=\"float:left; height:194px; width:290px\" />Город рудодобытчиков полностью зависит от работы своего градообразующего предприятия &ndash; АО &laquo;ССГПО&raquo;. Облик города и окрестностей формируют два огромных карьера &ndash; Сарбайский и Соколовский карьеры, а также система накопительных озёр для работы предприятий. Акционерное Общество Соколовско-Сарбайское обогатительное объединение &ndash; крупнейшее предприятие постсоветских стран по производству железорудного сырья, лидер горнодобывающей промышленности.&nbsp;Сегодня промышленные предприятия Рудного производят более сорока видов продукции. Индустрия города представлена 26 крупными и средними предприятиями.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/104.jpg\" style=\"float:left; height:194px; width:290px\" />Исторической достопримечательностью города является Алексеевский культурный комплекс, в состав которого входят поселение, могильник и жертвенный холм, сохранившиеся с III тысячелетия до нашей эры и открытые в 1921 году. Найденные на территории поселения орудия труда и оружие соответствуют бронзовому веку. В пределах этого региона происходил весь процесс обработки металла. Найденные предметы изготовлены разными способами: выплавкой, литьем, ковкой и тиснением.&nbsp;Город насчитывает один дворец спорта, два стадиона, три плавательных бассейна, множество спортивных залов. Хоккейная команда города &ndash; &quot;Горняк&quot; &ndash; участвует в чемпионате Казахстана по хоккею с шайбой.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/105.jpg\" style=\"float:left; height:194px; width:290px\" />Рудный имеет большое значение для государства. Он также часто посещается туристами. Город имеет сильное влияние на некоторые сферы экономики. Ежегодные наплывы туристов в данную область приносят огромную прибыль в государственный бюджет. Это связано с большим количеством достопримечательностей, различных культурных зон, где можно отдохнуть и отлично провести время. Город Рудный посетить необходимо обязательно.&nbsp;Яркие и приятные эмоции от посещения останутся надолго.</p>', '1542097075.jpg', 1, '2018-11-12 14:17:55', '2020-02-01 13:46:40'),
(19, 'semey', NULL, NULL, NULL, 'Семей', 'ДОБРО ПОЖАЛОВАТЬ В СЕМЕЙ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население:&nbsp;349,302</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 15,267</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 4</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Самым крупным городом Восточного Казахстана является Семей (Семипалатинск), основанный как крепость в 1718 году, о чем свидетельствуют развалины крепостной стены. Но место для крепости было выбрано неудачно из-за постоянного разлива Иртыша в этом месте. Поэтому в 1778 году крепость переносят вверх по течению реки на 18 километров, где сходились караванные пути из Средней Азии и Монголии в Россию. Сохранились крепостные ворота, напоминающие нам о том времени.&nbsp;</p>\r\n\r\n<p>Неизведанность данного района Азии привлекал к нему многих известных путешественников, таких как Семёнов Тян-Шанский, Чокан Валиханов и многих других. В Семипалатинске подолгу жил великий мыслитель и поэт Абай Кунанбаев. Сейчас в его доме открыт литературно-мемориальный музей. &nbsp;В июне 2007 года Указом президента Казахстана город Семипалатинск был переименован в Семей.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/51.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Ямышевские ворота были когда-то частью большой Семипалатинской крепости, которую возвели в 1718 году на правом берегу реки по приказу самого Петра I. Ворот у крепости когда-то было больше: эти самые Ямышевские, смотрящие в сторону Омска, Усть-Каменогорские, обращенные на восток и Семипалатинские &ndash; прибрежные ворота. Но уцелели только одни. К сожалению, Ямышевкие ворота, которые мы можем лицезреть ныне, не являются тем подлинником, когда-то открывавшим один из входов в крепость.&nbsp;Это макет, точная копия тех крепостных ворот. В 1970 году в этом районе города велась прокладка туннеля, а Ямышевские ворота стояли как раз на его пути. В связи с чем вынесли решение разобрать ворота, чтобы перенести их в сторону на 50 метров и снова собрать. Благодаря умелой работе мастеров ворота не потеряли свой исторический облик, но, все же, фактически не являются подлинником.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/52.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музей изобразительных искусств имени семьи Невзоровых - Музей носит имя Невзоровых потому, как эта семья в 1988 году преподнесла музею в дар свою богатую коллекцию изобразительного искусства. &nbsp;Данную коллекцию эта семья собирала в четырех поколениях. Музейный фонд насчитывает около пяти тысяч экспонатов, в числе которых произведения современных казахстанских художников, картины советских времен и полотна зарубежных авторов. Картины не раз выезжали на выставки не только по Казахстану, но и за рубеж. Сам именной музей находится в историческом здании &ndash; доме купца Степанова.&nbsp;Федор Степанов был одним из богатейших городских купцов Первой гильдии. Свой дом он возвел в 70-х годах XIX века. С 1985 года и по наши дни этот купеческий дом находится во владении этого именного музея.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/53.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Дом-музей в Семипалатинске был открыт в 1940 г. История этого двухэтажного особняка такова. Известно, что Абай, помимо напряженной творческой работы, занимался общественными делами, просветительством и благотворительностью. Он следил за тем, чтобы дети его близких стремились к знаниям, учились в городе и всячески помогал им. Анияр Молдабайулы &ndash; один из тех, кому помог Абай. По настоянию Абая Анияр учился в России и, получив свидетельство адвоката, вернулся на родину, в Семипалатинск.&nbsp;Построенный в последней четверти прошлого века двухэтажный особняк, в котором проживал Анияр Молдабайулы, сохранился до наших дней. В нем, приезжая в Семипалатинск, часто останавливался великий поэт. Известный в городе особняк имел все основания стать мемориальным музеем Абая. Не случайно в 1940 году выбор в качестве объекта для создания музея остановился на этом доме.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/54.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Двухминаретная соборная мечеть &ndash; один из самых красивых архитектурных памятников республиканского значения города Семей. Возведенная в 1856-1862 гг. мечеть является ярким образцом культовой мусульманской архитектуры ХІХ ст. Согласно историческим данным, строительство храма началось в 1858 г. и закончилось в 1862 г. Двухминаретная мечеть возводилась по заказу областного духовного управления на средства, пожертвованные семипалатинскими купцами: Сулейменовым, Абдешевым, Рафиковым и Халитовым.&nbsp;Авторами данного проекта выступили - областной архитектор Болботов и инженер-поручик Манашев. В 1897 г. был произведен капитальный ремонт мечети, во время которого старые деревянные минареты заменили кирпичными.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/55.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Монумент &laquo;Сильнее смерти&raquo; на острове Полковничий в Семее производит неизгладимое впечатление. Творение архитектора Шот-Амана Валиханова вызывает пронзительные чувства &ndash; на секунду вы словно погружаетесь в пекло ядерного ада, пылавшее в этих местах. Мемориал в память о жертвах ядерных испытаний был установлен здесь в августе 2001-го. Творческие замыслы архитектора Валиханова помогли воплотить инженеры и конструкторы проектной академии KAZGOR. Этот мемориальный комплекс &ndash; действительно необычный, он совершенно не похож на другие&nbsp;сооружения.&nbsp;Главным элементом комплекса является 25-метровая, с закруглением наверху, стела на плоскости, где выбит силуэт &laquo;атомного гриба&raquo;.</p>', '1542097087.jpg', 1, '2018-11-12 14:18:07', '2020-02-01 13:45:06'),
(20, 'taldykorgan', NULL, NULL, NULL, 'Талдыкорган', 'ДОБРО ПОЖАЛОВАТЬ В ТАЛДЫКОРГАН', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 137,654</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 4,745</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 2</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Талдыкорган расположен в Алматинской области и имеет статус областного центра. Город находится в центре Семиречья на реке Каратал в предгорьях Джунгарского Алатау, на высоте свыше 602 метров над уровнем моря. &laquo;Талдыкорган&raquo; переводится как &laquo;холм, окружённый ивами&raquo;. Сколько на самом деле лет Талдыкоргану &mdash; историки ответить затрудняются. Но в окрестностях города археологами найдены более ста поселений и могильников эпохи бронзы, а это 3000 лет до нашей эры.</p>\r\n\r\n<p>Раньше Талдыкорган был хутором, обитателями которого были переселенцы из России и Украины, и представлял собой улицу вдоль реки Каратал. Позже хутор разросся, и в 1868 году стал станицей Гавриловкой. По одной из версий, станица получила название от имени чиновника, который раздавал земли переселенцам, а по другой &mdash; от имени купцов Гавриловых, торговавших водкой.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/56.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Здание Дворца спорта &laquo;Жастар&raquo;, вмещающее полторы тысячи зрителей, предназначено для проведения различных крупных соревнований и выступлений как республиканского, так и международного масштаба, а также общефизической атлетической подготовки спортсменов. Дворец спорта предназначен для проведения различных соревнований и выступлений как республиканского, так и международного масштаба, а также общефизической атлетической подготовки спортсменов, занятий групп здоровья, с оказанием квалификационных услуг по оздоровлению населения города.&nbsp;С этой целью в здании предусмотрены всевозможные виды тренажеров &mdash; для силовых упражнений, для занятий аэробикой и кардиоваскулярных тренировок. Здесь же имеется универсальный зал со спортивной ареной для футзала и ареной для баскетбола, зал для спортивных бальных танцев. Дворец располагает спортивными залами для занятий самбо, дзюдо, таэквондо, бокса, вольной и классической борьбой и даже собственным музеем.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/57.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Центральный парк культуры и отдыха является одной из самых популярных достопримечательностей солнечного города Талдыкорган. Здесь в любое время суток довольно многолюдно. У главного входа стоит небольшая арка белого цвета. На территории и рядом с ней вы сможете найти большое количество кафе и ресторанов, где готовят блюда национальной кухни и подают прохладительные напитки. Также здесь располагаются аттракцион, правда некоторые ещё со времен СССР, но все же в рабочем состоянии.&nbsp;Прокатившись на колесе обозрения, у вас будет возможность оценить панорамный вид всего города. В ближайшее время местные власти обещают сделать капитальную реконструкцию во всем парке.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/58.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Музей им. М. Тынышбаева Алматинской области показывает посетителям археологические находки древнего Жетысу и рассказывает историю Жетысуского края. Музей им. Мухамеджана Тынышпаева Алматинской области открылся 1 марта 1974 году и находится в городе Талдыкорган. Полное название музей получил в 1993 году, и стал называться &laquo;Алматинский областной историко-краеведческий музей им. М. Тынышпаева&raquo;. Музей им. М. Тынышбаева располагает 27454 экспонатами, среди которых археологические находки древнего Жетысу, древние музыкальные инструменты,&nbsp;различная посуда, бронзовые котлы, глиняные сосуды, а также различные рукописи известных летописцев, живших в городе Жетысу и многое другое. Здесь можно увидеть экспозицию, в которой отображена местная флора и фауна и можно найти карты расположения местных заповедников и охотничьих хозяйств.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/59.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />В самом центре Талдыкоргана возвышается величественный монумент, воздвигнутый в 2006 году благодарными потомками в честь своих великих предков. Памятник носит название &laquo;Уш ата&raquo;: скульптурная композиция изображает трех известных исторических личностей &ndash; Ескельды-би, Балпык-би и Кабылиса-жырау, живших на рубеже XVII-XVIII веков и внесших значительный вклад в разгром джунгарских полчищ. Еще при жизни о них слагали легенды, а авторитет трех верных соратников &ndash; двух храбрых батыров, прозорливых политиков, мудрых судей и поэта-острослова, защитника народа &ndash; был непререкаем на просторах Великой Степи.&nbsp;О военных подвигах, мудрости и поэтическом даре Ескельды-би, Балпык-би и Кабылиса-жырау поэтами и исследователями прошлого и настоящего написано немало &ndash; стихотворения, поэмы, кюи, трактаты, монографии. Глубоко символично само расположение памятника &ndash; взоры трех старцев устремлены на восток, они словно пронзают взглядом время на много веков вперед и видят зарю суверенного Казахстана.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/60.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Обелиск Славы установлен в центральном парке культуры и отдыха в память о воинах Талдыкоргана и солдатам, погибшим в Афганистане. Монумент представляет собой стеллу, вобравшую в себя множество серебристых нитей. У подножия монумента установлен Вечный огонь, напоминающий о героях Великой Отечественной войны, многим из которых не суждено было вернуться в родной город. Вечный огонь, обелиск Славы и вся прилегающая к ним территория находятся под особым контролем.</p>', '1542097104.jpg', 1, '2018-11-12 14:18:24', '2020-02-01 13:44:00'),
(21, 'taraz', NULL, NULL, NULL, 'Тараз', 'ДОБРО ПОЖАЛОВАТЬ В ТАРАЗ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 355,682</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 22,665</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Город Тараз в 2002 г. отметил свой двухтысячелетний юбилей - это один из древнейших городов Казахстана. С древних времен Тараз был известен как &quot;город купцов&quot;. В письменных источниках Тараз известен с VI в. В 568 г. в город, находившийся под властью тюркского кагана Дизабула-Истими, прибыло посольство византийского императора Юстиниана II во главе с послом Земархом Киликийским. Уже в первые десятилетия VII в. Тараз играет важную роль узлового центра на Великом Шелковом пути.&nbsp;</p>\r\n\r\n<p>С этого времени он становится широко известным городом Востока. Сведения о нем содержат маршрутники, древние хроники и географические сочинения. Тараз был центром Тюргешского, а затем Карлукского каганатов. В IX-X вв. происходит дальнейший рост Тараза.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/61.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />В конце X-XI вв. после завоевания Средней Азии династией Караханидов Тараз становится столицей одного из уделов нового государства. В городе чеканится монета, строятся великолепные архитектурные ансамбли. Мавзолеи Карахана и Давудбека, замки правителей и множество древних могильников позволят путешественнику мысленно окунуться в далекие столетия. Недалеко от современного Тараза, в 15 км восточнее, сохранились шедевры древней архитектуры, включенные ЮНЕСКО в список всемирных раритетов зодчества: мавзолеи Бабаджи-Хатун и Айша-Биби.&nbsp;Согласно легенде, мавзолей Айша-Биби был воздвигнут одним из правителей династии Караханидов над могилой его прекрасной невесты Айша-Биби, дочери суфийского поэта Хаким-Ата. Согласно народным преданиям, коварная змея оборвала жизнь юного создания на пути к возлюбленному. Строение полностью облицовано резными терракотовыми плитками с растительным и геометрическим узором. Сам мавзолей выглядит невероятно легким и изящным.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/62.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />А вот находящийся в 40 километрах от Тараза город Акыртас интересен совсем другим. Центром его является большой, на трех квадратных километрах, дворец. Он имеет необычную планировку и выстроен из камня, что для этих мест нехарактерно. Во всем Южном Казахстане это, пожалуй, единственная монументальная, из больших каменных блоков выполненная постройка. С XIX века известнейшие ученые нашего времени пытались пролить свет на историю этого уникального памятника архитектуры.&nbsp;Сомнение вызывало все: время строительства, назначение сооружения и даже его название. Зодчие тех далеких веков виртуозно проводили точные математические расчеты, в совершенстве владели техникой обработки камня и возведения сложных архитектурных сооружений. Грандиозность замысла и мастерство возведения Акыртаса позволяет соотнести этот загадочный объект с египетскими пирамидами и другими известными сооружениями античных времен.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/63.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Впервые селение Мерке, расположенное у подножия Киргизского Алатау, упоминается в сочинениях арабских географов в IX-X веках. Тогда оно носило название &laquo;Мирки&raquo;, считалось городом средней величины, было хорошо укрепленным и имело цитадель. По версии современных ученых, город образовался в VII веке, его название с языка фарси означало &laquo;центр&raquo;. Курганы - погребальные сооружения, совместно с ритуальными храмами со статуями предков расположены в красивейших горных местах меркенского ландшафта.&nbsp;Сегодня здесь, в меркенских горах, можно увидеть находящиеся повсюду стелы, их насчитывается более 80-ти. Они расположены поодиночке внутри ограды или группами в центре курганов, за их пределами и за оградами. Можно сказать, что в этом месте представлены все этапы истории тюрков. Сохранились также петроглифы на скалах и каменных изваяниях в горных ущельях Мерке. Большинство из них имеют женское лицо. В тюркском искусстве это редкий случай.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/64.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мавзолей Карахана - памятник архитектуры, расположенный в центральной части города Тараз, на пересечении двух улиц - Байзак батыра и Толе би. Мавзолей является частью культово-мемориального комплекса, сформированного на территории средневекового городища. Архитектурное сооружение было построено в ХІ ст. над могилой одного из самых первых ханов династии Караханидов. Согласно народным преданиям, строительство мавзолея связано с человеком, который возвел мавзолеи Бабджа-Хатун и Айша-Биби. Караханидов, местных правителей Х-XII ст.&nbsp;В 1982 г. мавзолей Карахана пополнил список исторических и культурных памятников Казахской ССР республиканского значения. В 2002 г., накануне 2000-летнего юбилея города Тараз, была проведена последняя реставрация мавзолея.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/65.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" /></p>\r\n\r\n<p>Мавзолей Тектурмас&nbsp;является памятником архитектуры и градостроительства, датируется X &ndash; XIV веками. Располагается на юго-восточной окраине города&nbsp;Тараз, на правом берегу реки Талас, на вершине горы Тектурмас. Среди местных жителей мавзолей был известен как Тектурмас и считался местом погребения святого Султан-Махмуд-хана. Архитектурный комплекс Тектурмас &mdash; одно из древнейших культовых мест. Комплекс начал формироваться еще в VII &ndash; XІ в.в., до проникновения ислама. Мавзолей, построенный в период ислама, в 1935 году был разрушен. В настоящее время на его месте по средневековому типу восстановлен новый мавзолей. Архитектурный комплекс является также местом паломничества.</p>', '1542097119.jpg', 1, '2018-11-12 14:18:39', '2020-02-01 13:43:10'),
(22, 'temirtau', NULL, NULL, NULL, 'Темиртау', 'ДОБРО ПОЖАЛОВАТЬ В ТЕМИРТАУ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 162,390</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 7,465</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Темиртау &ndash; крупнейший город-спутник города Караганды, который расположен на левобережье реки Нура, в 35 км к северо-западу от г. Караганда. Город был образован 1 октября 1945 года на базе бывшего поселка Самаркандский, который был переименован в Темиртау, что в переводе означает &laquo;Железная гора&raquo;, потому что здесь получил путевку в жизнь Казахский металлургический завод, который в народе именуется Казахстанской магниткой.&nbsp;</p>\r\n\r\n<p>Строительство города и его промышленных объектов связано с периодом освоения Карагандинского угольного бассейна. Темиртау является крупным индустриальным центром с развитой инфраструктурой. В городе действует 1201 предприятий.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/110.jpg\" style=\"float:left; height:194px; width:290px\" />Темиртауский городской историко-краеведческий музей один из инновационных музеев Карагандинской области. Музей был открыт 6 ноября 1973 года. В фондах музея хранятся редкие этнографические, археологические, нумизматические и документальные свидетельства, раскрывающие историю страны и города Темиртау. На сегодняшний день в музее действуют десять стационарных залов: Зал &laquo;Темиртау в годы Независимости РК&raquo;, зал &laquo;История города&raquo;, зал &laquo;Память&raquo;, зал &laquo;Единства народа Казахстана&raquo;, зал &laquo;Археология&raquo;, зал &laquo;Палеонтология&raquo;, зал &laquo;Природа родного края&raquo;, зал &laquo;Нумизматика&raquo;, выставочный зал и зал для сменных экспозиций.&nbsp;Общая площадь музея составляет 1098 кв.м., экспозиционная &mdash; 858,3 кв.м. Основой современной работы музея является интерактивность &ndash; посетителям предоставляется возможность изучить историю города, страны, стать их частью через непосредственную самостоятельную работу с экспонатами.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/111.jpg\" style=\"float:left; height:194px; width:290px\" />Основан в 1989 году на базе здания Немецкого драматического театра, после переезда театра в город Алматы. Ранее в этом здании располагался дворец культуры Металлургов города Темиртау, Академический театр музыкальной комедии до переезда его в город Караганда, Немецкий драматический театр и с 1989 года Темиртауский театр для детей и юношества. Целью открытия театра было сохранение театральной культуры г. Темиртау, создание театра полностью ориентированного на юного зрителя в Карагандинской области.&nbsp;Первый театральный сезон был открыт 24 ноября 1990 года спектаклем &laquo;Чемодан чепухи&raquo; по пьесе О. Петрушевской. За первый театральный сезон были поставлены следующие спектакли: &laquo;Чемодан чепухи&raquo;, &laquo;Ай, да братец кролик&raquo;, &laquo;Без вины виноватые&raquo;, &laquo;Птица горлица&raquo;.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/112.jpg\" style=\"float:left; height:194px; width:290px\" />Парк культуры и отдыха &laquo;Восток&raquo; открылся в Темиртау в 1979 году. Парки &mdash; это выполняющая важную функцию часть практически каждого населенного пункта: они радуют глаз, создают приятную для жизни среду. Одним из таких мест в Караганде является городской парк культуры и отдыха. Здесь желающие могут неспешно провести часок-другой в одиночестве или в компании. Парк создан как органическая часть облика района и в качестве общественного пространства способен вносить значительное разнообразие в досуг его жителей. В городской парк культуры и отдыха вы можете также посетить аттракционы &mdash; беспроигрышный вариант для семейного выходного.&nbsp;Для детей это гарантированное море эмоций, да и их родителям приятно время от времени пощекотать нервы и вспомнить детские впечатления от походов в парк. Недаром аттракционы &mdash; это не теряющая актуальности классика мира развлечений.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/113-1.jpg\" style=\"float:left; height:194px; width:290px\" />Памятник металлургам в Темиртау был торжественно открыт к десятилетию Независимости Республики Казахстан и был посвящен героическому труду металлургов. Проект памятника создал известный казахстанский скульптор А.П. Билык, который создал живописную композицию из бронзы и нержавеющей стали, ставшую еще одним украшением города и его яркой достопримечательностью. Город Темиртау имеет развитую транспортную инфраструктуру.&nbsp;В городе работает несколько предприятий, обслуживающих около тридцати автобусных маршрутов, охватывающих весь город. В городе распространено маршрутное такси, обычное пассажирское такси представлено многочисленными фирмами.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/114.jpg\" style=\"float:left; height:194px; width:290px\" />Зимний сад в Темиртау. Здесь собрано более 100 видов растений, родина которых &mdash; тропические, субтропические и пустынные регионы планеты. Подобные оранжереи имеются в других городах Казахстана, но предназначены они для научных целей. А темиртауский сад круглый год открыт для посетителей. По словам работников Зимнего сада, проектное исполнение является уникальным и сложным. Высотное здание арочного типа снизу доверху покрыто витражами. Однако проектная документация не сохранилась. В Зимнем саду есть зооуголок. Посетители могут наблюдать за павлинами, кроликами, ежами и другими животными.</p>', '1542097133.jpg', 1, '2018-11-12 14:18:53', '2020-02-01 13:41:21'),
(23, 'turkestan', NULL, NULL, NULL, 'Туркестан', 'ДОБРО ПОЖАЛОВАТЬ В ТУРКЕСТАН', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 157,399</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 9,723</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Жемчужина Великого Шелкового пути &ndash; город Туркестан &ndash; один из древнейших городов не только Казахстана, но и Центральной Азии. Возникший в 490 году, он достиг своего расцвета в XII веке. Окруженный мощными крепостными стенами, Туркестан был административным центром среднеазиатских владетелей из династий хорезмшахов, монголов, тимуридов, шейбанидов. В XVI - XVIII века вв. он был столицей Казахского ханства, располагаясь на стыке кочевой и оседлой культур, на пересечении торговых &nbsp;путей. В этом городе проходили величественные церемонии вступления на престол ханов, с участием представителей других государств. Слава города простиралась по всему миру.</p>\r\n\r\n<p>В немалой степени этому способствовало имя Ходжи Ахмеда Яссави - дервиша, проповедника суфизма, поэта, жившего в этом городе. Над скромной усыпальницей святого, ставшей местом паломничества, трехкратное посещение которой приравнивалось к хаджу в Мекку, по приказу Амира Тимура (спустя 233 года) был воздвигнут величественный мавзолей. Так, Туркестан заслужил славу мусульманской святыни.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/66.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мавзолей Ходжи Ахмеда Яссави - непревзойденный шедевр средневекового зодчества. Это удивительный комплекс дворцов и храмов из 30 различных комнат и залов. Внешний диаметр главного купола - более 40 м, окружность - 130 м, высота минаретов - 12 м. Поражают впечатление элегантность декора, узорные своды потолков, цветная мозаика. Памятник восстановлен в своем первозданном виде и охраняется государством. Каждый может полюбоваться жемчужиной Средневекового Востока в городе Туркестан.&nbsp;По народному поверью, дорога в Туркестан обязательно должна лежать через мавзолей Арыстан-Баб, возведенный над могилой учителя Ахмеда Яссави. По преданию этот старец был соратником пророка Мохаммеда и прожил 500 лет для того, чтобы передать знания и мудрость пророка Ходжа Ахмеду Яссави. С XVI века Ясы получает свое современное название &ndash; Туркестан. Десятки древних городов, поселений и религиозных сооружений украшают окрестности Туркестана, и каждый памятник по-своему неповторим.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/67.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Еще один важный исламский мавзолей в Туркестане &ndash; место упокоения святого Арыстан-бабы, в некотором роде &quot;предшественника&quot; Ясави. Легенда гласит, что сам пророк Мухаммед передал свои четки Арыстан-бабе, а тот, в свою очередь, подарил их юному Ясави. Помимо усыпальницы этого святого здесь можно увидеть изумительный образец Корана &ndash; он выставлен под стеклом. По легенде, когда Тамерлан начал строить мавзолей Ходжи Ахмеда Ясави, конструкция несколько раз мистическим образом разрушалась.&nbsp;После чего Тамерлану приснился сон, в котором было дано повеление сперва построить мавзолей для Арыстан-бабы, а уж затем заботиться о памяти Ясави. Так он и сделал &ndash; и по этой же причине паломники посещают мавзолеи именно в таком порядке.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/68.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мавзолей Укаша-Ата &ndash; легендарный воин, великан, телохранитель, ученик пророка Мухаммеда. По легенде Укаша Ата был ростом 12м. Жил во времена пророка и был благословлен им. Там сохранились и объекты, доказательства существования воина. В сражениях могучего воина не брали ни стрелы, ни сабля. Укаша-Ата был убит врагами во время совершения утренней молитвы. Отрубленная голова воина покатилась и упала в близлежащий Колодец. Легенда гласит, что голова великана похоронена у ног пророка.&nbsp;Посещение колодца Укаша-Ата. Колодец с секретом. В ней на глубине 10 метров находится вода, вы ее видите, бросаете ведро, но, чтобы зачерпнуть воды удается не всем. Одним колодец дает воду, другим нет. Хорошо если, вытащив ведро, вы обнаружите в ней немного воды, счастливчикам удается вытащить полведра или даже целое ведро, прихватив камушки со дна. Почему такая избирательность? Считается, что Колодец дает воду людям с добрым сердцем, с добрыми намерениями, тем, кому благоволят духи. И вода в колодце обладает целебными свойствами.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/69.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />В окрестностях Туркестана также немало природных и исторических достопримечательностей, которые определенно заслуживают внимания. Любителей природы приглашают посетить отрарский оазис - это исторический и культурный заповедник Казахстана, расположенный в 60 км от Туркестана. Здесь в течение нескольких лет, начиная с 1969 года, проводились комплексные широкомасштабные археологические раскопки, в результате которых были открыты самые интересные археологические памятники IX-XII веков, связанные с эпохой караханидов, когда на Великом Шелковом Пути процветал&nbsp;известный город Отрар, также называемый Фараб, Параб, Тарбанд, Утрар. Собран богатый материал о культуре населения Казахстана, жившего на трассе Шелкового пути. В настоящее время на территории Отрарского оазиса продолжаются работы по внедрению государственного проекта &laquo;Культурное наследие&raquo;, который направлен на создание инфраструктуры для культурного туризма на основе восприятия уникальных памятников Отрара как национальных символов.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/70.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Также можно посетить природный заповедник Каратау, расположенный в центральной части одноименного хребта, где обитают 15 видов животных, занесенных в Красную книгу. Территория заповедника отведена в пределах Туркестанского района Южно - Казахстанской области и составляет 34 300 гектар. Сырдарьинский Каратау давно известен как один из самых интересных и уникальных районов Казахстана, в связи со своеобразием его растительного покрова.<strong><em>&nbsp;</em></strong>Хребет является северным форпостом распространения древне - средиземноморских ландшафтов и обладает своеобразным набором естественных экосистем с особыми компонентами их флористико - фаунистического состава и ценотического разнообразия.</p>', '1542097149.jpg', 1, '2018-11-12 14:19:09', '2020-02-01 13:39:18'),
(24, 'shimkent', '1', '2', '3', 'Шымкент', 'ДОБРО ПОЖАЛОВАТЬ В ШЫМКЕНТ', NULL, '<table align=\"center\" border=\"2\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:710px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Население: 1,009,086</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">Студенты: 84,813</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:740px\">ВУЗы: 10</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Шымкент - древний город. Учёные считают, что городу не меньше 800 лет. Впервые название города приводит историк XV в. Шараф ад-Дин Йезди в событиях второй половины XIV в. В 1366 г. здесь проходило войско Тимура. Сейчас Шымкент &ndash; современный красивый город, в котором проживает около миллиона человек. В городе есть театры, рестораны, сеть комфортабельных гостиниц, технопарк &laquo;Мир фантазий&raquo;, аквапарк, где гостей и туристов города примут с особым восточным гостеприимством.&nbsp;</p>\r\n\r\n<p>Здесь ведутся работы с перспективой превратить древнее городище в центре современного города в историко-культурный парк. Природа Южного Казахстана располагает к отдыху и оздоровлению организма. На территории области есть источники минеральных вод, термальные источники. Целебный климат этих мест полезен для людей, страдающих кардиологическими заболеваниями.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/71.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Мавзолей Домалак Ана - Это архитектурный памятник ХІ века. Памятник расположен над могилой Нурилы Али Сыланкызы, в народе известной как Домалак Ана. Это младшая супруга Байдибек-Ата. Она славилась своим незаурядным умом и мудростью, является символ материнства и добра. Есть версия, что Домалак-Ана происходит от персидского &laquo;Дихнат мама&raquo; означающее Святая Мать. Впоследствии слово Дихнат изменилось в Домалак.&nbsp;Она прославилась в народе благодаря своему уму, мудрости, чистоте души и святости, когда только вышла замуж за Байдибек-Ата. И немало в народе распространено рассказов повествующих о ее находчивости, мудрости. Домалак-Ана своими мудрыми решениями примиряла, заглушала извечные обиды. Домалак-Ана является праматерью народов проживающих в Семиречье, Аулие-ата, Шымкент, Ташкент.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/72.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Главной достопримечательностью и богатством Шымкента и всего края Южно-Казахстанской области является старейший заповедник Казахстана Аксу-Джабаглы. Он первым в Центральной Азии получил статус биосферного заповедника ЮНЕСКО. Богатейшая сокровищница редких, исчезающих и эндемичных видов животных и растений. Здесь водятся архары и горные козлы, маралы и косули, рыси и снежные барсы, волки и лисы, медведи и дикобразы, каменные куницы и горностаи. Богат мир пернатых. Высоко в небе парят бородачи и грифы, белоголовые сипы и беркуты.&nbsp;На каменных склонах гнездятся кеклики, около вечных снегов можно встретить уларов. В тенистой сени лиственных лесов живым огоньком кажется оперение райской мухоловки. Звонкие звуки флейты напоминают пение синей птицы. Над солнечными полянами мелькают разноцветные бабочки-махаоны, редкие виды парусников, голубянок, желтушек.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/73.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Парк Независимости находится в городе Шымкент, в Южном Казахстане. Он был открыт в 2011 году в исторической части города, и является самым крупным и новым парком в городе. В церемонии открытия участвовал президент страны Нурсултан Назарбаев. Парк стал подарком городских властей горожанам на 20-тилетие независимости страны. В Парке Независимости можно увидеть уникальный поющий фонтан, созданный архитектором из Китая, многочисленные цветочные композиции, растения для которых были привезены из Голландии.&nbsp;В центре парка находится монумент, представляющий собой конструкцию из металлических элементов. Общая площадь Парка Независимости, входом в который является арка, составляет 82 тысячи квадратных метров. Парк бы построен при участии местных бизнесменов.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/74.jpg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Этнографический парк &quot;Кен-баба&quot; расположен недалеко от центре города. Это место является одним из наиболее популярных мест отдыха местных жителей. Общая площадь этнопарка &laquo;Кен-баба&raquo; составляет 3,5 га. Ранее здесь достаточно долгое время находился пионерский лагерь, однако со временем все изменилось. В ходе реконструкции парка строители не срубили ни единого живого дерева, все зеленые насаждения были сохранены. Для почитателей спортивного и здорового отдыха на территории парка находится несколько спортивных площадок для командных игр, а также открыт теннисный корт.&nbsp;Специально для детей была построена детская площадка, городок аттракционов и великолепный городок на песке &laquo;Сафари&raquo;. Особого внимания заслуживают зеленый городок &laquo;Дары юга&raquo;, который не оставит равнодушным ни одного посетителя этнопарка &laquo;Кен-Баба, и демонстрационный макет &laquo;Казахстан в миниатюре&raquo;.</p>\r\n\r\n<p><img alt=\"\" src=\"http://studypage.net/uploads/1/75.jpeg\" style=\"float:left; height:194px; margin-bottom:5px; margin-top:5px; width:290px\" />Одно из центральных мест туриста в Шымкенте обязан занимать дендропарк. Среди местных жителей он пользуется большей популярностью. Это дендрарий, устроенный для отдыха населения. Почти как ботанический сад, но с превалирующей парковой составляющей. Шымкентский дендропарк был открыт в 1979 году, на территории находится более 600 видов древесных и кустарниковых пород травянистых растений, представляющих флору самых различных географических зон мира.</p>', '1542097163.jpg', 1, '2018-11-12 14:19:23', '2020-02-01 13:35:22'),
