INSERT INTO `faqs` (`id`, `name`, `email`, `question`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, '1. Что я хочу изучать?', '<p>Некоторые люди всегда знают &laquo;что они хотят учить&raquo; и &laquo;какой именно предмет они хотели бы изучать&raquo;. Другие же вообще не имеют представления об этом. В таких ситуациях, необходимо задать себе нижеуказанные базовые вопросы, которые помогут Вам в поиске ответов на данные вопросы:</p>', NULL, NULL, '2020-01-06 12:07:37'),
(2, NULL, NULL, '2. От чего я действительно получаю удовольствие?', '<p>Этот вопрос Вы должны задать себе в первую очередь, перед тем как начать думать о будущей работе и каких-либо карьерных перспективах. В конце концов, ответ на вопрос &laquo;что действительно приносит Вам удовольствие&raquo; может повлиять на всю оставшуюся Вашу жизнь. Поэтому, Вы должны убедиться в том, что Вы изучаете &ndash; то, что действительно Вам нравиться.</p>', NULL, NULL, '2020-01-06 12:07:31'),
(3, NULL, NULL, '3. Что меня интересует?', '<p>Вас интересует много вещей? В этом случае, составьте перечень всех вещей, которые Вас интересуют. Затем попробуйте объединить несколько разных Ваших интересов. Например, если Вы заинтересованы в иностранных культурах, географии и политике &ndash; Вы можете с учетом данных интересов выбрать область, которая будет интересным для Вас.</p>', NULL, NULL, '2020-01-06 12:07:25'),
(4, NULL, NULL, '4. Какие у меня имеются таланты?', '<p>Иногда Ваши интересы могут не соответствовать Вашим особым талантам, и, наоборот. Например, если Вы заинтересованы в медицине, но у Вас мало склонности к предметам естествознания, Вам нужно тщательно подумать, действительно ли Вы хотите изучать медицину.</p>', NULL, NULL, '2020-01-06 12:07:19'),
(5, NULL, NULL, '5. В какой области я хочу учиться?', '<p>После того как Вы тщательно рассмотрите вышеуказанные вопросы, Вы должны попытаться найти общую область, в которой Вы хотели бы учиться. Еще лучше, если Вы выбрали несколько интересующих Вас областей для изучения, которые будут полезными Вам в будущем.</p>', NULL, NULL, '2020-01-06 12:07:09'),
(6, NULL, NULL, '6. Дальнейшие действия?', '<p><text-align:justify;>Теперь Вам нужно сделать следующий шаг, и решить какой именно конкретный предмет Вы хотите изучать. На данном этапе Вам наверняка понадобится помощь, и Вы захотите узнать сведения &laquo;о ВУЗах и имеющихся в нем специальностей&raquo;, и для этого Вам нужно использовать разные интернет платформы, чтобы найти хоть какую-то интересующую Вас информацию. Или же Вы можете воспользоваться сайтом studypage.net, чтобы получить всю необходимую информацию.</p>', NULL, NULL, '2020-01-07 07:28:32');
