INSERT INTO `navigator` (`id`, `s_title`, `s_description`, `s_keywords`, `name_ru`, `announce`, `name_kz`, `description`, `image`, `active`, `created_at`, `updated_at`) VALUES
(17, NULL, NULL, NULL, 'Калькулятор ЕНТ и можно ли ему верить при поступлении', 'Калькулятор ЕНТ и можно ли ему верить при поступлении', NULL, '<p>Принцип работы калькулятора ЕНТ очень прост. Абитуриент выбирает направление, на которое планирует поступать, и регион, где хочет учиться. Затем указывает свои баллы ЕНТ (реально полученные или те, которые ожидает получить). В ответ он получает список вузов выбранного региона, которые реализуют выбранные им направления подготовки. И по каждому вузу, на основе сравнения с данными приема за прошлый год, показывается, есть ли шанс с такими баллами ЕНТ поступить на бюджетное или платное место на это направление в этот вуз. Этот прогноз строится на основе сравнения указанных баллов ЕНТ со средним и проходным баллом на этот направление в этот вуз в прошлом году.</p>\r\n\r\n<p>Важно понимать, что калькулятор сопоставляет ваши баллы ЕНТ с итогами приемной кампании прошлого года и что в нынешнем году средние и проходные баллы в интересующем вас вузе могут стать несколько выше или несколько ниже. Калькулятор, конечно же, не гарантирует поступление (точно так же, как гарантируют поступление и проходные баллы, размещенные на сайтах вузов) или же, наоборот, не говорит однозначно о том, что абитуриент в данный вуз не поступит.</p>\r\n\r\n<p>Калькулятор ЕНТ &ndash; это ориентир для абитуриентов, систематизированная информация про все вузы, собранная в одном месте. При этом наши наблюдения позволяют заключить, что средние и проходные баллы ЕНТ из года в год существенно не меняются. Если в текущем году нет ощутимых изменений в контрольных цифрах приема или в составе экзаменов, то проходные баллы текущего года будут близки к баллам прошлого года. То есть прогнозная точность калькулятора довольно велика. Мы создали абсолютно открытый инструмент, который может быть использован любым абитуриентом.</p>\r\n\r\n<p>Результаты теста носят рекомендательный характер, служат ориентиром и не могут приниматься как 100% истина.</p>', NULL, 1, '2019-11-26 01:22:38', '2019-11-27 00:43:00'),
(20, NULL, NULL, NULL, 'Вещий, которые надо знать перед днем открытых дверей', 'Вещий, которые надо знать перед днем открытых дверей', NULL, '<ul>\r\n	<li><strong>Самостоятельно выбирайте вузы, не перекладывайте это на родителей</strong></li>\r\n</ul>\r\n\r\n<p>Часто мы видим печальную картину: на дне открытых дверей все вопросы задают родители, а их дети либо гуляют где-то неподалеку, либо вообще сидят дома. Но это тупиковый путь. Очень важно, чтобы вы сами заранее узнали о вузе все, что вас интересует, и потом сознательно сделали выбор. Иначе получится, что весь процесс поступления завязан на маме или папе, а вы по-прежнему играете роль ребенка, неспособного брать на себя ответственность. А ведь выбор места учебы &mdash; это главный шаг в будущее. Нужно быть активным, чтобы не остаться за бортом.</p>\r\n\r\n<ul>\r\n	<li><strong>Заранее узнайте проходной балл и число бюджетных мест</strong></li>\r\n</ul>\r\n\r\n<p>Дни открытых дверей чаще всего начинаются рано утром в воскресенье. Абитуриенты попадают в просторную аудиторию или зал со стендами, где представлены разные направления обучения. Можно подойти к нужному стенду и поговорить с преподавателями или студентами. Вещи, о которых спрашивают чаще всего, &mdash; это проходной балл, число бюджетных мест, стоимость обучения и наличие военной кафедры. Но странно, согласитесь, вставать в девять утра и куда-то ехать ради ответов на эти вопросы, если все они на самом деле есть на сайте. Обязательно ознакомьтесь с ним до того, как окажетесь в вузе, чтобы не тратить время зря.</p>\r\n\r\n<ul>\r\n	<li><strong>Решите, что вам нужно от университета</strong></li>\r\n</ul>\r\n\r\n<p>Выбирая вуз, вы выбираете для себя образ жизни как минимум на четыре ближайших года. Чтобы день открытых дверей действительно помог определиться с выбором, сначала стоит понять, чего вы ждете от студенчества вообще. Самое главное &mdash; это, конечно, получить специальность. Но есть еще и дополнительные факторы. Как со школой: не все ходят туда только для того, чтобы учиться. Там ведь есть еще и друзья, секции, внеклассные мероприятия.</p>\r\n\r\n<p>В университете подобных факторов может быть четыре:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Активная студенческая жизнь. Она важна для людей, которые стремятся к самореализации в разных сферах. В вузе можно участвовать в студенческих мероприятиях, организовывать их (в том числе, между прочим, и те же дни открытых дверей), ходить в спортивные секции, участвовать в соревнованиях.</p>\r\n	</li>\r\n	<li>\r\n	<p>Получение профессиональных навыков. Людям, которые ставят перед собой такую цель, важно не только получить знания, но и понять, как их применять. В этом случае нужно, чтобы у вуза были компании-партнеры, где можно пройти практику. Также стоит обратить внимание на то, кто читает лекции: только педагоги-теоретики или приглашенные специалисты из отрасли.</p>\r\n	</li>\r\n	<li>\r\n	<p>Карьерные связи. Студенты, которые хотят побыстрее построить карьеру, как правило, уже со 2-го курса начинают искать связи &mdash; то есть занимаются так называемым нетворкингом. Ведь это позволяет сразу после выпуска взять высокую планку. В этом случае тоже важно, с какими компаниями сотрудничает вуз и котируются ли эти компании на рынке.</p>\r\n	</li>\r\n	<li>\r\n	<p>Получение &laquo;корочки&raquo;. Поступать в вуз только ради диплома не стоит, но в отдельных случаях и такой вариант возможен &mdash; например, если вы планируете параллельно создавать собственное дело или вы мастер спорта и вам постоянно приходится быть в разъездах. В этом случае и впрямь нельзя идти в университет, где много требуют: вы просто этого не потянете.</p>\r\n	</li>\r\n	<li><strong>Задавайте вопросы в зависимости от вашей цели и не доверяйте личному мнению</strong></li>\r\n</ul>\r\n\r\n<p>У обучения в вузе не бывает &laquo;тест-драйва&raquo;, но представить его себе можно, узнав о как можно большем числе характеристик. Если вы уже поняли, какую цель ставите перед собой, задавать вопросы будет легче. О студенческой жизни узнавайте у учащихся: есть ли она вообще, какая она. Очень важно узнавать не чье-то субъективное мнение, а объективную информацию. На вопрос &laquo;нравится ли вам тут учиться?&raquo; один ответит &laquo;нравится&raquo;, а другой &mdash; &laquo;нет&raquo;. Формулируйте вопросы так, чтобы в тексте ответа прозвучали цифры и факты. Например: &laquo;Много ли студентов отчисляются каждый год?&raquo;</p>\r\n\r\n<ul>\r\n	<li><strong>Подумайте, важна ли вам обстановка</strong></li>\r\n</ul>\r\n\r\n<p>Для некоторых абитуриентов много значат планировка, инфраструктура и расположение здания, в котором проходит учеба, а для некоторых это не важно. Но один скажет: &laquo;Я не смогу ехать от метро на маршрутке&raquo;, а другой ответит: &laquo;А для меня это не играет роли&raquo;.</p>\r\n\r\n<p>О комфорте стоит подумать, но он не должен становиться решающим аргументом. Самое главное, от чего стоит отталкиваться при выборе университета, &mdash; есть ли у него интересующие вас направления подготовки.</p>', NULL, 1, '2019-11-26 22:48:28', '2019-11-27 00:40:03'),
(21, NULL, NULL, NULL, 'Профессий, которые позволят много путешествовать', 'Профессий, которые позволят много путешествовать', NULL, '<p style=\"text-align:center;\"><strong>Дипломат</strong></p>\r\n\r\n<p>Дипломат является лицом своего государства в чужой стране, представляет его интересы, участвует в переговорах и разрешает возникающие конфликты. Эта профессия сыздавна считается одной из самых престижных и интересных, но при этом она очень сложна. Необходимо разбираться в экономике и политике, знать культурные особенности страны, в которую вас направляют, ее историю. Помимо этого надо обладать определенным шармом, уметь расположить к себе собеседника, быстро реагировать на внезапно возникающие сложности. Также потребуется знание нескольких языков, умение писать и общаться со СМИ.</p>\r\n\r\n<p>При этом дипломатия &mdash; это отличная возможность путешествовать, хотя нужно понимать, что пребывание в других странах может затянуться на годы, а отправлять вас будут в самые разные уголки планеты. Дополнительный минус профессии &mdash; то, что женщинам здесь пробиться намного сложнее, чем мужчинам, по крайней мере, в Казахстане.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Геолог</strong></p>\r\n\r\n<p>Геологи &mdash; специалисты, которые занимаются изучением строения, состава и закономерностей развития Земли. Геологи исследуют минералы, осадочные породы, нарушения земной коры и полезные ископаемые, анализируют землетрясения и извержения вулканов, историческую последовательность геологических процессов и многое другое.</p>\r\n\r\n<p>Помимо проведения лабораторных анализов, разработки документации и рекомендаций, такие специалисты время от времени отправляются на полевые исследования в самые разные регионы: ищут месторождения полезных ископаемых, оценивают возможность строительства на новых территориях различных сооружений, от заводов и электростанций до метро.</p>\r\n\r\n<p>С одной стороны, профессия геолога дает возможность побывать как в глухих уголках тайги, так и в жарких африканских странах. С другой, нужно быть готовым жить в самых разных, иногда достаточно тяжелых условиях, поэтому для работы в поле, помимо необходимых знаний, понадобится хорошая физическая подготовка и выносливость.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Менеджер турфирмы</strong></p>\r\n\r\n<p>Большую часть времени менеджеры в туристических фирмах занимаются подбором поездок для клиентов, общением с отелями и гостиницами и заключением договоров. Однако когда разрабатываются новые туры, открываются новые направления или отели, специалисты отправляются туда, чтобы лично оценить все нюансы, плюсы и минусы.</p>\r\n\r\n<p>В крупных турфирмах даже существуют отдельные вакансии &laquo;путешественников&raquo;, которые профессионально занимаются изучением новых направлений и оценкой уже существующих туров. Попасть на такую позицию непросто, но постараться стоит: ведь она, по сути, позволяет посвятить всю жизнь путешествиям. Для работы понадобится знание языков, желание и умение очень много общаться с людьми, внимательность к деталям, а также выносливость и стрессоустойчивость: ведь летать и ездить придется часто.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Пилот</strong></p>\r\n\r\n<p>Стать пилотом в детстве мечтают многие, но далеко не все действительно решаются на это. Ведь для того чтобы управлять самолетом, нужно не только закончить летное училище, но и обладать отменным здоровьем, состояние которого врачи будут постоянно проверять во время обучения и работы. Чтобы попасть на международные рейсы, особенно в крупную компанию, придется &laquo;налетать&raquo; большое количество часов. Пилоту понадобится хладнокровие, умение быстро и четко реагировать и отдавать приказы, но при этом всегда работать в команде с коллегами в воздухе и на земле.</p>\r\n\r\n<p>Пилоты могут работать в гражданской авиации, и это самый привлекательный с точки зрения путешествий вариант, поскольку попасть можно в самые популярные и интересные места. Другой вариант &mdash; грузоперевозки, военные перевозки или служба спасения.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Бортпроводник</strong></p>\r\n\r\n<p>Еще один вариант для тех, кто хочет работать в авиакомпании, &mdash; это профессия бортпроводника. Медицинские проверки в этом случае будут не такими жесткими, как в случае с пилотами, хотя стюардам и стюардессам все равно нужно быть в хорошей физической форме и обладать крепким вестибулярным аппаратом. Для работы достаточно закончить специальные курсы и знать хотя бы один иностранный язык.</p>\r\n\r\n<p>Стоит понимать, что профессия бортпроводника кажется простой только на первый взгляд. Тут придется постоянно быть на ногах, иногда выдерживать по нескольку перелетов в день, улыбаться и вести себя спокойно в сложных ситуациях и договариваться даже с самыми нервными пассажирами не срываясь и не повышая голоса.</p>\r\n\r\n<p>При этом профессия и впрямь дает возможность посмотреть мир. Сразу на международные рейсы попасть непросто, однако при должном упорстве и трудолюбии вполне можно добиться этого достаточно быстро.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Журналист-международник</strong></p>\r\n\r\n<p>Журналисты-международники считаются элитой своей профессии. Такое мнение вполне оправдано, поскольку работа здесь может быть весьма интересной. Часто она требует большого мастерства.</p>\r\n\r\n<p>Международники, которые занимаются зарубежными новостями, как правило, работают в редакциях или даже из дома, хотя в рамках профессии по-прежнему существуют способы связать свою жизнь с путешествиями. Можно стать собственным корреспондентом и жить в другой стране (впрочем, год за годом таких собкоров становится все меньше: редакции чаще подыскивают журналиста на месте вместо того, чтобы организовывать кому-то переезд). А можно заняться освещением событий в горячих точках (хотя эта специальность связана с большим риском).</p>\r\n\r\n<p>Международная журналистика подразумевает знание нескольких языков, умение быстро и емко писать, отличные знания в области политики, экономики, социальной жизни и истории &laquo;профильных&raquo; стран. Для работы в горячих точках нужно обладать хорошей физической и блестящей психологической подготовкой, быть стрессоустойчивым и выносливым, уметь быстро реагировать и договариваться с людьми.</p>', NULL, 1, '2019-11-26 22:48:49', '2019-11-27 00:31:46'),
(22, NULL, NULL, NULL, 'Предметы определяющие будущую профессию', 'Предметы определяющие будущую профессию', NULL, '<p style=\"text-align:center;\"><strong>Биология</strong></p>\r\n\r\n<p>Часто те, кому нравится этот предмет, выбирают сферу медицины. Но мир меняется, люди живут дольше и хотят не просто быть здоровыми, но и выглядеть лучше, правильно питаться, сохранять высокое качество жизни. Поэтому наиболее востребованными будут медики, которые занимаются генетическими исследованиями, вопросами образа жизни и старения. Перспективными также считаются направления на стыке с информационными технологиями, которые позволяют создавать базы данных о состоянии здоровья пациентов и проводить диагностику в онлайн-среде.</p>\r\n\r\n<p>Другая сфера для любителей биологии &mdash; сельское хозяйство, которому уже сейчас приходится решать проблему обеспечения продовольствием растущего населения в условиях ограниченности ресурсов. Одна из самых перспективных профессий в этой отрасли &mdash; биолог-генетик. Его задача &mdash; корректировать свойства сельскохозяйственных растений, чтобы они быстрее созревали, содержали больше питательных веществ и были устойчивы к вредителям и болезням.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Информатика</strong></p>\r\n\r\n<p>Трудно найти в современном мире сферы, в которых можно обойтись без информационных технологий. Среди наиболее перспективных направлений для тех, кому нравится программирование, традиционно называют робоинженерию и инженерию дронов, которые в будущем смогут взять на себя огромное количество функций в самых разных областях, от картографии до ритейла.</p>\r\n\r\n<p>Еще одно интересное направление &mdash; специалист по информационной безопасности, который разрабатывает и применяет средства информационной защиты. Атаки на популярные ресурсы и сайты госучреждений, похищение данных и массовые взломы аккаунтов говорят о том, что с ростом цифрового пространства будет расти и спрос на &laquo;белых хакеров&raquo;.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Физика</strong></p>\r\n\r\n<p>Если вам нравится этот предмет, имеет смысл обратить внимание на профессию энергетика, особенно в сфере альтернативных источников энергии. Использование ветра, солнца и воды позволяет решить проблему нехватки традиционных энергоносителей. И даже если пока такие технологии считаются дорогими и &laquo;капризными&raquo; (использовать солнечную энергию, например, можно далеко не в каждой стране), в будущем их применение, очевидно, станет массовым: ведь эта сфера быстро развивается.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Химия</strong></p>\r\n\r\n<p>Темпы развития промышленности и строительства уже сформировали растущий спрос на химиков-технологов, которые занимаются разработкой новых материалов. Одно из новых направлений для представителей этой профессии &mdash; трехмерная печать, которая с каждым годом становится все доступнее. Создание новых видов пластика (в том числе и из биоматериалов) уже в скором времени позволит расширить сферу применения 3D-принтеров.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Математика</strong></p>\r\n\r\n<p>Поклонники этой учебной дисциплины традиционно выбирают программирование и IT, а также экономику и финансы. И хотя рынок экономистов сейчас перенасыщен, и в этой сфере существуют новые перспективные направления &mdash; например, аналитик и трейдер-аналитик криптовалют, а также специалист по майнингу (владелец компьютеров-майнеров, которые &laquo;добывают&raquo; биткоины). Ведь сегодня криптовалюты &mdash; одна из самых рискованных и в то же время самых прибыльных инвестиций.</p>\r\n\r\n<p>&laquo;Математикам&raquo; стоит обратить внимание и на профессию специалиста в области big data (больших информационных массивов). Уже сейчас такие аналитики востребованы в самых разных сферах, хотя чаще всего работают на IT-гигантов.</p>\r\n\r\n<p style=\"text-align:center;\"><strong>Литература</strong></p>\r\n\r\n<p>Компьютер вряд ли изничтожит книгу, однако те, кому нравится литература, не обязательно должны становиться редакторами или журналистами. Сегодня одной из самых интересных в этой области считается профессия сценариста, ведь доля визуального контента в информационном пространстве постоянно растет. Писать сценарии можно не только для фильмов, но и для шоу, роликов, онлайн-уроков и даже образовательных курсов.</p>', NULL, 1, '2019-11-26 22:49:08', '2019-11-27 00:33:32'),
(23, NULL, NULL, NULL, 'Признаки хорошего вуза', 'Признаки хорошего вуза', NULL, '<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе демократичная внутренняя среда</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>В идеале хороший вуз должен быть свободным от жесткой иерархии. В учебных аудиториях встречаются на равных люди из разных социальных слоев, с разными убеждениями. Профессор &mdash; не беспрекословный авторитет, а первый среди равных. Такая либеральная обстановка способствует циркуляции знаний, что подтверждают специалисты по управлению знаниями (knowledge management).</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе развивают практику командной работы</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Настоящий &laquo;живой&raquo; академический семинар и проектные команды &mdash; это уникальные площадки, где в интеллектуальном взаимодействии студентов и преподавателей возникают новые идеи, инсайты, прорывы научной мысли. Исследователи и изобретатели-одиночки уходят в прошлое, открытия делаются большими слаженными командами. Поэтому очень важно уметь продуктивно взаимодействовать с преподавателями и будущими коллегами. Если такие семинары и проектные группы в вузе есть &mdash; вы непременно научитесь работать в команде.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз в чем-то подобен государству</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Традиции студенческого самоуправления имеют очень глубокие корни. Первые европейские университеты в Средние века имели экстерриториальный статус и были, по сути, государствами в государстве, со своим уставом, законами и укладом жизни. Хороший вуз в известной степени автономен, то есть он сам задает правила игры.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз дает возможность изучить и совершенствовать английский язык</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Благодаря интернету доминирование английского языка в мире политики, бизнеса и науки закрепилось окончательно. Блестящее знание английского языка дает уверенность, что ты будешь конкурентоспособным в современном мире.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе процветает здоровая студенческая конкуренция</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Невозможно противостоять деградации, пребывая в комфортной, но расслабляющей среде. Все хорошее в человеческом мире &mdash; результат селекции. Любая конкуренция полезна. Соревнуясь с другими, человек неизбежно старается стать лучше. Это очень мощный стимул, и вам не избежать его благотворного воздействия. К сожалению, отсев в такой ситуации неизбежен, до финиша доходят не все.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе формируют привычку думать</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Студент осваивает механизмы получения новых знаний и воспитывает в себе пожизненную потребность в учебе. Человек, не умеющий учиться, причем учиться всерьез, осваивая все более сложные специальности, оказывается в заведомо проигрышном положении.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз предлагает гибкую ненасильственную специализацию</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Приоритет отдается фундаментальным знаниям и широкому кругозору в гуманитарных и естественных науках. Профессиональная специализация происходит не на начальных курсах, а только на стадии аспирантуры. Поэтому, если в процессе учебы изменились предпочтения, то поменять специальность на определенном этапе можно относительно безболезненно.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе учат рассуждать нестандартно</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Сейчас ценится не &laquo;квадратное&raquo;, шаблонное мышление, а умение рассуждать критически и независимо. Развитию &laquo;правополушарности&raquo; способствуют методики, нацеленные на пробуждение творческого, изобретательского мышления.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>У хорошего вуза собственные учебные планы и программы</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Чтобы определить, насколько хорош или плох тот или иной факультет, недостаточно знать о его репутации или репутации вуза в целом. Лучшего всего сравнивать его программы с программами соответствующих курсов в лучших университетах мира &mdash; Гарвардом, Принстоном, MIT. Важное свойство качественного современного университета &mdash; способность быстро перенимать опыт, новации, только что появившиеся в других вузах, и включать их в свою программу.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз обладает брендовым преподавательским составом</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>В вузе преподают люди, у которых хочется учиться. Их достижения зримы и реальны. Лекции &mdash; лекциями, книги &mdash; книгами, но есть еще что-то. Есть школа. Когда знания непосредственно передаются от человека человеку, от учителя &mdash; ученику. Если профессор всерьез не занимается наукой, как можно быть уверенным, что он вовремя узнает о новых идеях и подходах?</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз реально включен в сеть международных связей</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Возможность совершать образовательные путешествия в форме стажировок, каникулярных программ, совместных международных научных проектов, разных форм обменов студентами, участия в международных конференциях. Таким образом поддерживаются языковые навыки, одновременно вы попадаете в ситуацию научного знания, научного поведения, которые приняты в развитых странах. Это глобализованное образование.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе учат решать задачи любой степени сложности</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Траблшутинг &mdash; это нечто большее, чем просто решение проблем. Это комплекс навыков, обеспечивающий системный подход к любой нестандартной ситуации. После выпуска вы обнаружите, что умеете решать задачи, которые вас решать не учили.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз позволяет создать команду единомышленников</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Дружеские связи, которые возникают в студенческие годы, оказывают влияние на всю последующую жизнь. Здесь возникают реально значимые контакты, вы попадаете в круг единомышленников. В процессе обучения вы оказываетесь в уникальной среде со своими ценностями и приоритетами и реализуете свой собственный проект &laquo;однокурсники&raquo;.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>В хорошем вузе большое внимание уделяют всем видам коммуникации</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>За время учебы важно овладеть навыком создания эссе и научных текстов. Но не только. Не менее важно овладеть и искусством слова, ведь риторика, умение убеждать &mdash; одно из главных условий будущего профессионального успеха.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Хороший вуз дает образование, а не профессию</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>В институте с глубокими традициями, сильным преподавательским составом, передовой программой обучения вас научат не какой-то конкретной профессии, а &laquo;поставят&raquo; особую культуру мышления, и научат быстро и качественно овладевать новыми профессиями.</p>', NULL, 1, '2019-11-26 22:49:30', '2019-11-27 00:39:16'),
(24, NULL, NULL, NULL, 'Проходной балл', 'Проходной балл', NULL, '<p>Проходной балл - это оценка ваших знаний при поступлении в вуз. Заведение оценивает качество вашей подготовки и принимает решение о допуске вас к образованию высшего уровня. Поскольку задачей университетов и академий является подготовка специалиста, который может приступить к работе сразу после выпуска, программа обучения рассчитана на определенное время и строится на базовом курсе подготовки. Проходной балл на вступительных испытаниях показывает насколько вы усвоили необходимый для дальнейшего развития базовый курс, если вы оказались менее подготовленным, чем другие &ndash; вы можете не поступить.</p>\r\n\r\n<p>Необходимость получения проходных баллов обусловлена еще и тем, что существует ограничение на количество учащихся, которых вуз может принять &ndash; поэтому берут самых подготовленных.</p>\r\n\r\n<p>Более наглядно формирование проходного балла, показывает пример: на специальность &quot;Искусствоведение&quot; подали заявление 130 человек, принять на специальность вуз может только 45. Допустим, что наибольшее количество баллов - 125 набрал первый абитуриент. Следующий за ним, набрал 120, а третий 115 и так далее до последнего 45 места. Результат последнего из этих 45 и будет минимальным проходным баллом. Оценить свои возможности можно просмотрев списки баллов&nbsp;за прошлые года обучения.</p>\r\n\r\n<p>ВАЖНО:&nbsp;все проходные баллы на нашем сайте и сайтах вузов указаны за ПРОШЛЫЙ год. То есть проходной балл формируется по факту окончания приемной кампании и зачисления студентов. И вы должны понимать, что, например, в калькуляторе ЕНТ расчет идет на основании баллов прошлого года, так как за следующий информации нет и не будет до окончания приемной кампании следующего года.</p>\r\n\r\n<p>В рекомендациях для будущих студентов содержится совет: стараться максимально приблизиться хотя бы к минимальному количеству баллов. Это обусловлено тем, что нередки ситуации, когда зачисленный по проходному баллу студент не успевает подать документы или передумывает поступать и освобождается место, соответственно все результаты поднимаются вверх и тот, кто оказался 46-м, поступает вместо выбывшего.</p>', NULL, 1, '2019-11-26 22:49:54', '2019-11-27 00:19:28');
INSERT INTO `navigator` (`id`, `s_title`, `s_description`, `s_keywords`, `name_ru`, `announce`, `name_kz`, `description`, `image`, `active`, `created_at`, `updated_at`) VALUES
(25, NULL, NULL, NULL, 'Приемы в ВУЗы', 'Приемы в ВУЗы', NULL, '<p>В настоящее время в Казахстане поступить в&nbsp;высшие учебные заведения (ВУЗы)&nbsp;либо в&nbsp;технические учреждения&nbsp;можно на конкурсной основе по результатам&nbsp;ЕНТ&nbsp;или комплексного тестирования для абитуриентов.</p>\r\n\r\n<p><strong>Единое национальное тестирование (ЕНТ)</strong>&nbsp;&ndash; одна из форм отборочных экзаменов для поступления в организации высшего и (или) послевузовского образования.</p>\r\n\r\n<p><strong>ЕНТ проводится для:</strong></p>\r\n\r\n<ul>\r\n	<li>обучающихся выпускных 11 (12) классов организаций среднего образования для зачисления в ВУЗ на платной основе по желанию;</li>\r\n	<li>выпускников организаций среднего образования текущего года для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета, или&nbsp;для зачисления в ВУЗ на платной основе по желанию;</li>\r\n	<li>выпускников организаций среднего образования&nbsp;прошлых лет, технического и профессионального или послесреднего образования для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета, или&nbsp;для зачисления в ВУЗ на платной основе по желанию;</li>\r\n	<li>выпускников технического и профессионального или послесреднего образования, поступающих по образовательным программам высшего образования, предусматривающим сокращенные сроки обучения для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета по желанию;</li>\r\n	<li>выпускников организаций среднего образования, обучавшихся по линии международного обмена школьников за рубежом, а также лиц казахской национальности, не являющихся гражданами Республики Казахстан, окончивших учебные заведения за рубежом для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета, или&nbsp;для зачисления в ВУЗ на платной основе по желанию;</li>\r\n	<li>лиц, зачисленных в ВУЗы по очной форме обучения на платной основе до завершения первого академического периода для зачисления в ВУЗ на платной основе;</li>\r\n	<li>обучающихся ВУЗов по группе образовательных программ, требующие творческой подготовки, и желающих перевестись&nbsp;на другие группы образовательных программ.</li>\r\n</ul>\r\n\r\n<p><strong>Проходной балл&nbsp;</strong><strong>для поступления:</strong></p>\r\n\r\n<ul>\r\n	<li>в национальные ВУЗы&nbsp;по результатам ЕНТ необходимо набрать&nbsp;не менее 65&nbsp;баллов;</li>\r\n	<li>по областям образования&nbsp;&laquo;Педагогические науки&raquo;, &laquo;Сельское хозяйство и биоресурсы&raquo;, &laquo;Ветеринария&raquo; &minus; не менее 60&nbsp;баллов;&nbsp;</li>\r\n	<li>в другие ВУЗы &ndash; не менее 50&nbsp;баллов;&nbsp;</li>\r\n	<li>по области образования&nbsp;&laquo;Здравоохранение и социальное обеспечение (медицина)&raquo; - не менее 65&nbsp;баллов;</li>\r\n	<li>в том числе не менее 5-ти баллов&nbsp;&ndash; по истории Казахстана, математической грамотности, грамотности чтения &ndash; язык обучения, и не менее 5-ти баллов по каждому профильному предмету.</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:77.75pt\">\r\n			<p><strong>Сроки приема заявления</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p><strong>Сроки проведения&nbsp;ЕНТ</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:227.5pt\">\r\n			<p><strong>Участники</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p><strong>ЕНТ проводится</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"3\" style=\"height:40pt; text-align:center; vertical-align:middle; width:77.75pt\">\r\n			<p>с 1 по 15 декабря</p>\r\n			</td>\r\n			<td rowspan=\"3\" style=\"height:40pt; text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>с 15 по 20 января</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>1) обучающиеся выпускных 11(12) классов организаций среднего образования для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:40pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>2) лица, зачисленные&nbsp;в ВУЗы по очной форме обучения на платной основе до завершения первого академического периода</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:50pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>3) обучающиеся ВУЗов по группе образовательных программ, требующие творческой подготовки и желающие&nbsp;перевестись на другие группы образовательных программ</p>\r\n			</td>\r\n			<td style=\"height:50pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:40pt; text-align:center; vertical-align:middle; width:77.75pt\">\r\n			<p>с 1 по 15 февраля</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>с 24 по 29 марта</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>обучающиеся выпускных 11(12) классов организаций среднего образования для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"3\" style=\"height:65pt; text-align:center; vertical-align:middle; width:77.75pt\">\r\n			<p>с 10 марта по 10 мая</p>\r\n			</td>\r\n			<td rowspan=\"3\" style=\"height:65pt; text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>с 20 июня по 5 июля</p>\r\n			</td>\r\n			<td style=\"height:65pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>1) выпускники&nbsp;организаций среднего образования текущего года для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета и (или) для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:65pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>бесплатно</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:75pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>2) выпускники&nbsp;организаций среднего образования прошлых лет, технического и профессионального или послесреднего образования для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета и (или) для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:75pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:90pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>3) выпускники&nbsp;технического и профессионального или послесреднего образования, поступающих по образовательным программам высшего образования, предусматривающим сокращенные сроки обучения для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета по желанию</p>\r\n			</td>\r\n			<td style=\"height:90pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:110pt; text-align:center; vertical-align:middle; width:77.75pt\">\r\n			<p>с 10 мая по 5 июня</p>\r\n			</td>\r\n			<td style=\"height:110pt; text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>с 20 июня по 5 июля</p>\r\n			</td>\r\n			<td style=\"height:110pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>выпускники&nbsp;организаций среднего образования, обучавшиеся по линии международного обмена школьников за рубежом, а также лица&nbsp;казахской национальности, не являющиеся гражданами Республики Казахстан, окончившие&nbsp;учебные заведения за рубежом для участия в конкурсе на присуждение образовательного гранта за счет средств республиканского бюджета или местного бюджета и (или) для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:110pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"4\" style=\"height:40pt; text-align:center; vertical-align:middle; width:77.75pt\">\r\n			<p>с 25 июля по 3 августа</p>\r\n			</td>\r\n			<td rowspan=\"4\" style=\"height:40pt; text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>с 17 по 20 августа</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>1) выпускники&nbsp;организаций среднего образования текущего года для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:40pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:50pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>2) выпускники&nbsp;организаций среднего образования прошлых лет, технического и профессионального или послесреднего образования для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:50pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:85pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>3) выпускники&nbsp;организаций среднего образования, обучавшиеся по линии международного обмена школьников за рубежом, а также лица&nbsp;казахской национальности, не являющиеся гражданами Республики Казахстан, окончившие&nbsp;учебные заведения за рубежом для зачисления в ВУЗ на платной основе по желанию</p>\r\n			</td>\r\n			<td style=\"height:85pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:55pt; text-align:justify; vertical-align:middle; width:227.5pt\">\r\n			<p>4) обучающиеся ВУЗов по группе образовательных программ, требующие творческой подготовки и желающие&nbsp;перевестись&nbsp;на другие группы образовательных программ.</p>\r\n			</td>\r\n			<td style=\"height:55pt; text-align:center; vertical-align:middle; width:69.9pt\">\r\n			<p>платно*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\" style=\"height:19.2pt; text-align:center; vertical-align:middle; width:169.85pt\">\r\n			<p><strong>25 августа</strong></p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"height:19.2pt; text-align:center; vertical-align:middle; width:297.4pt\">\r\n			<p><strong>Зачисление в число студентов</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Формат ЕНТ:&nbsp;5 предметов (3 обязательных + 2 профильных).</p>\r\n\r\n<ul>\r\n	<li>Всего тестовых заданий &mdash; 120.</li>\r\n	<li>Общее время тестирования:&nbsp;3 часа 50 минут (230 минут).</li>\r\n	<li>Максимальный балл: 140.</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p><strong>Блок</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:163.05pt\">\r\n			<p><strong>Предметы тестирования</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p><strong>Кол-во заданий</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p><strong>Формы заданий</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"3\" style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>1 блок</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:163.05pt\">\r\n			<p>Математическая грамотность</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>20</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:163.05pt\">\r\n			<p>Грамотность чтения</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>20</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:163.05pt\">\r\n			<p>История Казахстана</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>20</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"4\" style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>2 блок</p>\r\n			</td>\r\n			<td rowspan=\"2\" style=\"text-align:center; vertical-align:middle; width:163.05pt\">\r\n			<p>1 профильный предмет</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>20</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>10</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного или нескольких правильных ответов из множества предложенных</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\" style=\"text-align:center; vertical-align:middle; width:163.05pt\">\r\n			<p>2 профильный предмет</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>20</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>10</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:191.05pt\">\r\n			<p>С выбором одного или нескольких правильных ответов из множества предложенных</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Тестовые задания по математической грамотности направлены на оценку способности применения математики в жизненных ситуациях, формулировать, применять и интерпретировать математику в различных контекстах. Она включает математическое мышление и использование математических понятий, процедур, знаний и инструментов, которыми описываются, объясняются и предсказываются явления.</p>\r\n\r\n<p>Тестовые задания по грамотности чтения проверяют способность к пониманию и осмыслению письменных текстов, к использованию их содержания для достижения собственных целей, развития знаний и возможностей, для активного участия в жизни общества.</p>\r\n\r\n<p>Профильные предметы выбираются в соответствии c выбранной группы образовательных программ в ВУЗе.</p>\r\n\r\n<table border=\"1\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"text-align:center; vertical-align:middle; width:467.5pt\">\r\n			<p><strong>Комбинация профильных предметов</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p><strong>№</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p><strong>1 профильный предмет</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p><strong>2 профильный предмет</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>1</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Математика</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Физика</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>2</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Математика</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>География</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>3</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Биология</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Химия</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>4</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Биология</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>География</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>5</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Иностранный язык</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Всемирная история</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>6</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>География</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Иностранный язык</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>7</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Всемирная история</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Человек.Общестов.Право</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>8</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Всемирная история</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>География</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>9</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Казахский язык / русский язык</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Казахская литература / русская литература</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>10</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Химия</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Физика</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:2cm\">\r\n			<p>11</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Творческий</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:240.7pt\">\r\n			<p>Творческий</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Формат ЕНТ выпускников ТиПО, поступающих на родственные направления подготовки по образовательным программам высшего образования предусматривающим сокращенные сроки обучения:&nbsp;2 предмета.</p>\r\n\r\n<p>Выпускники колледжей, желающие поступать на другие образовательные программы (неродственные), будут сдавать ЕНТ на общих основаниях.</p>\r\n\r\n<ul>\r\n	<li>Всего тестовых заданий&nbsp;&mdash; 60.</li>\r\n	<li>Общее время тестирования&nbsp;&mdash; 1 час 40 минут (100 минут).</li>\r\n	<li>Максимальный балл: 70.</li>\r\n	<li>Проходной балл: 25.</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:135.55pt\">\r\n			<p><strong>Предметы</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:55.85pt\">\r\n			<p><strong>Кол-во заданий</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:120.45pt\">\r\n			<p><strong>Форма заданий</strong></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:155.65pt\">\r\n			<p><strong>Форма оценивания</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:135.55pt\">\r\n			<p>Общепрофессиональная дисциплина</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:55.85pt\">\r\n			<p>20</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:120.45pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:155.65pt\">\r\n			<p>1 правильный ответ = 1 балл</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"3\" style=\"text-align:center; vertical-align:middle; width:135.55pt\">\r\n			<p>Специальная дисциплина</p>\r\n			</td>\r\n			<td rowspan=\"3\" style=\"text-align:center; vertical-align:middle; width:55.85pt\">\r\n			<p>40</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:120.45pt\">\r\n			<p>С выбором одного правильного ответа из пяти предложенных (20)</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:155.65pt\">\r\n			<p>1 правильный ответ = 1 балл</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:120.45pt\">\r\n			<p>С выбором нескольких правильных ответов из множества предложенных (10)</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:155.65pt\">\r\n			<p>Полный выбор правильных ответов = 2 балла,</p>\r\n\r\n			<p>1 ошибка (не найден 1 правильный ответ или выбран 1 неправильный ответ) = 1 балл,</p>\r\n\r\n			<p>2 или более ошибок = 0 баллов</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle; width:120.45pt\">\r\n			<p>ситуационные задания (10)</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:155.65pt\">\r\n			<p>1 правильный ответ = 1 балл</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>В ситуационных заданиях дается ситуация, к которой прилагаются 5 заданий. Ситуация может быть представлена текстом (художественным, научным), схемой, графиком, табличными значениями, картинами (фотографиями) или содержать в себе сразу несколько видов представления информации. Для успешного выполнения этих заданий необходимо внимательно ознакомиться с ситуацией и заданиями. Правильный ответ может быть заключен в контексте ситуации или задания.</p>\r\n\r\n<p>Выпускники 11 (12) классов организаций среднего образования имеют возможность сдавать ЕНТ 4 раза в год. При успешной сдаче ЕНТ обучающиеся 11 (12) классов могут поступить в ВУЗ на платной основе. Выпускники школ не лишаются возможности участвовать в ЕНТ и участвовать в конкурсе на присуждение государственных образовательных грантов в июне после участия в ЕНТ, который пройдет в январе и марте. При этом для участия в конкурсе на присуждение образовательного гранта поступающим необходимо сдать ЕНТ, который будет проходить в июне-июле.</p>\r\n\r\n<p>Обладатели &laquo;Алтын белгi&raquo;, победители и призеры республиканских, международных олимпиад по общеобразовательным предметам и научных проектов сдают ЕНТ на общих основаниях, при этом если их результаты будут равными с теми кто не обладает вышеперечисленными наградами, будут преобладать в получении грантов. Победителям и призерам 5 международных олимпиад по общеобразовательным предметам будут выделены специальные гранты.</p>\r\n\r\n<p>Если тестируемый не согласен с полученными баллами или имеет замечания по качеству тестовых заданий, он может подать заявление в апелляционную комиссию, имеющуюся в каждом пункте проведения ЕНТ. Заявление на апелляцию можно подать до 13 часов следующего дня после объявления результатов ЕНТ, и оно будет рассмотрено в течение одного дня. Заявление подается лично тестируемым, при этом указывается конкретный предмет и вопросы. И каждый вопрос должен быть обоснованным. Заявителю необходимо иметь при себе документ, удостоверяющий его личность, пропуск на тестирование.</p>\r\n\r\n<p>Оплату за участие в ЕНТ или КТА можно произвести во всех кассах банков второго уровня Республики Казахстан. Назначение платежа &ndash; &laquo;За комплексное тестирование ЕНТ или КТА&raquo;.</p>\r\n\r\n<p>Также допускается оплата только через терминалы АО &laquo;Народного Банка Казахстана&raquo;. Стоимость проведения ЕНТ - 2242 тенге.</p>\r\n\r\n<p><strong>Лица, поступающие в магистратуру и докторантуру сдают:</strong></p>\r\n\r\n<ul>\r\n	<li>в магистратуру&nbsp;с казахским или русским языком обучения&nbsp;&ndash; комплексное тестирование, состоящее из теста по иностранному языку (английский, французский, немецкий по выбору), теста по профилю группы образовательных программ, теста на определение готовности к обучению;</li>\r\n	<li>в магистратуру с английским языком обучения&nbsp;&ndash; комплексное тестирование, состоящее из теста по профилю группы образовательных программ на английском языке и теста на определение готовности к обучению на английском языке;</li>\r\n	<li>в докторантуру&nbsp;предоставляют международные сертификаты, подтверждающие владение иностранным языком в соответствии с общеевропейскими компетенциями (стандартами) владения иностранным языком и сдают вступительный экзамен по группам образовательных программ докторантуры.</li>\r\n</ul>\r\n\r\n<p>Срок приема заявлений с 3 по 25 июля календарного года.</p>\r\n\r\n<p>Вступительные экзамены&nbsp;по иностранным языкам, по специальности и комплексное тестирование проводятся с 8 по 16 августа&nbsp;календарного года, зачисление &ndash; до 28 августа календарного года.</p>\r\n\r\n<p><strong>Формат комплексного тестирования в магистратуру с казахским или русским языком обучения</strong></p>\r\n\r\n<p>Количество тестовых заданий &ndash; 130.</p>\r\n\r\n<p>Время тестирования - 235 минут (3 часа 55 минут).</p>\r\n\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:50px\">\r\n			<p>Блок</p>\r\n			</th>\r\n			<th colspan=\"3\" style=\"text-align:center; vertical-align:middle; width:125px\">\r\n			<p>Иностранный язык</p>\r\n			</th>\r\n			<th colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:120px\">\r\n			<p>Тест на определение готовности к обучению</p>\r\n			</th>\r\n			<th colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:1px\">\r\n			<p>Тест по специальности</p>\r\n			</th>\r\n			<th rowspan=\"3\" style=\"text-align:center; vertical-align:middle; width:35px\">\r\n			<p>Итого</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:63.55pt\">\r\n			<p>Секции</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:42.55pt\">\r\n			<p>Слушание</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:49.6pt\">\r\n			<p>Лексико-грамматика</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>Чтение</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:63.8pt\">\r\n			<p>Критическое мышление (элементарная математика, интерпретация различных форм информации)</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:63.8pt\">\r\n			<p>Аналитическое мышление (анализ академических и научно-популярных текстов, определение скрытых закономерностей, причинно-следственных связей)</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>Дисциплина 1</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:42.55pt\">\r\n			<p>Дисциплина 2</p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:63.55pt\">\r\n			<p>Язык</p>\r\n			</th>\r\n			<td colspan=\"3\" style=\"text-align:center; vertical-align:middle; width:134.65pt\">\r\n			<p>Английский/немецкий/французский</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:127.6pt\">\r\n			<p>Казахский/русский</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:3cm\">\r\n			<p>Казахский/русский</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th rowspan=\"2\" style=\"height:8.45pt; text-align:center; vertical-align:middle; width:63.55pt\">\r\n			<p>Количество заданий</p>\r\n			</th>\r\n			<td c