\r\n			</th>\r\n			<td colspan=\"3\" style=\"text-align:center; vertical-align:middle; width:134.65pt\">\r\n			<p>1 балл</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:127.6pt\">\r\n			<p>1 балл</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>1 балл</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.55pt\">\r\n			<p>2 балла &ndash; все правильные ответы, 1 балл &ndash; за одну ошибку, 0 баллов &ndash; за две и более ошибок</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:63.55pt\">\r\n			<p>Максимальное количество баллов</p>\r\n			</th>\r\n			<td colspan=\"3\" style=\"text-align:center; vertical-align:middle; width:134.65pt\">\r\n			<p>50</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:127.6pt\">\r\n			<p>30</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>30</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.55pt\">\r\n			<p>40</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>150</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:63.55pt\">\r\n			<p>Время на решение (мин)</p>\r\n			</th>\r\n			<td colspan=\"3\" style=\"text-align:center; vertical-align:middle; width:134.65pt\">\r\n			<p>75</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:127.6pt\">\r\n			<p>50</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>60</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.55pt\">\r\n			<p>50</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:42.5pt\">\r\n			<p>235</p>\r\n			</td>\r\n		</tr>\r\n	