е скрытых закономерностей, причинно-следственных связей)</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>Дисциплина 1</p>\r\n			</th>\r\n			<th style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>Дисциплина 2</p>\r\n			</th>\r\n			<th rowspan=\"2\" style=\"text-align:center; vertical-align:middle; width:70.9pt\">\r\n			<p>&nbsp;</p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Язык</p>\r\n			</th>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>Казахский/русский/английский</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>Английский</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th rowspan=\"2\" style=\"height:8.45pt; text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Количество заданий</p>\r\n			</th>\r\n			<td style=\"height:8.45pt; text-align:center; vertical-align:middle; width:98.7pt\">\r\n			<p>15</p>\r\n			</td>\r\n			<td style=\"height:8.45pt; text-align:center; vertical-align:middle; width:106.3pt\">\r\n			<p>15</p>\r\n			</td>\r\n			<td style=\"height:8.45pt; text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>30</p>\r\n			</td>\r\n			<td style=\"height:8.45pt; text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>20</p>\r\n			</td>\r\n			<td rowspan=\"2\" style=\"height:8.45pt; text-align:center; vertical-align:middle; width:70.9pt\">\r\n			<p>80</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\" style=\"height:9.8pt; text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>30</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"height:9.8pt; text-align:center; vertical-align:middle; width:6cm\">\r\n			<p>50</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Форма тестовых заданий</p>\r\n			</th>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>Выбор одного правильного ответа</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>Выбор одного правильного ответа</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>Выбор одного или нескольких правильных ответов</p>\r\n			</td>\r\n			<td rowspan=\"2\" style=\"text-align:center; vertical-align:middle; width:70.9pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Оценивание</p>\r\n			</th>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>1 балл</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>1 балл</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>2 балла &ndash; все правильные ответы, 1 балл &ndash; за одну ошибку, 0 баллов &ndash; за две и более ошибок</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Максимальное количество баллов</p>\r\n			</th>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>30</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>30</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>40</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:70.9pt\">\r\n			<p>100</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Время на решение (мин)</p>\r\n			</th>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>50</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>60</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>50</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:70.9pt\">\r\n			<p>160</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center; vertical-align:middle; width:78.25pt\">\r\n			<p>Пороговый балл</p>\r\n			</th>\r\n			<td colspan=\"2\" style=\"text-align:center; vertical-align:middle; width:205pt\">\r\n			<p>7</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:78pt\">\r\n			<p>8</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:92.1pt\">\r\n			<p>10</p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:middle; width:70.9pt\">\r\n			<p>25</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>На обучение по образовательному гранту в магистратуру с казахским или русским языком на конкурсной основе зачисляются лица, набравшие наивысшие баллы по комплексному тестированию в сумме:</p>\r\n\r\n<ul>\r\n	<li>для научно-педагогической магистратуры &ndash; не менее 100 баллов;</li>\r\n	<li>для профильной магистратуры &ndash; не менее 80 баллов.</li>\r\n</ul>\r\n\r\n<p>На обучение в магистратуру с а английским языком по образовательному гранту на конкурсной основе зачисляются лица, набравшие наивысшие баллы по комплексному тестированию в сумме не менее 25 баллов.</p>\r\n\r\n<p>На обучение в магистратуру по направлению здравоохранения и социального обеспечения (медицина), резидентуру по образовательному гранту на конкурсной основе зачисляются лица, набравшие наивысшие баллы по вступительным экзаменам в сумме не менее 130 баллов.</p>\r\n\r\n<p>На обучение в докторантуру по образовательному гранту на конкурсной основе зачисляются лица, набравшие наивысшие баллы по вступительным экзаменам в сумме не менее 150 баллов.</p>', NULL, 1, '2019-11-26 22:50:13', '2020-01-06 13:20:12'),
(26, NULL, NULL, NULL, 'Университет', 'Университет', NULL, '<p>Университет &ndash; это многопрофильный ВУЗ, проводящий подготовку бакалавров, специалистов и магистров по большому числу специальностей. В его компетенции также находится переподготовка и повышение квалификации, научная работа не менее чем в 5-ти областях, соответствующих деятельности учебного заведения.</p>\r\n\r\n<p><strong>Ключевые черты:</strong></p>\r\n\r\n<ul>\r\n	<li>Широкий круг специальностей, по которым проводится подготовка обучающихся студентов;</li>\r\n	<li>Большой состав преподавателей, соответствующий критериям и естественным образовательным потребностям;</li>\r\n	<li>Возможность включения в состав ряда институтов, их преобразование в факультеты.</li>\r\n</ul>\r\n\r\n<p>Именно университет (а не академию, как многие считают) принято считать наиболее статусным ВУЗом в сравнении с остальными.</p>\r\n\r\n<p>Закон при этом о статусах ничего не говорит, лишь обуславливает критерии градации. И одновременно с этим многие академии стремительно преобразовываются в университеты.</p>\r\n\r\n<p>Данный факт обуславливается не столько стремлением повысить свой &laquo;статус&raquo; и привлечь студентов, сколько желание получить максимально широкие возможности для осуществления подготовки по непрофильным специальностям (по образовательным программам, выходящим за пределы компетенции и выбранной ВУЗом области).</p>', NULL, 1, '2019-11-26 22:54:36', '2019-12-19 10:49:27'),
(27, '1', '2', '3', 'Академия', 'Академия', NULL, '<p>Академия &ndash; это ВУЗ, готовящий студентов по широкому кругу специальностей в одной из отраслей общественной деятельности. Он также может проводить переподготовку и повышение квалификации специалистов.</p>\r\n\r\n<p><strong>Ключевые черты:</strong></p>\r\n\r\n<ul>\r\n	<li>Широкий круг образовательных программ;</li>\r\n	<li>Подготовка студентов в одной отрасли;</li>\r\n	<li>Преподавательский состав меньше в сравнении с университетским.</li>\r\n</ul>\r\n\r\n<p>Академия также проводит научные исследования, но только в своей отрасли. Поэтому научная работа не является столь же масштабной, как в университетах.</p>\r\n\r\n<p>Акцент на одну область может накладывать отпечаток и на число студентов, и на объемы научной работы. В теории ВУЗ ориентирован на обеспечение одной из отраслей человеческой деятельности специалистами высокого класса за счет акцентирования программ подготовки именно на эту сферу.</p>\r\n\r\n<p>Основным же отличием академии от других вузов является обучение по одному направлению, например, медицина, финансы, искусство, что дает возможность глубоко изучить теорию и уделить больше времени совершенствованию необходимых практических навыков.</p>', NULL, 1, '2019-11-26 22:54:45', '2020-01-28 03:46:54'),
(28, '1', '2', '3', 'Институт', 'Институт', NULL, '<p>Институт &ndash; ВУЗ, проводящий подготовку студентов по узкому кругу специальностей в одной области профессиональной деятельности. Этот ВУЗ можно назвать узкоспециализированным, из-за чего его статус кажется самым низким.</p>\r\n\r\n<p><strong>Ключевые черты:</strong></p>\r\n\r\n<ul>\r\n	<li>Узкий круг специальностей;</li>\r\n	<li>Подготовка студентов в одной области профессиональной деятельности;</li>\r\n	<li>Преподавательский состав меньше, чем в академиях.</li>\r\n</ul>\r\n\r\n<p>Основная особенность института, как самостоятельного вуза это направленность его научной деятельности, она носит практический характер, имеет целью создание конкретных практических решений. В остальном он также имеет структуру из подинститутов, факультетов и кафедр, должен иметь устав, лицензию и аккредитацию.</p>\r\n\r\n<p>Интересно, что институты редко становятся факультетами университетов и академий. Гораздо чаще наблюдается обратный процесс &ndash; от университета отделяются факультеты, которые получают статус институтов и способность к самоуправлению. Такая практика распространена не только в Казахстане, но и во многих европейских странах.</p>', NULL, 1, '2019-11-26 22:54:56', '2020-01-28 03:37:09');
