INSERT INTO `requirements` (`id`, `degree_id`, `content_ru`, `content_kz`, `created_at`, `updated_at`) VALUES
(1, 1, '<p><strong>Для зачисления в университет сдаются следующие документы:</strong></p>\r\n\r\n<ul>\r\n	<li>Заявление на имя ректора</li>\r\n	<li>Аттестат или диплом (оригинал+копия)</li>\r\n	<li>Копия удостоверения личности - 2 шт.</li>\r\n	<li>Медицинская справка по форме 086-У (снимок флюорографии)</li>\r\n	<li>Копия формы 063 (прививочная карта)</li>\r\n	<li>Сертификат ЕНТ или КТА (оригинал+копия)</li>\r\n	<li>Фотография размером 3х4 - 6 шт.</li>\r\n	<li>Копия регистрации приписного свидетельства для юношей (военная кафедра при вузе)</li>\r\n</ul>\r\n\r\n<p><strong>Дополнительную информацию по интересующим вопросам можете получить непосредственно в учебном заведении!</strong></p>', NULL, '2019-01-06 02:55:28', '2019-06-15 05:36:45'),
(2, 2, '<p><strong>Для зачисления в университет сдаются следующие документы:</strong></p>\r\n\r\n<ul>\r\n	<li>Заявление на имя ректора</li>\r\n	<li>Диплом об образовании бакалавра с приложениями (оригинал+копия)</li>\r\n	<li>Копия удостоверения личности - 2 шт.</li>\r\n	<li>Медицинская справка по форме 086-У (снимок флюорографии)</li>\r\n	<li>Личный листок по учету кадров и документ, подтверждающий трудовую деятельность (для лиц, имеющих трудовой стаж)</li>\r\n	<li>Фотография размером 3х4 - 6 шт.</li>\r\n	<li>Копия международного сертификата, подтверждающего владение иностранным языком в соответствии с общеевропейскими компетенциями (стандартами) владения иностранным языком (при наличии)</li>\r\n	<li>Список научных и научно-методических работ, копии сертификатов, грамот и дипломов (при наличии)</li>\r\n</ul>\r\n\r\n<p><strong>Дополнительную информацию по интересующим вопросам можете получить непосредственно в учебном заведении!</strong></p>', NULL, '2019-01-10 08:28:29', '2019-05-29 09:16:28'),
(3, 3, '<p><strong>Для зачисления в университет сдаются следующие документы:</strong></p>\r\n\r\n<ul>\r\n	<li>Заявление на имя ректора</li>\r\n	<li>Диплом об образовании бакалавра и магистра с приложениями (оригинал+копия)</li>\r\n	<li>Копия удостоверения личности - 2 шт.&nbsp;</li>\r\n	<li>Медицинская справка по форме 086-У (снимок флюорографии)</li>\r\n	<li>Личный листок по учету кадров (оригинал), нотариально заверенную копию документа и заверенная кадровой службой по месту работы, подтверждающего трудовой стаж (выписка из единого накопительного фонда о перечисленных обязательных пенсионных взносах за указанный период работы)&nbsp;</li>\r\n	<li>Фотография размером 3х4 - 6 шт.</li>\r\n	<li>Копия международного сертификата, подтверждающий &nbsp;владение иностранным языком в соответствии с общеевропейскими компетенциями (стандартами) владения иностранным языком</li>\r\n	<li>Список научных и научно-методических работ, копии сертификатов, грамот и дипломов (при наличии)</li>\r\n</ul>\r\n\r\n<p><strong>Дополнительную информацию по интересующим вопросам можете получить непосредственно в учебном заведении!</strong></p>', NULL, '2019-01-10 08:32:19', '2020-01-06 03:33:18');
