(115, 'Казахстанская инновационная академия', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2019-05-30 06:36:35', '2019-05-30 06:36:35', '-', 'Perspiciatis consequuntur quisquam consequatur et blanditiis ad eum similique voluptas dolorem autem sit laudantium similique officia nostrum nesciunt sunt dolores consequatur doloremque voluptates quaerat praesentium et reprehenderit dolores tempora et natus sint occaecati eum et impedit ipsa nostrum eaque tenetur nesciunt quia nam atque quo rerum quia neque et porro vero voluptas sunt.', 'Voluptates voluptas velit eum quia omnis quo et eligendi qui accusamus autem aut cum qui est esse officia temporibus dicta cumque nihil ut nesciunt nemo molestiae sed quia magni amet aliquam est facilis rerum quasi fugit perferendis modi maiores nam reprehenderit vero odio fuga ea ipsam error eius voluptatem distinctio voluptates quibusdam deserunt et quo sit modi dolorem et eligendi est ipsum ut hic nostrum sunt id laboriosam animi nulla et est et ut molestiae non et ab et exercitationem error ea ut aliquam numquam ut est quo deserunt itaque porro et facere ex aut quae fugit sit est qui dignissimos quia possimus voluptas repellat qui ipsa blanditiis minima dolores beatae et est culpa voluptatibus doloremque quia consequuntur sit facilis exercitationem sit placeat illo quia similique impedit dolores nisi ut non iure magni molestiae cupiditate quae omnis molestiae odit quia eum commodi velit atque rerum ad illo blanditiis autem magni pariatur libero molestiae alias reprehenderit et vitae aut deleniti rerum ut aut voluptatem qui labore labore ut ad rem ea omnis iusto quos voluptas asperiores fuga ipsa quae blanditiis sit unde debitis non quo error vero voluptates nulla quam modi sint non cumque voluptatibus consequatur animi dolorum consequuntur nobis necessitatibus autem accusamus et quo laboriosam est eos autem magni et ab debitis occaecati voluptas et at pariatur aperiam.', 'Odio cum ratione quia vel quis ullam numqua